(2391, 1, 449, '', 'Mary, liker du Kabuki?', '', 8, '2010-09-21 15:48:17', '2010-09-29 03:30:00', 8, 8),
(2392, 1, 449, '', 'Kabuki?  Jeg er ikke godt kjent med Kabuki.  Men, Robert sa at det var interessant.', '', 8, '2010-09-21 15:48:37', '2010-09-29 03:30:00', 8, 8),
(2393, 1, 449, '', 'Jeg har to billetter til Kabuki, s&aring; vil du kom og se den?', '', 8, '2010-09-21 15:48:13', '2010-09-29 03:30:00', 8, 8),
(2394, 1, 449, '', 'Ja, gjerne.  N&aring;r er det?', '', 8, '2010-09-21 15:48:29', '2010-09-29 03:30:00', 8, 8),
(2395, 1, 449, '', 'P&aring; torsdag.  Fra kl. 12:00 til 16:00.', '', 8, '2010-09-21 15:48:24', '2010-09-29 03:30:00', 8, 8),
(2396, 1, 450, '', 'Unnskyld.  To matpakker, takk.', '', 8, '2010-09-21 15:50:51', '2010-09-29 03:30:00', 8, 8),
