(2398, 1, 450, '', 'Og da, &eacute;n te og &eacute;n kaffe.', '', 8, '2010-09-21 15:50:49', '2010-09-29 03:30:00', 8, 8),
(2399, 1, 450, '', 'Det blir 2.800 yen.  Tusen takk.', '', 8, '2010-09-21 15:50:47', '2010-09-29 03:30:00', 8, 8),
(2400, 1, 451, '', 'Den var vakker!', '', 8, '2010-09-21 15:49:59', '2010-09-29 03:30:00', 8, 8),
(2401, 1, 451, '', 'Alle som viser seg p&aring; scenen er menn.', '', 8, '2010-09-21 15:49:56', '2010-09-29 03:30:00', 8, 8),
(2402, 1, 451, '', 'Virkelig?', '', 8, '2010-09-21 15:49:47', '2010-09-29 03:30:00', 8, 8),
