(2464, 1, 462, '', 'var godt - var ikke godt - er godt', '', 8, '2010-09-21 16:43:58', '2010-09-29 03:30:00', 8, 8),
(2465, 1, 462, '', 'Suu sa at hun hadd briller p&aring; seg n&aring;r hun gikk p&aring; ungdomsskole.', '', 8, '2010-09-21 16:44:14', '2010-09-29 03:30:00', 8, 8),
(2466, 1, 462, '', 'Jeg synes Tom gjort det.', '', 8, '2010-09-21 16:43:55', '2010-09-29 03:30:00', 8, 8),
(2467, 1, 462, '', 'Har du spist middag?  Ja, det har jeg.', '', 8, '2010-09-21 16:44:26', '2010-09-29 03:30:00', 8, 8),
(2468, 1, 463, '', 'Studenten som leser ei bok der borte er Michiko.', '', 8, '2010-09-21 16:45:44', '2010-09-29 03:30:00', 8, 8),
(2469, 1, 463, '', 'En interessant person.', '', 8, '2010-09-21 16:46:03', '2010-09-29 03:30:00', 8, 8),
(2470, 1, 463, '', 'en person med langt h&aring;r', '', 8, '2010-09-21 16:46:25', '2010-09-29 03:30:00', 8, 8),
(2471, 1, 463, '', 'en person med briller', '', 8, '2010-09-21 16:45:36', '2010-09-29 03:30:00', 8, 8),
(2472, 1, 463, '', 'en person som like katter', '', 8, '2010-09-21 16:46:05', '2010-09-29 03:30:00', 8, 8),
(2473, 1, 463, '', 'Hvem er personen som tar bilder der borte?', '', 8, '2010-09-21 16:46:18', '2010-09-29 03:30:00', 8, 8),
(2474, 1, 463, '', 'Folk som trene hver dag er frisk.', '', 8, '2010-09-21 16:46:16', '2010-09-29 03:30:00', 8, 8),
(2475, 1, 463, '', 'Jeg liker folk som r&oslash;yker ikke.', '', 8, '2010-09-21 16:46:08', '2010-09-29 03:30:00', 8, 8),
(2476, 1, 463, '', 'Et brav kom fra en venn som gifte seg i fjor.', '', 8, '2010-09-21 16:46:01', '2010-09-29 03:30:00', 8, 8),
(2477, 1, 464, '', 'Vi har eksam i morgen, derfor studerer jeg i kveld.', '', 8, '2010-09-21 16:42:59', '2010-09-29 03:30:00', 8, 8),
(2478, 1, 464, '', 'Det var kalt, derfor gikk jeg ikke ut.', '', 8, '2010-09-21 16:42:57', '2010-09-29 03:30:00', 8, 8),
(2479, 1, 465, '', 'Jeg gjorde leskene i g&aring;r.', '', 8, '2010-09-21 16:46:55', '2010-09-29 03:30:00', 8, 8),
(2480, 1, 465, '', 'Jeg har allereden gjort leksene.', '', 8, '2010-09-21 16:47:04', '2010-09-29 03:30:00', 8, 8),
(2481, 1, 465, '', 'Jeg gjorde ikke leksene i g&aring;r.', '', 8, '2010-09-21 16:46:49', '2010-09-29 03:30:00', 8, 8),
(2482, 1, 465, '', 'Jeg har ikke end&aring; gjort leksene.', '', 8, '2010-09-21 16:47:09', '2010-09-29 03:30:00', 8, 8),
