(2683, 1, 471, '', 'Ja, jeg tror hun hadde svart h&aring;r.', '', 8, '2010-09-23 06:51:34', '2010-10-01 03:30:00', 8, 8),
(2684, 1, 471, '', 'Var hun tynn?', '', 8, '2010-09-23 06:40:57', '2010-10-01 03:30:00', 8, 8),
(2685, 1, 471, '', 'Ja, jeg tror hun var tynn.', '', 8, '2010-09-23 07:03:00', '2010-10-01 03:30:00', 8, 8),
(2686, 1, 471, '', 'Spilte hun piano?', '', 8, '2010-09-23 06:54:24', '2010-10-01 03:30:00', 8, 8),
