(2690, 1, 471, '', 'Hjelpte hun ofte mora si?', '', 8, '2010-09-23 06:41:08', '2010-10-01 03:30:00', 8, 8),
(2691, 1, 471, '', 'Ja, jeg tror hun hjelpte ofte.', '', 8, '2010-09-23 06:52:34', '2010-10-01 03:30:00', 8, 8),
(2692, 1, 471, '', 'Var Japansk l&aelig;reren din s&oslash;t?', '', 8, '2010-09-23 06:40:51', '2010-10-01 03:30:00', 8, 8),
(2693, 1, 471, '', 'Nei, jeg tror han var ikke s&oslash;t.', '', 8, '2010-09-23 06:41:43', '2010-10-01 03:30:00', 8, 8),
(2694, 1, 471, '', 'Likte han skole?', '', 8, '2010-09-23 06:56:18', '2010-10-01 03:30:00', 8, 8),
(2695, 1, 471, '', 'Ja, jeg tror han likte skole.', '', 8, '2010-09-23 06:58:10', '2010-10-01 03:30:00', 8, 8),
(2696, 1, 471, '', 'Var han overvektig?', '', 8, '2010-09-23 06:40:33', '2010-10-01 03:30:00', 8, 8),
(2697, 1, 471, '', 'Nei, jeg tror han var ikke overvektig.', '', 8, '2010-09-23 06:51:25', '2010-10-01 03:30:00', 8, 8),
(2698, 1, 471, '', 'Var han mean-spirited?', '', 8, '2010-09-23 06:55:01', '2010-10-01 03:30:00', 8, 8),
(2699, 1, 471, '', 'Nei, jeg tror han var ikke mean-spirited.', '', 8, '2010-09-23 06:40:11', '2010-10-01 03:30:00', 8, 8),
(2700, 1, 471, '', 'Leikte han ofte?', '', 8, '2010-09-23 06:55:22', '2010-10-01 03:30:00', 8, 8),
(2701, 1, 471, '', 'Ja, jeg tror han leikte.', '', 8, '2010-09-23 07:03:11', '2010-10-01 03:30:00', 8, 8),
(2702, 1, 471, '', 'Var han popul&aelig;r?', '', 8, '2010-09-23 06:40:42', '2010-10-01 03:30:00', 8, 8),
(2703, 1, 471, '', 'Ja, jeg tror han var popul&aelig;r.', '', 8, '2010-09-23 07:01:19', '2010-10-01 03:30:00', 8, 8),
(2704, 1, 472, '', 'Jeg mislikte fisk, derfor spiser jeg ikke sushi.', '', 8, '2010-09-23 15:36:04', '2010-10-01 03:30:00', 8, 8),
(2705, 1, 472, '', 'Eksamene er over, derfor har jeg masse ledig timer.', '', 8, '2010-09-23 15:35:45', '2010-10-01 03:30:00', 8, 8),
(2706, 1, 472, '', 'Jeg var p&aring; ferie, derfor var jeg frav&aelig;rende fra skole.', '', 8, '2010-09-23 15:36:13', '2010-10-01 03:30:00', 8, 8),
(2707, 1, 472, '', 'Jeg har to billetter til konserten, derfor vil du bli med?', '', 8, '2010-09-23 15:36:31', '2010-10-01 03:30:00', 8, 8),
(2708, 1, 472, '', 'V&aelig;ret er ikke bra, derfor g&aring;r vi ikke ut for &aring; leike.', '', 8, '2010-09-23 15:38:03', '2010-10-01 03:30:00', 8, 8),
(2709, 1, 472, '', 'Kurset har begynnt, la oss skynde oss.', '', 8, '2010-09-23 15:37:58', '2010-10-01 03:30:00', 8, 8),
(2710, 1, 472, '', 'Varer er dyrt, derfor har jeg ingen penger.', '', 8, '2010-09-23 15:36:42', '2010-10-01 03:30:00', 8, 8),
