(4546, 1, 624, '&hellip;', 'Vi har et fly om morgenen og et om ettermidagen.', '', 8, '2010-09-24 16:34:39', '2010-10-02 03:30:00', 8, 8),
(4547, 1, 624, '', 'Dette om morgenen, takk.  Kan jeg bruke kort?', '', 8, '2010-09-24 16:34:53', '2010-10-02 03:30:00', 8, 8),
(4548, 1, 624, '', 'Ja.', '', 8, '2010-09-24 16:39:32', '2010-10-02 03:30:00', 8, 8),
(4549, 1, 624, '', 'Hvor langt tid tar det til Seoul?', '', 8, '2010-09-24 16:41:16', '2010-10-02 03:30:00', 8, 8),
(4550, 1, 624, '', 'Sirka &eacute;n time.', '', 8, '2010-09-24 16:40:05', '2010-10-02 03:30:00', 8, 8),
(4551, 1, 646, 'Although this kanji no longer looks very much like a <b>sword</b>, is does have some resemblance to the handle of a <b>sword</b>.', '', '', 17, '2010-09-14 05:02:54', '2010-10-01 03:30:00', 17, 17),
(4552, 1, 646, 'Think of using a <i>dagger</i> as a razor <b>blade</b>, and it shhouldn&#039;t be hard to imagine cutting yourself.  See the little <i>drop of</i> blood, clinging to the <b>blade</b>?', '', '', 17, '2010-09-14 05:05:20', '2010-10-01 03:30:00', 17, 17),
(4553, 1, 646, 'To the right we see the <i>dagger</i> and next to it the number <i>seven</i>, meaning <i>diced</i>.  It is hard to think of <b>cutting</b> anything with a knife without imagining one of those skillful Japanese chefs.  Only let us say that he has had too much to drink at a party, grabs a <i>dagger</i> lying around and startc <i>dicing</i> up everything in sight, starting with the hors d&#039;oeuvres, and moving onto the furniture and carpets!', '', '', 17, '2010-09-14 05:04:18', '2010-10-01 03:30:00', 17, 17),
(4554, 1, 646, 'A <i>dagger</i> posed over a <i>mouth</i> is how the character for &quot;beckoning&quot; is written.  The related but less tame keyword <b>seduce</b> was chosen because it seemed to fir better with the &quot;Freudian&quot; implications of the kanji: observe that it is unsure whether the long slender object is <b>seducing</b> the small round one or vice versa.', '', '', 17, '2010-09-14 05:03:03', '2010-10-01 03:30:00', 17, 17),
(4555, 1, 646, 'Let the keyword suggest <b>shining</b> your shoes, the purpose of which is to <i>seduce</i> the <i>sun</i> down on them for all to see.', '', '', 17, '2010-09-17 05:04:41', '2010-10-04 03:30:00', 20, 19),
(4556, 1, 646, 'The character depicts a <i>clam</i> alongside a great and flashing <i>saber</i>.  Think of digging for <i>clams</i> in an area where there are <b>rules</b> governing how large a find has to be before you can keep it.  So, you take out your trusty <i>saber</i>, which you have carefully notched like a yardstick, and measure the poor wee beast to see if it is as long as the <b>rules</b> say it has to be.', '', '', 17, '2010-09-14 05:02:40', '2010-10-01 03:30:00', 17, 17),
(4557, 1, 646, 'The keyword <b>vice-</b> is in the sense of someone second-in-command.  The great and flashing <i>saber</i> to the right and the <i>wealth</i> on the left combine to create an image of dividing one&#039;s property to give a share to one&#039;s <b>vice-</b><i>wealth-</i>holder.', '', '', 17, '2010-09-14 05:05:12', '2010-10-01 03:30:00', 17, 17),
(4558, 1, 646, 'In the olde East, the samurai and his <i>saber</i> were never <b>seperated</b>; they were constant companions.  This kanji depicts what must have been the height of <b>seperation</b>-anxiety for the samurai: to be <i>bound up</i> with a rope, unable to get at his <i>saber</i> a few feet away from him.  Look at that <i>mouth</i> bellowing out for shame and sorrow!', '', '', 17, '2010-09-14 05:04:03', '2010-10-01 03:30:00', 17, 17),
(4559, 1, 646, 'The picture here is of a <b>street</b> sign on a long pole: Hollywood and Vine, if you please!', '', '', 17, '2010-09-14 05:02:47', '2010-10-01 03:30:00', 17, 17),
(4560, 1, 646, '<i>Street</i> signs standing at the corner of the <i>rice fields</i> depict the <b>village</b> limits.', '', '', 17, '2010-09-14 05:04:40', '2010-10-01 03:30:00', 17, 17),
(4561, 1, 646, 'Remember the story about the &quot;Little Engine that <b>Could</b>&quot;?  See the determined little locomotive huffing a puffing up the mountain, &quot;I think I <b>can</b>, I think I <b>can</b>...&quot; - spitting railroad <i>spikes</i> out of its <i>mouth</i> as it chews up the line to the top.', '', '', 17, '2010-09-14 05:05:44', '2010-10-01 03:30:00', 17, 17),
(4562, 1, 646, 'The keyword is actually a formal metaphor meaning &quot;humble acceptance&quot;.  Reading off the two primitive elements in the order of writing, we have: <i>nail</i> and <i>head</i>.  As in &quot;hitting the <i>nail</i> on the <i>head</i>&quot;.  Now one presumes that most people can handle metaphors, but if you were to run itno a dimwit working in a hardware store who only know the literal meaning of things, and were to ask him, in your best Japanese, to <b>place on your head</b> a <i>nail</i>, he might miss the point and cause you considerable torment.', '', '', 16, '2010-09-13 20:20:10', '2010-09-29 03:30:00', 22, 21),
