(4727, 1, 682, '', 'Kan jeg f&aring; studentrabatt?', '', 7, '2010-09-20 16:54:41', '2010-09-27 03:30:00', 7, 7),
(4728, 1, 682, '', 'Hvilken er toget til Kamakura?', '', 7, '2010-09-20 16:54:07', '2010-09-27 03:30:00', 7, 7),
(4729, 1, 682, '', 'Det er spor to.', '', 7, '2010-09-20 16:54:12', '2010-09-27 03:30:00', 7, 7),
(4730, 1, 675, 'We begin with the two elements to the right, <i>baseball</i> and <i>needle</i>.  Since they will be coming together from time to time, let us give the two of them the sense of <i>game of cricket</i>, in which the <i>needle</i> is the wicket.  Imagine using a <i>rock</i> for a ball.  A <i>stone</i> ball would <b>smash</b> the <i>wicket</i> into into about <i>nine</i> thousand different pieces.', '', '', 17, '2010-09-20 05:13:36', '2010-10-07 03:30:00', 20, 19),
(4731, 1, 675, 'Good <b>sand</b> contains very <i>few rocks</i>.', '', '', 17, '2010-09-17 05:06:37', '2010-10-04 03:30:00', 17, 17),
(4732, 1, 675, 'Long before the invnetion of the carpenter&#039;s <b>plane</b>, people used knives and machetes (or, as seen here, <i>sabres</i>) to smooth out their woodwork.  If you have ever seen the process, you will be amazed to see the <i>sparks flying</i> from their <i>sabres</i> as they <b>plane</b> down the wood.', '', '', 17, '2010-09-17 05:06:20', '2010-10-04 03:30:00', 17, 17),
(4733, 1, 675, 'There are two primitives here, <i>little</i> and <i>human legs</i>.  Now, if you have ever wondered about those little particles of &quot;dust&quot; that dance around in the light <b>rays</b> that come through the window and fall on your desk, try imagining them as <i>little</i> dancing <i>human legs</i>, doing the Can-can in the <b>rays</b> of sunlight on your desk.', '', '', 17, '2010-09-17 05:06:06', '2010-10-04 03:30:00', 17, 17),
(4734, 1, 675, '<b>Plump</b> is one of those words that sounds like its meaning!  No sooner do you hear it than you think of a round and ample-bodied person falling into a sofa like a <i>large drop</i> - kerrrrr-<b>plump</b>!', '', '', 17, '2010-09-17 05:06:28', '2010-10-04 03:30:00', 17, 17),
(4735, 1, 675, 'This kanji shows a <i>big dog</i> stretched out on a table, all stuffed and stewed and garnished with vegetables, with an apple in its mouth.  At each corner of the table sits an eager <i>mouth</i> waiting for <b>utensils</b> to arrive so the feast can begin.  Delicious!', '', '', 17, '2010-09-17 05:05:20', '2010-10-04 03:30:00', 17, 17),
(4736, 1, 675, 'In the character for <b>stinking</b>, the super-sensitive <i>nose</i> of a <i>great big dog</i> is sniffing the air fo rthe source of some, foul, <b>stinking</b>, smell.', '', '', 17, '2010-09-17 05:06:51', '2010-10-04 03:30:00', 17, 17),
(4737, 1, 675, 'The kanji for <b>exquisite</b> contains the elements for <i>woman</i> and <i>few</i>, since an <b>exquisite</b> <i>woman</i> comes but <i>few</i> and far between.', '', '', 17, '2010-09-17 05:05:43', '2010-10-04 03:30:00', 17, 17),
(4738, 1, 675, 'When we <b>focus</b> on somehting, we give our attention to only a <i>few</i> matters, and <b>focus</b> our <i>eyes</i> only on them.', '', '', 17, '2010-09-17 05:07:09', '2010-10-04 03:30:00', 17, 17),
(4739, 1, 675, 'The Japanese character for <b>thick</b> shows an abandonned <i>child</i>, under a hot <i>sun</i>, trapped at the bottom of a <i>cliff</i>.  If the child survives this, then he will live to be a very <b>thick</b>-skinned adult.', '', '', 17, '2010-09-17 05:05:11', '2010-10-04 03:30:00', 17, 17),
(4740, 1, 675, 'The elements we have here are a <i>big dog</i> and the elements <i>nail</i> and <i>mouth</i>.  Now all we have to do is create a ficticious &quot;<b>Strange</b> But True&quot; column in the Sunday funnies, featuring a <i>big dog</i> whose <i>mouth</i> has been <i>nailed</i> shut because we hit the brandy keg around his neck too hard.', '', '', 17, '2010-09-18 09:33:50', '2010-10-05 03:30:00', 19, 18),
(4741, 1, 683, 'New Question', 'New Answer', '', 0, '2010-05-04 19:32:59', '2010-05-04 19:32:59', 0, 0),
(4742, 1, 683, 'New Question', 'New Answer', '', 0, '2010-05-04 19:33:34', '2010-05-04 19:33:34', 0, 0),
(4743, 1, 683, 'We have taken the image of a river <b>stream</b> over into English to describe things that fall down in straight lines, or ripple along in lines.  All of this is more evident in the kanji given here, a pictograph of a <b>stream</b>.', '', '', 17, '2010-09-18 09:41:15', '2010-10-05 03:30:00', 17, 17),
(4744, 1, 683, 'Here we see <i>drops of</i> land (little islets) rising out of a <i>stream</i>, creating a kind of sandbar or breakwater.  Ever wonder how the <b>state</b>-line is drawn between <b>states</b> separated by a river?  If there were little <i>drops of</i> land, as n the kanji, there&#039;s be nothing to it.', '', '', 17, '2010-09-18 09:40:53', '2010-10-05 03:30:00', 17, 17),
(4745, 1, 683, 'In primitive language, the character would read <i>stream</i>...<i>head</i>.  And that turns out to be convenient in remembering the meaning <b>obey</b>.  Either one <b>obeys</b> the person who is <i>head</i> of ann organisation or else <b>obeys</b> by following the <i>stream</i> of opinion.  Both these senses come together in this kanji.', '', '', 17, '2010-09-18 09:40:10', '2010-10-05 03:30:00', 17, 17),
(4746, 1, 683, 'This character is a pictograph of <b>water</b>.  Simply think of a <i>walking stick</i> being dropped vertically into the <b>water</b>, sending <i>droplets</i> out in all four directions.', '', '', 17, '2010-09-18 09:39:48', '2010-10-05 03:30:00', 17, 17),
(4747, 1, 683, 'The kanji for <b>icicle</b> is the same as that for <i>water</i>, except, there has been an added <i>drop of</i> a cold, north-westerly wind, to cool the water down into a frozen <b>icicle</b>.', '', '', 17, '2010-09-18 09:41:52', '2010-10-05 03:30:00', 17, 17),
(4748, 1, 683, 'This kanji uses the full form of <i>water</i>, though <b>eternity</b> seems at first to have nothing to do with <i>water</i> at all.  Remember what William Blake said about seeing &quot;infinity in a grain of sand, and <b>eternity</b> in an hour&quot;?  Well, reading this character, top-to-bottom, we see &quot;<b>eternity</b> in a <i>drop of water</i>&quot;.', '', '', 17, '2010-09-18 09:40:38', '2010-10-05 03:30:00', 17, 17),
(4749, 1, 683, 'Call to mind the image of a fresh, bubbling <b>spring</b> of water, and you will probably notice how the top of the <b>spring</b> is all <i>white</i>.  Happily, the character for <b>spring</b> shows <i>white</i> at the top, and <i>water</i> below.', '', '', 17, '2010-09-18 09:41:08', '2010-10-05 03:30:00', 17, 17),
(4750, 1, 683, 'Think of a mountain <b>meadow</b> in the Austrian Alps.  Imagine a little <i>spring</i>, bubbling up from underneath the <b>meadow</b>, leading to a mountain-<b>meadow</b>&#039;s <i>cliff</i>.', '', '', 17, '2010-09-18 09:41:35', '2010-10-05 03:30:00', 17, 17),
(4751, 1, 683, 'A <i>meadow</i> and a <i>head</i> are all we are given to work with in the kanji for <b>petition</b>.  Since the keyword already suggests a request made of a higher power, let us imagine a giant Wizard of Oz <i>head</i>, in the middle of a <i>meadow</i>.  People will come from all around to <b>petition</b> the giant <i>head</i> for whatever they want.', '', '', 17, '2010-09-18 09:40:27', '2010-10-05 03:30:00', 17, 17),
(4752, 1, 683, 'The primitive to the left represnets <i>water</i>.  The right, we see the kanji for <i>eternity</i>.  Knowing how much children love <b>swimming</b>, what could be a better representation than <b>swimming</b> in <i>water</i> for <i>eternity</i>?', '', '', 17, '2010-09-18 09:41:44', '2010-10-05 03:30:00', 17, 17),
(4753, 1, 683, '<b>Marshlands</b> are generally low-lying and near a source of <i>water</i>, that feeds them until they are soggy and wet all the way through.  <b>Marshlands</b> thrive on <i>water</i>, and so do all they can to <i>seduce</i> some wet stuff its way.', '', '', 17, '2010-09-18 09:40:46', '2010-10-05 03:30:00', 17, 17),
(4754, 1, 683, 'The kanji for <b>open sea</b> readily suggests being in the <i>middle</i> of a body fo <i>water</i>.', '', '', 17, '2010-09-18 09:41:26', '2010-10-05 03:30:00', 17, 17),
(4755, 1, 683, 'A <b>creek</b> is often just a dribble of <i>water</i> trickling down a small gully.  All of us know from our childhood how <b>creeks</b> are made.  You probably even dug one or two in your time!  All you need to do is find a mainstream of <i>water</i> somewhere and dig a little path into dry land.  The <b>creek</b> is a lesson in <i>water craft</i>, as this kanji would agree.', '', '', 17, '2010-09-20 05:14:28', '2010-10-07 03:30:00', 17, 17),
(4756, 1, 683, 'To make <b>soup</b> one begins with <i>water</i>, and then starts adding things to it.  This is how the thick <b>soup</b> called &quot;seven-in-one&quot; is made.  This kanji does three better, giving us a <i>ten</i>-ingrdient <b>soup</b>.', '', '', 17, '2010-09-20 05:14:39', '2010-10-07 03:30:00', 17, 17),
(4757, 1, 683, 'On the left is <i>water</i>, and on the right, <i>morning</i>.  To get the meaning of the keyword <b>tide</b>, just think of a <i>morning</i>-<b>tide</b>, with <i>water</i> progressing up the shoreline in the <i>morning</i>.', '', '', 16, '2010-09-14 05:06:31', '2010-09-30 03:30:00', 21, 20),
(4758, 1, 683, 'It&#039;s easy to see <i>water</i> and meadow in the character for <b>source</b>.  Both in its etymology and popular usage, <b>source</b> suggests the place where <i>water</i> comes from.  In this kanji, it is under a <i>meadow</i>, where we just saw it breaking the surface in those bubbly little springs.', '', '', 14, '2010-09-12 18:00:32', '2010-09-26 03:30:00', 27, 25),
(4759, 1, 683, 'When we speak of a <b>lively</b> personality, or a <b>lively</b> party, we immediately think of a lot of chatter.  This kanji depicts the idea of <b>lively</b> by having <i>tongues</i> babble and splash around like flowing <i>water</i>.', '', '', 17, '2010-09-20 05:14:21', '2010-10-07 03:30:00', 17, 17),
(4760, 1, 683, 'Among the many things <i>water</i> is useful for is <b>extinguishing</b> fires, and that is just what we have here.  First of all, take the <i>water</i> at left as the <i>drops of water</i> that are used to depict <i>water</i> in general.  In the best of all possible worlds, the most efficient way to <b>extinguish</b> a fire would be to see that each <i>drop of water</i> hits one <i>spark</i> of the conflagration.  An unthinkable bit of utopian fire fighing, but helpful for assigning this keyword its primitives.', '', '', 17, '2010-09-20 05:15:30', '2010-10-07 03:30:00', 17, 17),
(4761, 1, 683, 'This keyword is a connector used to link contrasting phrases and sentences together with much the same flavour as the English phrase <b>but of course</b>.  Just picture yourself ready to go on your first date as a <i>teenager</i>, and having your mother grill you about your manners and ask you embarassing questions about your hygiene.  &quot;Did you have a good shower?&quot;, &quot;<b>But of course</b>...&quot;, you reply, annoyed.  so <i>water</i> and <i>teenager</i> combine to give us <b>but of course</b>.', '', '', 17, '2010-09-20 05:14:51', '2010-10-07 03:30:00', 17, 17),
(4762, 1, 683, 'The character in this frame represents a step up frm the <i>stream</i> we met earlier; it is a full-sized <b>river</b>.  The <i>water</i> to the left tells us what we are dealing with, and the <i>can</i> at the right tells us that our little engine that <i>could</i> has now become amphibious and is chugging down the mighty Mississippi like a regular <b>river</b>boat.', '', '', 17, '2010-09-20 05:15:09', '2010-10-07 03:30:00', 17, 17),
(4763, 1, 683, 'When you stop at an inn for an <b>overnight</b> rest, all you expect is a bit of <i>water</i> for a wash and a set of clean <i>white</i> sheets to wrap your weary bones in.', '', '', 17, '2010-09-20 05:15:01', '2010-10-07 03:30:00', 17, 17),
(4764, 1, 683, '<i>Water...old...flesh</i>.  You have heard of legends of people being abandoned in the mountains when they had become too <i>old</i> to work.  Well, here is a legend about people being set adrift in the <i>waters</i> of a stormy <b>lake</b> because their <i>flesh</i> has gotten too <i>old</i> to bear the burdens of life.', '', '', 17, '2010-09-20 05:14:11', '2010-10-07 03:30:00', 17, 17),
(4765, 1, 683, 'Connoting the measurement of the depth of <i>water</i>, the keyword <b>fathom</b> begins with the <i>water</i> primitive and end with the element for <i>rule</i>.  Hence, when we <i>rule water</i>, we <b>fathom</b> it.  What could be simpler?', '', '', 17, '2010-09-20 05:16:14', '2010-10-07 03:30:00', 17, 17),
(4766, 1, 683, 'This is a pictograph of a pile of soil, highly stylized.  Think of <i>ten</i> grains of <b>soil</b> piled up on the livingroom <i>floor</i>.', '', '', 17, '2010-09-20 05:15:18', '2010-10-07 03:30:00', 17, 17),
