(4770, 1, 685, 'New Question', 'New Answer', '', 0, '2010-05-07 18:59:07', '2010-05-07 18:59:07', 0, 0),
(4771, 1, 686, '&#039;Read all about it&#039;', '&quot;I try out html entities&quot;<br/><br/>&aacute;&egrave;&icirc;&ouml;&ntilde; $&pound;&euro;&quot;&aring;&oslash;&aelig;', '', 0, '2010-05-07 19:17:10', '2010-05-07 19:17:10', 0, 0),
(4772, 1, 683, 'Here we have a rather <i>small</i> mouth, next to a much larger piece of <i>dirt</i>.  It is not hard to imagine what you would do if you had a large piece of <i>dirt</i> in your <i>mouth</i>: <b>spit</b> it out as fast and as far as you can!', '', '', 17, '2010-09-22 16:44:44', '2010-10-09 03:30:00', 17, 17),
(4773, 1, 683, 'One of the things that causes erosion of &lt;i&gt;soil&lt;/i&gt; is the excessive &lt;b&gt;pressure&lt;/b&gt; of the top&lt;i&gt;soil&lt;/i&gt; on the lower&lt;i&gt;soil&lt;/i&gt;.  here we see a steep and perilous &lt;i&gt;cliff&lt;/i&gt;.  The slightest &lt;b&gt;pressure&lt;/b&gt; on it will cause a landslide, which, with a little help from your imagination, you will be able to see happening with this character.', '', '', 17, '2010-09-24 19:26:04', '2010-10-11 03:30:00', 20, 19),
(4774, 1, 683, 'The &lt;b&gt;cape&lt;/b&gt; pictured here is a jut of &lt;i&gt;land&lt;/i&gt; like &lt;b&gt;Cape&lt;/b&gt; cod.  The &lt;i&gt;soil&lt;/i&gt; on the left tells us we have something to do with &lt;i&gt;land&lt;/i&gt;, and the &lt;i&gt;strange&lt;/i&gt; on the right tells us it is a &lt;b&gt;cape&lt;/b&gt; where unusual things go on.  The name of the place?  &lt;b&gt;Cape&lt;/b&gt; &lt;i&gt;strange&lt;/i&gt;.', '', '', 17, '2010-09-22 16:42:34', '2010-10-09 03:30:00', 17, 17),
(4775, 1, 683, 'The &lt;b&gt;hedge&lt;/b&gt; depicted here is not your ordinary, run-of-the-mill &lt;b&gt;hedge&lt;/b&gt;, but the miraculous &lt;b&gt;hedge&lt;/b&gt; of roses that completely &lt;i&gt;spanned&lt;/i&gt; the castle &lt;i&gt;grounds&lt;/i&gt; in which Sleeping Beauty lay for a hundred years, so that none but her beloved could find his way through.', '', '', 17, '2010-09-22 16:45:52', '2010-10-09 03:30:00', 17, 17),
(4776, 1, 683, 'The kanji keyword, &lt;b&gt;squared jewel&lt;/b&gt;, depicts a mammoth precious stone, several feet high, made by piling up large heaps of &lt;i&gt;soil&lt;/i&gt;, one on top of the other.', '', '', 17, '2010-09-22 16:45:25', '2010-10-09 03:30:00', 17, 17),
(4777, 1, 683, 'Think of the keyword &lt;b&gt;seal&lt;/b&gt; as referring to a letter you have written, and are preparing to close.  Instead of using the traditional wax &lt;b&gt;seal&lt;/b&gt;, you use a piece of &lt;i&gt;ivy&lt;/i&gt;, &lt;i&gt;glued&lt;/i&gt; to the outside.', '', '', 16, '2010-09-21 16:55:17', '2010-10-07 03:30:00', 22, 21),
(4778, 1, 683, 'After seeing a constant &lt;b&gt;horizon&lt;/b&gt; of &lt;i&gt;water, water&lt;/i&gt;, everywhere for months at sea, you spot some &lt;i&gt;ivy&lt;/i&gt;-clad &lt;i&gt;cliffs&lt;/i&gt; on a new &lt;b&gt;horizon&lt;/b&gt;.', '', '', 17, '2010-09-22 16:45:12', '2010-10-09 03:30:00', 17, 17),
(4779, 1, 683, 'You have heard of people being attached to a particular Buddhist sect?  Here is your chance to take that metaphor literally and imagiine a fellow walking into a &lt;b&gt;Buddhist temple&lt;/b&gt; with a fervent resolve to attach himself to the place.  Since there is plenty of unused &lt;i&gt;land&lt;/i&gt; in the precincts, he simply picks out a suitable patch, and &lt;i&gt;glues&lt;/i&gt; himself to the &lt;i&gt;ground&lt;/i&gt;!', '', '', 17, '2010-09-22 16:43:32', '2010-10-09 03:30:00', 17, 17),
(4780, 1, 683, '&quot;What is &lt;b&gt;time&lt;/b&gt;?&quot; asked St. Augustine in his memoirs.  This kanji tell us that &lt;b&gt;time&lt;/b&gt; is the &lt;i&gt;sun&lt;/i&gt;, rising over a &lt;i&gt;buddhist temple&lt;/i&gt;.', '', '', 17, '2010-09-22 16:43:06', '2010-10-09 03:30:00', 17, 17),
(4781, 1, 683, 'This kanji pictures &lt;i&gt;soil&lt;/i&gt; being scooped into a &lt;i&gt;ladle&lt;/i&gt;, and then made &lt;b&gt;level&lt;/b&gt; (apparently because one is measuring &lt;i&gt;soil&lt;/i&gt;).  The excess &lt;i&gt;drops of soil&lt;/i&gt; are brushed off the top, which accounts for the added &lt;i&gt;drop&lt;/i&gt; at the &lt;i&gt;ladle&#039;s&lt;/i&gt; edge.', '', '', 17, '2010-09-22 16:44:54', '2010-10-09 03:30:00', 17, 17),
(4782, 1, 683, 'This kanji is a pictograph of a &lt;b&gt;flame&lt;/b&gt;.  It also looks like a &lt;i&gt;person&lt;/i&gt; with &lt;i&gt;drops of fire&lt;/i&gt; raining down on either side of him, as he runs away to safety.', '', '', 17, '2010-09-22 16:44:36', '2010-10-09 03:30:00', 17, 17),
(4783, 1, 689, '&lt;disallowed&gt;&lt;br/&gt;&lt;disallowed bgcolor=&quot;#000000&quot;&gt;&lt;br/&gt;&lt;disallowed&gt;&lt;br/&gt;&lt;disallowed type=&quot;submit&quot; /&gt;&lt;br/&gt;&lt;disallowed&gt;textexttext&lt;/textarea&gt;&lt;br/&gt;&lt;/form&gt;&lt;br/&gt;&lt;/body&gt;&lt;br/&gt;&lt;/html&gt;', 'New Answer', '', 0, '2010-05-08 20:42:04', '2010-05-08 20:42:04', 0, 0);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(4784, 1, 683, 'A &lt;i&gt;fire&lt;/i&gt; belongs in the &lt;i&gt;hearth&lt;/i&gt;, not over it.  When a &lt;i&gt;fire&lt;/i&gt; spreads to the rest of the house, we have an &lt;b&gt;inflamed&lt;/b&gt; house.  As with any &lt;b&gt;inflammation&lt;/b&gt;, the danger is always that it might spread if not checked.  This is the sense behind the reduplication of the element for &lt;i&gt;fire&lt;/i&gt;, on atop the other.', '', '', 17, '2010-09-22 16:43:49', '2010-10-09 03:30:00', 17, 17),
(4785, 1, 683, 'The existential condition of &lt;b&gt;anxiety&lt;/b&gt; that arises from the inevitable frustration of our wordly passions is contained in this character.  The &lt;i&gt;head&lt;/i&gt; is set on &lt;i&gt;fire&lt;/i&gt;, causing deep &lt;b&gt;anxiety&lt;/b&gt;.', '', '', 11, '2010-09-19 08:38:13', '2010-09-30 03:30:00', 24, 23),
(4786, 1, 683, 'The primitives in this kanji read: &lt;i&gt;water...inflammation&lt;/i&gt;.  Taking &lt;i&gt;inflammation&lt;/i&gt; in its medical sense, the first &lt;i&gt;water&lt;/i&gt;-related &lt;i&gt;inflammation&lt;/i&gt; that pops into mind is dehydration, the principal sympton of which is that it makes one shrivel up and look very, very, &lt;b&gt;thin&lt;/b&gt;.', '', '', 17, '2010-09-22 16:44:17', '2010-10-09 03:30:00', 17, 17),
(4787, 1, 683, 'This kanji is made up of the elements &lt;i&gt;fire&lt;/i&gt; and &lt;i&gt;street&lt;/i&gt;.  Imagine a &lt;i&gt;street&lt;/i&gt;sign with a &lt;i&gt;flame&lt;/i&gt; on top.  Would that not make a perfect, if dangerus, &lt;b&gt;lamp&lt;/b&gt; for your living room?', '', '', 17, '2010-09-22 16:45:02', '2010-10-09 03:30:00', 17, 17),
(4788, 1, 683, 'Looking at the primitives, a &lt;i&gt;fireplace&lt;/i&gt; and a &lt;i&gt;rice field&lt;/i&gt;, we find the essential ingredients for a &lt;b&gt;farm&lt;/b&gt;: a warm &lt;i&gt;hearth&lt;/i&gt; to sit by at night, and a well-ploughed &lt;i&gt;field&lt;/i&gt; to grow one&#039;s crops in by day.', '', '', 17, '2010-09-22 16:42:23', '2010-10-09 03:30:00', 17, 17),
(4789, 1, 683, 'Of all nature&#039;s &lt;b&gt;disasters&lt;/b&gt;, this kanji picks ou two of the worst: &lt;i&gt;floods&lt;/i&gt; and &lt;i&gt;fires&lt;/i&gt;.', '', '', 17, '2010-09-22 16:44:27', '2010-10-09 03:30:00', 17, 17),
(4790, 1, 683, 'The kanji for &lt;b&gt;ashes&lt;/b&gt; naturally includes the primitive for &lt;i&gt;fire&lt;/i&gt;, or more specifically, a &lt;i&gt;fireplace&lt;/i&gt;.  Now what do you do with that bucket of &lt;b&gt;ashes&lt;/b&gt; you just cleaned out of the &lt;i&gt;fireplace&lt;/i&gt;?  Chuck it off a &lt;i&gt;cliff&lt;/i&gt;.  Out of sight, out of mind.', '', '', 17, '2010-09-22 16:41:58', '2010-10-09 03:30:00', 17, 17),
(4791, 1, 683, 'If you look into the flickering of a &lt;i&gt;fire&lt;/i&gt; for a long time and then turn aside, you will see &lt;b&gt;spots&lt;/b&gt; before your eyes.  Imagine using those &lt;b&gt;spots&lt;/b&gt; as a technique for &lt;i&gt;fortune-telling&lt;/i&gt;.', '', '', 17, '2010-09-22 16:44:03', '2010-10-09 03:30:00', 17, 17),
(4792, 1, 683, 'We shall focus on &quot;to make something &lt;i&gt;shine&lt;/i&gt;&quot; as the meaning of &lt;b&gt;illuminate&lt;/b&gt;.  If you glaze a pot and put it into the &lt;i&gt;oven&lt;/i&gt; to &lt;i&gt;fire&lt;/i&gt; it, you in fact &lt;b&gt;illuminate&lt;/b&gt; it.  Hence the kanji for &lt;b&gt;illuminate&lt;/b&gt; comprises the kanji for &lt;i&gt;shining&lt;/i&gt; and the primitive element for &lt;i&gt;oven&#039;s fire&lt;/i&gt;.', '', '', 17, '2010-09-22 16:42:10', '2010-10-09 03:30:00', 17, 17),
(4793, 1, 683, 'The composition of this kanji shows three elements, which we list in the order of their writing: &lt;i&gt;bound up...rice field...cooking fire&lt;/i&gt;.  Not much to work with at first sight, but we can join them and &lt;i&gt;bind up&lt;/i&gt; a &lt;b&gt;fish&lt;/b&gt; on a line with its unfortunate school-mates; when the fisherman gets home, he cuts off the head and tosses it with the entrails, out into the &lt;i&gt;rice fields&lt;/i&gt; for fertilizer; and the rest he sets in a skillet over a &lt;i&gt;cooking fire&lt;/i&gt; for his supper.', '', '', 17, '2010-09-22 16:45:38', '2010-10-09 03:30:00', 17, 17),
(4794, 1, 683, 'The kanji for &lt;b&gt;fishing&lt;/b&gt; adds the element &lt;i&gt;water&lt;/i&gt; before the element for &lt;i&gt;fish&lt;/i&gt;.  Doesn&#039;t the &lt;i&gt;water&lt;/i&gt; look like a fishing rod?', '', '', 17, '2010-09-22 16:42:54', '2010-10-09 03:30:00', 17, 17),
