(4839, 1, 696, '', 'Jeg drakk mye alkohol og ansikten min ble hvitere.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4840, 1, 696, '', 'I november var det varmt, disse dagene blir det kaldere.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4841, 1, 697, '', 'Jeg g&aring;r med sykkel fra huset mitt til stasjonen.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4842, 1, 697, '', 'Jeg g&aring;r med bussen fra huset mitt til skole.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4843, 1, 697, '', 'Jeg g&aring;r p&aring; fot fra huset mitt til busstoppen.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4844, 1, 697, '', 'Jeg g&aring;r med bilen fra huset mitt til bedriften.', '', 0, '2010-05-09 10:19:10', '2010-05-09 10:19:10', 0, 0),
(4845, 1, 697, '', 'Jeg g&aring;r med tog fra Yokohama til Tokyo.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4846, 1, 697, '', 'Jeg g&aring;r med T-bannen fra bedriften til varehuset.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4847, 1, 697, '', 'Jeg g&aring;r med h&oslash;yhastighetstog fra Nagoya til Tokyo.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4848, 1, 697, '', 'Jeg g&aring;r med fly fra Japan til Hawaii.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4849, 1, 697, '', 'Jeg g&aring;r med b&aring;t fra Japan til Indonesia.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4850, 1, 697, '', 'Det tar ti minutter fra huset mitt til stasjonen.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4851, 1, 697, '', 'Det tar f&oslash;rti fra huset mitt til skole.', '', 0, '2010-05-09 10:19:11', '2010-05-09 10:19:11', 0, 0),
(4852, 1, 697, '', 'Det tar tjue fra huset mitt til busstoppen.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4853, 1, 697, '', 'Det tar ei time fra huset mitt til bedriften.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4854, 1, 697, '', 'Det tar tretti minutter fra Yokohama til Tokyo.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4855, 1, 697, '', 'Det tar femton minutter fra bedriften til varehuset.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4856, 1, 697, '', 'Det tar to timer fra Nagoya til Tokyo.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4857, 1, 697, '', 'Det tar &aring;tte timer fra Japan til Hawaii.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4858, 1, 697, '', 'Det tar ei uke fra Japan til Indonesia.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4859, 1, 697, '', 'Jeg g&aring;r med sykkel fra huset mitt til Minami stasjon.  Det tar fem minutt.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4860, 1, 697, '', 'Jeg rir toget fra Minami stasjon til Nishi stasjon.  Det tar tjue minutt.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4861, 1, 697, '', 'Jeg g&aring;r p&aring; fots fra Nishi stasjon til skolen.  Det tar omtrent ti minutter.', '', 0, '2010-05-09 10:19:12', '2010-05-09 10:19:12', 0, 0),
(4862, 1, 698, 'Hvem var Gustav Klimt?', '&Oslash;steriksk maler', '', 1, '2010-05-09 22:06:21', '2010-05-10 03:30:00', 1, 1),
(4863, 1, 698, 'Hvem var Rolf Nesch?', 'Tysk kunstner', '', 1, '2010-05-09 22:06:41', '2010-05-10 03:30:00', 1, 1),
(4864, 1, 698, 'Hvem har malt det sixtinske kapell?', 'Michaelangelo', '', 1, '2010-05-09 22:06:37', '2010-05-10 03:30:00', 1, 1),
(4865, 1, 699, 'One &lt;b&gt;ri&lt;/b&gt; is about 4 kilometers or 2.5 miles.  The kanji depicts how the measurement came to be used.  Atop we see a &lt;i&gt;ricefield&lt;/i&gt; and below, the element for &lt;i&gt;land&lt;/i&gt;.  Those four sections you see in &lt;i&gt;ricefield&lt;/i&gt; are actually measurements of &lt;i&gt;land&lt;/i&gt;.  The &lt;i&gt;land&lt;/i&gt; division based on the size of a &lt;i&gt;ricefield&lt;/i&gt; is called a &lt;b&gt;ri&lt;/b&gt;.', '', '', 17, '2010-09-24 19:33:24', '2010-10-11 03:30:00', 17, 17),
(4866, 1, 699, 'Like most thing electrical, a &lt;i&gt;computer&lt;/i&gt;, too, can overheat.  Just imagine &lt;i&gt;flames&lt;/i&gt; pouring out of it and charring the keyboard, the monitor, and your desk in sooty, &lt;b&gt;black&lt;/b&gt; smoke.', '', '', 17, '2010-09-24 19:35:27', '2010-10-11 03:30:00', 17, 17),
(4867, 1, 699, 'Besides meaning &lt;b&gt;black ink&lt;/b&gt;, this kanji also appears in the word for an inked string that is pulled taut and snapped to mark a surface.  Here it is used to mark off the &lt;i&gt;dirt&lt;/i&gt; with &lt;i&gt;black&lt;/i&gt; lines for a football game in &lt;i&gt;black ink&lt;/i&gt;.', '', '', 17, '2010-09-24 19:37:21', '2010-10-11 03:30:00', 17, 17),
(4868, 1, 699, 'These are the same &lt;b&gt;carp&lt;/b&gt; you see in Japanese &quot;&lt;b&gt;carp&lt;/b&gt; streamers&quot;.  Only here, we find a small home &lt;i&gt;computer&lt;/i&gt; or two strung on the line by a father anxious for his son not only to have the courage and determination of a &lt;b&gt;carp&lt;/b&gt; swimming up-stream, but also the efficiency and the memory of a &lt;i&gt;computer&lt;/i&gt;.', '', '', 17, '2010-09-24 19:36:35', '2010-10-11 03:30:00', 17, 17),
(4869, 1, 699, 'Think of &lt;b&gt;quantity&lt;/b&gt; as having to do with measuring time and distance, and the rest is simple: you have a quantity of time in the new day that begins with &lt;i&gt;nightbreak&lt;/i&gt;, and a quantity of distance in the rural &lt;i&gt;ri&lt;/i&gt;.', '', '', 17, '2010-09-25 10:50:28', '2010-10-12 03:30:00', 21, 19),
(4870, 1, 699, 'One &lt;b&gt;rin&lt;/b&gt; is about 1/1000 of a yen.  It is not at all surprising that it has gained the sense of something very, very tiny.&lt;br/&gt;This kanji shows a &lt;i&gt;cliff&lt;/i&gt; with a &lt;i&gt;computer&lt;/i&gt; under it, apparently because it has been pushed over into the abyss by someone fed up with the thing.  The market value of one home &lt;i&gt;computer&lt;/i&gt; at the bottom of a &lt;i&gt;cliff&lt;/i&gt;?  One &lt;b&gt;rin&lt;/b&gt;!', '', '', 17, '2010-09-24 19:32:00', '2010-10-11 03:30:00', 17, 17),
(4871, 1, 699, 'When we speak of &lt;b&gt;burying&lt;/b&gt; something, we usually mean putting it in the &lt;i&gt;gorund&lt;/i&gt;.  Only here we are &lt;b&gt;burying&lt;/b&gt; our beloved &lt;i&gt;computer&lt;/i&gt; which has served us so well.  See how the &lt;i&gt;computer&lt;/i&gt; lies in its grave next to a mound of &lt;i&gt;dirt&lt;/i&gt;.', '', '', 17, '2010-09-24 19:28:13', '2010-10-11 03:30:00', 17, 17),
(4872, 1, 699, 'The primitives given are &lt;i&gt;one&lt;/i&gt; and &lt;i&gt;mouth&lt;/i&gt; under a &lt;i&gt;hood&lt;/i&gt;.  Take the keyword to connote the &lt;b&gt;sameness&lt;/b&gt; that characterizes the life in a community of monks.  They all have the &lt;b&gt;same&lt;/b&gt; habits, including the one they wear on their backs.', '', '', 17, '2010-09-24 19:34:35', '2010-10-11 03:30:00', 17, 17),
(4873, 1, 699, 'The keyword &lt;b&gt;den&lt;/b&gt; refers to an animal lair hollowed out in the side of a mountain.  Now if we keep to the image of the monastic life as an image for &lt;i&gt;same&lt;/i&gt;, we can picture a &lt;b&gt;den&lt;/b&gt; of wild beasts dressed up in habits living the common life in a mountain cavern.  To bring in the element &lt;i&gt;water&lt;/i&gt;, we need only give them a sacred &quot;puddle&quot; in the center of their &lt;b&gt;den&lt;/b&gt;.', '', '', 17, '2010-09-24 19:29:50', '2010-10-11 03:30:00', 17, 17),
(4874, 1, 699, 'The word &lt;b&gt;trunk&lt;/b&gt; refers to the &lt;i&gt;part of the body&lt;/i&gt; that is left when you have &quot;&lt;b&gt;truncated&lt;/b&gt;&quot; alll the limbs.  Who woudl do such truncating but a sinister, black &lt;i&gt;monk&lt;/i&gt;, out on a midnight ritual.', '', '', 17, '2010-09-24 19:28:55', '2010-10-11 03:30:00', 17, 17),
(4875, 1, 699, 'Something referred to as &quot;over &lt;b&gt;yonder&lt;/b&gt;&quot; is usually far off in the distance - like a &lt;i&gt;wee drop&lt;/i&gt; in the distance.  Hence this kanji begins with &lt;i&gt;drop&lt;/i&gt;.  Then we find a sort of transparent &lt;i&gt;helmet&lt;/i&gt; with no eyes or nose, only a prominent &lt;i&gt;mouth&lt;/i&gt;, obviously extra-terrestrial.  What is he jabbering on about with his &lt;i&gt;mouth&lt;/i&gt; open like that?  Why, about his spaceship way over &lt;b&gt;yonder&lt;/b&gt; with its fuel tank on empty.', '', '', 17, '2010-09-24 19:34:12', '2010-10-11 03:30:00', 17, 17),
(4876, 1, 699, 'Above we see the primitive for &lt;i&gt;little&lt;/i&gt;, attached to one of those &lt;i&gt;glass canopies&lt;/i&gt; you might use to display a family heirloom.  The &lt;i&gt;littleness&lt;/i&gt; is important, because what is in fact on display is the shrunken, stuffed, and mounted &lt;i&gt;mouth&lt;/i&gt; of an &lt;b&gt;esteemed&lt;/b&gt; ancestor.', '', '', 17, '2010-09-24 19:32:27', '2010-10-11 03:30:00', 17, 17),
(4877, 1, 699, 'Here is the character for &lt;b&gt;character&lt;/b&gt; itself.  Not just kanji, but any written &lt;b&gt;character&lt;/b&gt;.  It shows a &lt;i&gt;child&lt;/i&gt; in a &lt;i&gt;house&lt;/i&gt;, learning the kanji &lt;b&gt;characters&lt;/b&gt;.', '', '', 17, '2010-09-24 19:33:48', '2010-10-11 03:30:00', 17, 17),
(4878, 1, 699, 'The notion of &lt;b&gt;guarding&lt;/b&gt; something easily brings to mind the image of someone standing on &lt;b&gt;guard&lt;/b&gt;, outside a palace or castle.  Here, we see the &lt;i&gt;house&lt;/i&gt;, and element for &lt;i&gt;glue&lt;/i&gt;, the idea being that a &lt;b&gt;guard&lt;/b&gt; should stick to the &lt;i&gt;house&lt;/i&gt; like &lt;i&gt;glue&lt;/i&gt;.', '', '', 17, '2010-09-24 19:35:48', '2010-10-11 03:30:00', 17, 17),
(4879, 1, 699, 'In this kanji , we see a &lt;i&gt;house&lt;/i&gt;, &lt;b&gt;perfect&lt;/b&gt; &lt;i&gt;house&lt;/i&gt;, built &lt;b&gt;perfectly&lt;/b&gt; from the very &lt;i&gt;beginning&lt;/i&gt;.', '', '', 17, '2010-09-24 19:32:54', '2010-10-11 03:30:00', 17, 17),
(4880, 1, 699, 'Under the primitive for &lt;i&gt;house&lt;/i&gt;, we have the kanji for &lt;i&gt;span&lt;/i&gt;.  The keyword here is &lt;b&gt;proclaim&lt;/b&gt;.  Imagine a preacher, &lt;b&gt;proclaiming&lt;/b&gt; good news from the &lt;i&gt;house&lt;/i&gt;tops, for the &lt;i&gt;span&lt;/i&gt; of a day.', '', '', 17, '2010-09-24 19:34:59', '2010-10-11 03:30:00', 17, 17),
(4881, 1, 699, 'The keyword &lt;b&gt;wee hours&lt;/b&gt; refers to the late evening or early morning hourse, well after one should be in bed asleep.  It does this by picturing a &lt;i&gt;house&lt;/i&gt; with a &lt;i&gt;candle&lt;/i&gt; in it, burning, probably, at both ends, well into the &lt;b&gt;wee hours&lt;/b&gt; of the night.', '', '', 17, '2010-09-24 19:29:26', '2010-10-11 03:30:00', 17, 17),
(4882, 1, 699, 'Here we have a picture of a &lt;i&gt;woman&lt;/i&gt;, &lt;b&gt;relaxing&lt;/b&gt; in a chair, under the roof of her &lt;i&gt;house&lt;/i&gt;, after a hard-day&#039;s work.', '', '', 17, '2010-09-24 19:38:08', '2010-10-11 03:30:00', 17, 17),
(4883, 1, 699, 'Let the idea of &lt;b&gt;drawing near&lt;/b&gt; suggest something dangerous or eerie that one approaches with fear and trembling.  Here we see a &lt;i&gt;strange house&lt;/i&gt;.  Perhaps it&#039;s haunted, and its ghosts beckon us to &lt;b&gt;draw near&lt;/b&gt; to take your soul!', '', '', 17, '2010-09-24 19:36:10', '2010-10-11 03:30:00', 17, 17),
(4884, 1, 699, 'Here we have the character on which the primitive &lt;b&gt;wealth&lt;/b&gt; is based on.  The difference here is that we are keeping our &lt;b&gt;wealth&lt;/b&gt; under a the roof of a &lt;i&gt;house&lt;/i&gt;, for extra security.', '', '', 17, '2010-09-24 19:27:43', '2010-10-11 03:30:00', 17, 17),
(4885, 1, 699, 'Here we have the kanji for &lt;b&gt;savings&lt;/b&gt;.  It comprises of money &lt;i&gt;shells&lt;/i&gt;, next to a &lt;i&gt;nail&lt;/i&gt; under the roof of a &lt;i&gt;house&lt;/i&gt;.  If I had lots of &lt;b&gt;savings&lt;/b&gt;, I would keep them in a secret hiding place in the &lt;i&gt;roof&lt;/i&gt;, marked by an old, rusty &lt;i&gt;nail&lt;/i&gt;.', '', '', 17, '2010-09-24 19:37:49', '2010-10-11 03:30:00', 17, 17),
(4886, 1, 699, 'In this kanji, meaning &lt;b&gt;banquet&lt;/b&gt;, we have a whole &lt;i&gt;day&lt;/i&gt; of work, getting in the way of a &lt;i&gt;woman&#039;s relaxation&lt;/i&gt;.', '', '', 17, '2010-09-24 19:36:56', '2010-10-11 03:30:00', 17, 17),
(4887, 1, 700, 'Here we see a pictograph of a &lt;b&gt;tree&lt;/b&gt;, showing the main trunk, the boughs, and the leafy growth.', '', '', 17, '2010-09-25 10:52:23', '2010-10-12 03:30:00', 17, 17),
(4888, 1, 700, 'A &lt;b&gt;grove&lt;/b&gt; is a small cluster of &lt;i&gt;trees&lt;/i&gt;, hence, the simple reduplication of the kanji for &lt;i&gt;tree&lt;/i&gt;.', '', '', 17, '2010-09-25 10:51:34', '2010-10-12 03:30:00', 17, 17),
(4889, 1, 700, 'A &lt;b&gt;forest&lt;/b&gt; is an expanse of &lt;i&gt;trees&lt;/i&gt;.  Therefor, the kanji for &lt;b&gt;forest&lt;/b&gt; shows &lt;i&gt;trees&lt;/i&gt; everywhere.', '', '', 17, '2010-09-25 10:54:09', '2010-10-12 03:30:00', 17, 17),
(4890, 1, 700, 'Unless you are a botanist, you are not likely to know what a &lt;b&gt;Japanese Judas-tree&lt;/b&gt; looks like.  Using the primitives as our guide, we define it as a &lt;i&gt;tree&lt;/i&gt; with &lt;i&gt;ivy&lt;/i&gt; growing down its branches in the shape of a hangman&#039;s noose.', '', '', 17, '2010-09-25 10:53:29', '2010-10-12 03:30:00', 17, 17),
(4891, 1, 700, 'What makes the &lt;b&gt;oak&lt;/b&gt; sacred in Celtic mythology is the &lt;i&gt;white&lt;/i&gt; berries of mistletoe growing on the branches of the &lt;b&gt;oak&lt;/b&gt;&lt;i&gt;tree&lt;/i&gt;.', '', '', 17, '2010-09-25 10:53:41', '2010-10-12 03:30:00', 17, 17),
(4892, 1, 700, 'Imagine a &lt;b&gt;frame&lt;/b&gt; made from a &lt;i&gt;tree&lt;/i&gt;.  The &lt;b&gt;frame&lt;/b&gt; will have four angles, at &lt;i&gt;nine&lt;/i&gt; by &lt;i&gt;ten&lt;/i&gt; degrees: a 90-degree right angled, rectangular &lt;b&gt;frame&lt;/b&gt;.', '', '', 17, '2010-09-25 10:53:18', '2010-10-12 03:30:00', 17, 17),
(4893, 1, 700, 'The kanji for &lt;b&gt;treetops&lt;/b&gt; shows a &lt;i&gt;tree&lt;/i&gt; to the left, and a &lt;i&gt;candle&lt;/i&gt; to the right.  Imagine tieing &lt;i&gt;candles&lt;/i&gt; to the &lt;b&gt;treetops&lt;/b&gt; of the very tallest &lt;i&gt;trees&lt;/i&gt;, to act as a beacon for aliens.', '', '', 17, '2010-09-25 10:51:59', '2010-10-12 03:30:00', 17, 17),
(4894, 1, 700, 'One often thinks of books as good &lt;i&gt;companions&lt;/i&gt;, but in this kanji, its the &lt;b&gt;shelf&lt;/b&gt; itself which is the &lt;i&gt;companion&lt;/i&gt;.  The reasons should be obvious, as both the &lt;b&gt;shelf&lt;/b&gt; and the book are made from the same thing: &lt;i&gt;trees&lt;/i&gt;.', '', '', 17, '2010-09-25 10:53:06', '2010-10-12 03:30:00', 17, 17),
(4895, 1, 700, '&lt;b&gt;Apricots&lt;/b&gt; can be eaten as soon as the fall from the &lt;i&gt;trees&lt;/i&gt;.  Picture a gapping &lt;i&gt;mouth&lt;/i&gt;, under a &lt;i&gt;tree&lt;/i&gt;, ready to eat the next &lt;b&gt;apricot&lt;/b&gt; that falls!', '', '', 17, '2010-09-25 10:51:44', '2010-10-12 03:30:00', 17, 17),
(4896, 1, 700, 'You have probably never heard of the &lt;b&gt;Paulownia&lt;/b&gt; &lt;i&gt;tree&lt;/i&gt;, so we shall use the phrase &quot;The Little Brothers of St.  &lt;b&gt;Paulownia&lt;/b&gt;&quot;.  In this kanji, we see a &lt;b&gt;Paulownia&lt;/b&gt; &lt;i&gt;tree&lt;/i&gt;, with a hooded &lt;i&gt;monk&lt;/i&gt; of St. &lt;b&gt;Paulownia&lt;/b&gt; beside.', '', '', 17, '2010-09-25 10:53:54', '2010-10-12 03:30:00', 17, 17),
(4897, 1, 700, 'Imagine an &lt;i&gt;tree&lt;/i&gt; that is so &lt;i&gt;old&lt;/i&gt;, that all the leaves begin to &lt;b&gt;wither&lt;/b&gt;, as soon as they grow.', '', '', 17, '2010-09-25 10:52:38', '2010-10-12 03:30:00', 17, 17),
(4898, 1, 700, 'As every good magician knows, the best &lt;i&gt;wands&lt;/i&gt; are those made out of the hazel &lt;i&gt;tree&lt;/i&gt;.  In order for a &lt;i&gt;wand&lt;/i&gt; to retain its magic, it must not be altered in form.  It must keep its &lt;b&gt;crude&lt;/b&gt;, uneven status as a &lt;i&gt;wand&lt;/i&gt; clearly derived form a &lt;i&gt;tree&lt;/i&gt;.', '', '', 17, '2010-09-25 10:54:20', '2010-10-12 03:30:00', 17, 17),
(4899, 1, 700, 'The character for &lt;b&gt;town&lt;/b&gt; shows &lt;i&gt;trees&lt;/i&gt; &lt;i&gt;glued&lt;/i&gt; to the &lt;b&gt;town&lt;/b&gt; limits, to make it a nicer place to live in.', '', '', 17, '2010-09-25 10:52:14', '2010-10-12 03:30:00', 17, 17),
(4900, 1, 700, 'You have no doubt seen how people practicing the Japanese art of bonsai take those helpless saplings and twist them into crippled dwarves before they have a chance to grow up as they should.  The more proper way to &lt;b&gt;plant&lt;/b&gt; a young &lt;i&gt;tree&lt;/i&gt; and give it a fair shake in life is to set it into the earth in such a way that it can grow up &lt;i&gt;straight&lt;/i&gt;.', '', '', 17, '2010-09-25 10:52:52', '2010-10-12 03:30:00', 17, 17),
(4901, 1, 700, 'The prefix &lt;b&gt;inter-&lt;/b&gt; stirs up associations of cooperation amongst people.  From there, we read off the elements: &lt;i&gt;tree&lt;/i&gt;...&lt;i&gt;eye&lt;/i&gt;.  With only a slight leap of the imagination, those two words call to mind the scriptural proverb about first taking the block of timber out of one&#039;s own &lt;i&gt;eye&lt;/i&gt;, before helping your neightbours remove the splinters in their &lt;i&gt;eyes&lt;/i&gt;.  What more useful rule for &lt;b&gt;inter-&lt;/b&gt;human relationships?', '', '', 16, '2010-09-10 18:29:34', '2010-09-26 03:30:00', 16, 16),
(4902, 1, 700, 'We need to fix imagination here on two things to learn the kanji for &lt;b&gt;desk&lt;/b&gt;: the wonderful rough &lt;i&gt;wood&lt;/i&gt; of which it has been hewn, and the &lt;i&gt;wind&lt;/i&gt; that blows across it, sending your papers flying all over the room.', '', '', 16, '2010-09-10 18:27:54', '2010-09-26 03:30:00', 16, 16),
(4903, 1, 700, 'Recalling that &lt;b&gt;books&lt;/b&gt; are made of paper, and paper made of &lt;i&gt;trees&lt;/i&gt;, one might think of a &lt;b&gt;book&lt;/b&gt; as &lt;i&gt;one&lt;/i&gt; slice of a &lt;i&gt;tree&lt;/i&gt;.', '', '', 16, '2010-09-10 18:28:28', '2010-09-26 03:30:00', 16, 16),
(4904, 1, 700, 'The &lt;b&gt;tags&lt;/b&gt; that you see hanging on &lt;i&gt;trees&lt;/i&gt; in public places in Japane are helpful to indentify what sort of &lt;i&gt;trees&lt;/i&gt; they are.  Next time you see one, imagine that the &lt;b&gt;tag&lt;/b&gt; is fixed to the tree with a &lt;i&gt;fishhook&lt;/i&gt;.', '', '', 16, '2010-09-10 18:29:42', '2010-09-26 03:30:00', 16, 16),
(4905, 1, 700, 'Look at this character in reverse order, from the bottom up.  First we see the primitive for &lt;i&gt;days&lt;/i&gt;, and appropriate way to begin a &lt;b&gt;calendar&lt;/b&gt;.  Next, we see a &lt;i&gt;grove of trees&lt;/i&gt; under a &lt;i&gt;cliff&lt;/i&gt;.  The trees push through the surface of the &lt;i&gt;cliff&lt;/i&gt;, once a &lt;i&gt;day&lt;/i&gt;, for the duration of the &lt;b&gt;calendar&lt;/b&gt; year, making a huge, &lt;i&gt;cliff&lt;/i&gt;-top &lt;b&gt;calendar&lt;/b&gt;!', '', '', 16, '2010-09-10 18:28:40', '2010-09-26 03:30:00', 16, 16),
(4906, 1, 700, 'If you&#039;ve made a &lt;b&gt;plan&lt;/b&gt; to &lt;i&gt;relax&lt;/i&gt;, what better &lt;b&gt;plan&lt;/b&gt; than to &lt;i&gt;relax&lt;/i&gt; on your hammock, swinging from a leafy &lt;i&gt;tree&lt;/i&gt;?', '', '', 16, '2010-09-10 18:28:02', '2010-09-26 03:30:00', 16, 16),
(4907, 1, 700, '&lt;b&gt;Parch&lt;/b&gt;ment are &lt;i&gt;goods&lt;/i&gt; made from &lt;i&gt;trees&lt;/i&gt;.  Watch out though, because they can&#039;t parch the &lt;i&gt;fire&lt;/i&gt;!', '', '', 16, '2010-09-10 18:29:27', '2010-09-26 03:30:00', 16, 16),
(4908, 1, 700, 'The kanji for &lt;b&gt;not yet&lt;/b&gt; shows a &lt;i&gt;tree&lt;/i&gt; which is &lt;b&gt;not yet&lt;/b&gt; fully grown.  There is an extra line, showing that the tree has &lt;i&gt;one&lt;/i&gt; more year to grow.', '', '', 16, '2010-09-10 18:28:09', '2010-09-26 03:30:00', 16, 16),
(4909, 1, 700, 'The kanji for &lt;b&gt;extremity&lt;/b&gt; shows a tree which has reached its &lt;b&gt;extremity&lt;/b&gt; for growth.  The upper branches are much longer than the lower!', '', '', 16, '2010-09-10 18:29:50', '2010-09-26 03:30:00', 16, 16),
(4910, 1, 700, 'The &lt;b&gt;splash&lt;/b&gt; this kanji refers to is the dash of &lt;i&gt;water&lt;/i&gt; against the rocks, with all the foam and spray this creates.  If you think of a &lt;b&gt;splash&lt;/b&gt; as a wave that has run its full course,a nd reached its &lt;i&gt;extremity&lt;/i&gt;, namely, the seashore, then the kanji is yours for good.', '', '', 16, '2010-09-10 18:28:18', '2010-09-26 03:30:00', 16, 16),
(4911, 1, 700, 'When a tree has &lt;i&gt;not yet&lt;/i&gt; finished growing, it produces a full &lt;b&gt;flavour&lt;/b&gt;.  When the official taster (the &lt;i&gt;mouth&lt;/i&gt; to the left) determines tha full &lt;b&gt;flavour&lt;/b&gt; has been reached, the tree is pruned back so that it remains permanently &lt;i&gt;not yet&lt;/i&gt; grown.', '', '', 16, '2010-09-10 18:29:03', '2010-09-26 03:30:00', 16, 16),
(4912, 1, 700, 'The &lt;b&gt;younger sister&lt;/b&gt; in the family is the &lt;i&gt;woman&lt;/i&gt; who, like the newest branch of the tree, is &lt;i&gt;not yet&lt;/i&gt; old enough or mature enough to do everything the elder sister can do.', '', '', 16, '2010-09-10 18:28:48', '2010-09-26 03:30:00', 16, 16),
(4913, 1, 700, 'That red-orange colour we call &lt;b&gt;vermilion&lt;/b&gt; is found in nature during the autumn, when the leaves lose their sugar and begin to change colour.  This kanji depicts the very last leaf on a tree in the fall (the &lt;i&gt;drop&lt;/i&gt; hung on the first stroke), the leaf that has &lt;i&gt;not yet&lt;/i&gt; fallen as it one day must.  What colour is such a leaf?  &lt;b&gt;Vermilion&lt;/b&gt;.', '', '', 16, '2010-09-10 18:29:13', '2010-09-26 03:30:00', 16, 16),
(4914, 1, 700, 'The &lt;b&gt;stocks&lt;/b&gt; bought and sold on the market by the tens of millions each day get their name from a compariosn to a healthy &lt;i&gt;tree&lt;/i&gt;, in which one takes &lt;b&gt;stock&lt;/b&gt; in the hopes it will grow and produce more and more &lt;i&gt;trees&lt;/i&gt; like itself.  Usually good &lt;b&gt;stocks&lt;/b&gt; are referres to as &quot;blue chip&quot;, but here we are asked to associate the keyword with the colour &lt;i&gt;vermilion&lt;/i&gt;, perhpas because one can asses the value of a tree from the colour of its autumn leaves?', '', '', 16, '2010-09-11 12:58:54', '2010-09-27 03:30:00', 16, 16),
(4915, 1, 700, 'Here we see a &lt;i&gt;flower&lt;/i&gt; held in the &lt;i&gt;right&lt;/i&gt; hand.  You can imagine yourself in a garden where &lt;i&gt;flowers&lt;/i&gt; picked with the &lt;i&gt;right&lt;/i&gt; hand grant eternal &lt;b&gt;youth&lt;/b&gt;, but those picked with the left hand, premature senility.', '', '', 16, '2010-09-11 13:01:23', '2010-09-27 03:30:00', 16, 16),
(4916, 1, 700, 'We tend to believe that &lt;b&gt;grass&lt;/b&gt; doesn&#039;t have any &lt;i&gt;flowers&lt;/i&gt;.  However, it does &lt;i&gt;flower&lt;/i&gt;, just exceptionally &lt;i&gt;early&lt;/i&gt; in the morning, so we never see it happening.', '', '', 16, '2010-09-11 13:00:06', '2010-09-27 03:30:00', 16, 16),
(4917, 1, 700, 'The picture of &lt;b&gt;suffering&lt;/b&gt; we are given here is that of a &lt;i&gt;flower&lt;/i&gt; that has grown &lt;i&gt;old&lt;/i&gt;.  When a flower ages, it pales, and dries up, showing signs of great &lt;b&gt;suffering&lt;/b&gt;.', '', '', 16, '2010-09-11 13:00:58', '2010-09-27 03:30:00', 16, 16),
(4918, 1, 700, 'The &lt;i&gt;house&lt;/i&gt; of &lt;i&gt;flowers&lt;/i&gt;, or &quot;hot house&quot; has become a metaphor for narrow-minded, biased, and intolerant attitude distrustful of change.  &lt;b&gt;Tolerance&lt;/b&gt;, by contrast, is open-minded, and welcomes novelty.  The way to encoruage &lt;b&gt;tolerance&lt;/b&gt; in those who lack it, is to first have them &lt;i&gt;see&lt;/i&gt; through their own hot houseattitudes, which is the very counsel we are given in this kanji.', '', '', 16, '2010-09-11 12:59:21', '2010-09-27 03:30:00', 16, 16),
(4919, 1, 700, 'A &lt;i&gt;flower&lt;/i&gt; is used by an &lt;i&gt;acupuncturist&lt;/i&gt; to draw up &lt;i&gt;water&lt;/i&gt; and &lt;b&gt;dilute&lt;/b&gt; one&#039;s blood.', '', '', 16, '2010-09-11 13:01:13', '2010-09-27 03:30:00', 16, 16),
(4920, 1, 700, 'The differnce between a &lt;i&gt;flower&lt;/i&gt; and a &lt;i&gt;tree&lt;/i&gt; is a &lt;i&gt;generation&lt;/i&gt; of &lt;b&gt;leaves&lt;/b&gt;.', '', '', 16, '2010-09-11 13:01:40', '2010-09-27 03:30:00', 16, 16),
(4921, 1, 700, 'Ah, but haven&#039;t modern &lt;i&gt;graveyards &lt;/i&gt;become a parody of their ancestors?!  The flowers are plastic, the writing on the stones is unimaginative and cold, and the whole thing looks more like a marble orchard than a &lt;i&gt;graveyard&lt;/i&gt;.  Heck, there are even &lt;b&gt;imitation&lt;/b&gt; &lt;i&gt;trees&lt;/i&gt; in this particular &lt;i&gt;graveyard&lt;/i&gt;.', '', '', 16, '2010-09-11 13:00:49', '2010-09-27 03:30:00', 16, 16),
(4922, 1, 700, 'Think of the keyword &lt;b&gt;vague&lt;/b&gt; has having to do with something viewed through a haze, which is only &lt;b&gt;vaguely&lt;/b&gt; discernable.  Such a thing might well be the misty &lt;i&gt;waters&lt;/i&gt; of the river styx, next to a &lt;i&gt;graveyard&lt;/i&gt;.', '', '', 16, '2010-09-11 12:59:50', '2010-09-27 03:30:00', 16, 16),
(4923, 1, 700, 'In a &lt;i&gt;graveyard&lt;/i&gt;, most of the &lt;b&gt;graves&lt;/b&gt; aren&#039;t on the surface, but six feet under &lt;i&gt;ground&lt;/i&gt;.', '', '', 16, '2010-09-11 12:59:37', '2010-09-27 03:30:00', 16, 16),
(4924, 1, 700, 'Imagine that you have chosen the occupation of the keeper of a &lt;i&gt;graveyard&lt;/i&gt; and spend your &lt;i&gt;days&lt;/i&gt; tending to other&#039;s deadhood, in order to make your &lt;b&gt;livelihood&lt;/b&gt;.', '', '', 16, '2010-09-11 12:59:07', '2010-09-27 03:30:00', 16, 16),
(4925, 1, 700, 'The &lt;i&gt;part of the body&lt;/i&gt; first affected by a stroll through a haunted &lt;i&gt;graveyard&lt;/i&gt; is the skin, which gets goose bumps on your skin, more technically called your flesh-&lt;b&gt;membrane&lt;/b&gt;.', '', '', 16, '2010-09-11 13:00:38', '2010-09-27 03:30:00', 16, 16),
(4926, 1, 700, 'Ideas are the &lt;b&gt;seedlings&lt;/b&gt; of our imagination.  If we plant them in our &lt;i&gt;brains&lt;/i&gt; long enough, they will &lt;i&gt;flower&lt;/i&gt; and bloom.', '', '', 16, '2010-09-11 13:00:19', '2010-09-27 03:30:00', 16, 16),
(4927, 1, 701, 'Here we have a pictograph of the back of a turtle, the two sloping vertical strokes representing the central ridge and the four short strokes the pattern.  Think of reading turtle shells as a way to fortell the future, and in particular things that &lt;b&gt;portend&lt;/b&gt; coming evils.', '', '', 16, '2010-09-12 18:03:39', '2010-09-28 03:30:00', 16, 16),
(4928, 1, 701, 'To associate the &lt;b&gt;peach tree&lt;/b&gt; with the primitive for &lt;i&gt;portent&lt;/i&gt;, imagine the &lt;b&gt;peach tree&lt;/b&gt; as the tree of knowledge from the garden of eden.  Said &lt;i&gt;tree&lt;/i&gt; was associated with a &lt;i&gt;portent&lt;/i&gt; of coming evil.', '', '', 15, '2010-09-12 18:02:40', '2010-09-27 03:30:00', 21, 20),
(4929, 1, 701, 'To give someone the &quot;evil &lt;i&gt;eye&lt;/i&gt;&quot; is to &lt;b&gt;stare&lt;/b&gt; at them.  Here we see an &lt;i&gt;eye&lt;/i&gt; that &lt;i&gt;protends&lt;/i&gt; evil, giving the meaning &lt;b&gt;stare&lt;/b&gt;.', '', '', 16, '2010-09-22 16:47:31', '2010-10-08 03:30:00', 21, 20),
(4930, 1, 701, 'The kanji for &lt;b&gt;dog&lt;/b&gt; shows one big &lt;i&gt;St Bernards&lt;/i&gt;, next to a tiny little &lt;b&gt;dog&lt;/b&gt;, drawn just as a tiny little &lt;i&gt;drop&lt;/i&gt;!', '', '', 16, '2010-09-12 18:04:10', '2010-09-28 03:30:00', 16, 16),
(4931, 1, 701, 'Here we see a &lt;i&gt;turtle&lt;/i&gt;, balancing a &lt;i&gt;chihuahua&lt;/i&gt; on its little &lt;i&gt;tutle&lt;/i&gt;-back.  If the &lt;i&gt;turtle&lt;/i&gt; moves just an inch, the delicately balanced &lt;i&gt;chihuahua&lt;/i&gt; will fall, having upset the &lt;b&gt;status quo&lt;/b&gt;.', '', '', 16, '2010-09-12 18:03:07', '2010-09-28 03:30:00', 16, 16),
(4932, 1, 701, 'Oddly enough, the character for &lt;b&gt;silence&lt;/b&gt; shows a &lt;i&gt;black chihuahua&lt;/i&gt;.  Actually, the cute little critter&#039;s name is Darkness, as I am sure you remember from the famous song about &lt;b&gt;silence&lt;/b&gt; that begins &quot;Hello, Darkness, my old friend....&quot;.  Note how the four dots reach all the way across the bottom of the character.', '', '', 16, '2010-09-12 18:02:24', '2010-09-28 03:30:00', 16, 16),
(4933, 1, 701, 'The keyword, &lt;b&gt;sort of thing&lt;/b&gt;, is actually a suffix which makes the preceding word an adjective.  Reverting to the time when a &lt;i&gt;dog&lt;/i&gt; was more widely eaten than today, we see here a large cauldron, boiling over an &lt;i&gt;oven flame&lt;/i&gt;, with the &lt;i&gt;flesh&lt;/i&gt; of a &lt;i&gt;chihuahua&lt;/i&gt; being thrown into the whole concoction to make it into a &quot;hot-diggity, hot-dog&quot; &lt;b&gt;sort of thing&lt;/b&gt;.', '', '', 16, '2010-09-12 18:03:48', '2010-09-28 03:30:00', 16, 16),
(4934, 1, 701, 'You&#039;ve no doubt seen cattails, those swamp &lt;b&gt;reeds&lt;/b&gt; with a furry &lt;i&gt;flower&lt;/i&gt; to them like the tail of a cat.  This might just turn out to be a good way to get rid of a troublesome &lt;i&gt;pack of wild dogs&lt;/i&gt;: lure them into a swamp of these &lt;b&gt;reeds&lt;/b&gt; with teh cattail &lt;i&gt;flowers&lt;/i&gt;, and then set &lt;i&gt;fire&lt;/i&gt; to the swamp.', '', '', 16, '2010-09-12 18:03:59', '2010-09-28 03:30:00', 16, 16),
(4935, 1, 701, 'One of the worst problems when out &lt;b&gt;hunting&lt;/b&gt; is how to &lt;i&gt;guard&lt;/i&gt; your catch from &lt;i&gt;packs of wild dogs&lt;/i&gt;.  If you imagine yourself failing the task, you will probably have a stronger image than if you try to picture yourself succeeding.', '', '', 15, '2010-09-12 18:03:30', '2010-09-27 03:30:00', 21, 20),
(4936, 1, 701, 'Knowing how much dogs love to chase &lt;b&gt;cats&lt;/b&gt;, picture a &lt;i&gt;pack of wild dogs&lt;/i&gt; planting &lt;b&gt;cat&lt;/b&gt;-&lt;i&gt;seedlings&lt;/i&gt;, watering them, and fertilizing them, until they can be harvested as a crop of &lt;b&gt;cats&lt;/b&gt; for them to chase.', '', '', 16, '2010-09-12 18:05:26', '2010-09-28 03:30:00', 16, 16),
(4937, 1, 701, 'Can you see the doodle of a &lt;b&gt;cow&lt;/b&gt; that has just been run over by a steam-roller?  The small dot in the first stroke shows its head turned to one side, and the next two strokes the legs.', '', '', 16, '2010-09-12 18:02:52', '2010-09-28 03:30:00', 16, 16),
(4938, 1, 701, 'We shall take the keyword &lt;b&gt;special&lt;/b&gt; to mean someone in a &lt;b&gt;special&lt;/b&gt; class fo their own - like the sacred &lt;i&gt;cows&lt;/i&gt; of India, that wander freely with the threat of being butchered.  They might even wander into a &lt;i&gt;buddhist temple&lt;/i&gt; to receive a &lt;b&gt;special&lt;/b&gt; blessing, and do so with impunity.', '', '', 16, '2010-09-17 05:08:09', '2010-10-03 03:30:00', 21, 19),
(4939, 1, 701, 'Folklore throughout the world tells us of talking animals who show wisdom superior to that of human beings.  This character depicts a &lt;b&gt;revelation&lt;/b&gt; coming from a &lt;i&gt;cow&#039;s mouth&lt;/i&gt;, suggesting oracular utterances about truths hidden to human intelligence.', '', '', 16, '2010-09-12 18:02:06', '2010-09-28 03:30:00', 16, 16),
(4940, 1, 701, 'Take the keyword &lt;b&gt;before&lt;/b&gt; in the physical, not the temperoal sense (although it applies equally to both).  If you have a &lt;i&gt;cow&lt;/i&gt; with &lt;i&gt;human legs&lt;/i&gt; it is only because you have two people in a cow-suit.  I always thought I&#039;d prefer to be the one standing &lt;b&gt;before&lt;/b&gt;, rather than the one that holds up the rear.', '', '', 16, '2010-09-12 18:04:56', '2010-09-28 03:30:00', 16, 16),
(4941, 1, 701, 'The kanji for &lt;b&gt;wash&lt;/b&gt; comprises of the elements &lt;i&gt;water&lt;/i&gt; and &lt;i&gt;before&lt;/i&gt;.  Splash som &lt;i&gt;water&lt;/i&gt; on yourself &lt;i&gt;before&lt;/i&gt; you go out, so people see that you have &lt;b&gt;washed&lt;/b&gt;.', '', '', 16, '2010-09-12 18:01:57', '2010-09-28 03:30:00', 16, 16),
(4942, 1, 702, 'The idea of something getting &lt;b&gt;jammed in&lt;/b&gt;to something else is depicted here by having a &lt;i&gt;walking stick&lt;/i&gt; get &lt;b&gt;jammed in&lt;/b&gt;to and &lt;i&gt;umbrella&lt;/i&gt; stand at the door.  First notice the vertical strokes: on the elft is the curved &lt;i&gt;umbrella&lt;/i&gt; handle, and on the right, the straight &lt;i&gt;walking stick&lt;/i&gt;.  Now try to imagine the two parties tugging at their respective properties at the entrance of an elegant restaurant.', '', '', 16, '2010-09-14 05:10:20', '2010-09-30 03:30:00', 16, 16),
(4943, 1, 702, 'As the &lt;b&gt;world&lt;/b&gt; gets &lt;i&gt;jammed in&lt;/i&gt; with more people, there is less and less space.  Imagine yourself taking a flight over the &lt;b&gt;world&lt;/b&gt; so densely populated that every bit is sectioned off for either housing or the production of the new staple food in the form of &lt;i&gt;ricefields&lt;/i&gt;.', '', '', 16, '2010-09-14 05:08:58', '2010-09-30 03:30:00', 16, 16),
(4944, 1, 702, 'As everyone knows, &lt;b&gt;tea&lt;/b&gt; is made from &lt;b&gt;tea&lt;/b&gt; leaves.  But the &lt;b&gt;tea&lt;/b&gt; plant itself has its own &lt;i&gt;flowers&lt;/i&gt;, which are quite beautiful.  With the image of a terrace of &lt;i&gt;flowering&lt;/i&gt; &lt;b&gt;tea&lt;/b&gt; bushes in mind, picture a number of brightly painted and very l-o-n-g &lt;i&gt;wooden poles&lt;/i&gt; here and there, with an &lt;i&gt;umbrella&lt;/i&gt; on top, to shade the delicate &lt;b&gt;tea&lt;/b&gt; leaves.', '', '', 16, '2010-09-14 05:09:46', '2010-09-30 03:30:00', 16, 16),
(4945, 1, 702, 'The kanji for &lt;b&gt;fit&lt;/b&gt; shows an &lt;i&gt;umbrella&lt;/i&gt;, the kanji for &lt;i&gt;one&lt;/i&gt;, and a &lt;i&gt;mouth&lt;/i&gt; at the bottom.  Imagine someone trying to &lt;b&gt;fit&lt;/b&gt; just &lt;i&gt;one umbrella&lt;/i&gt; into his mouth, like a rain-day sword swallower.', '', '', 16, '2010-09-14 05:11:31', '2010-09-30 03:30:00', 16, 16),
(4946, 1, 702, 'One the left we see a mound of &lt;i&gt;dirt&lt;/i&gt;, and to the right, &lt;i&gt;flowers&lt;/i&gt; made to &lt;i&gt;fit&lt;/i&gt; together.  The two sides combine to create a great &lt;b&gt;pagoda&lt;/b&gt;, made of &lt;i&gt;dirt&lt;/i&gt;, with &lt;i&gt;flowers&lt;/i&gt; by the tens of thousands &lt;i&gt;fitted&lt;/i&gt; together for the roofing of each of the layers.', '', '', 16, '2010-09-14 05:11:58', '2010-09-30 03:30:00', 16, 16),
(4947, 1, 702, 'The kanji for &lt;b&gt;king&lt;/b&gt; is a pictograph of the &lt;b&gt;king&#039;s&lt;/b&gt; sceptre.', '', '', 16, '2010-09-14 05:10:14', '2010-09-30 03:30:00', 16, 16),
(4948, 1, 702, 'Note the &lt;i&gt;drop&lt;/i&gt; here in the king&#039;s &lt;i&gt;scepter&lt;/i&gt;, a precious &lt;b&gt;jewel&lt;/b&gt; falling out due to clumsy handling.', '', '', 16, '2010-09-14 05:11:49', '2010-09-30 03:30:00', 16, 16),
(4949, 1, 702, 'Every &lt;i&gt;house&lt;/i&gt; has its &lt;b&gt;treasure&lt;/b&gt;, as every theif knows only too well.  While the things we &lt;b&gt;treasure&lt;/b&gt; most are usually of sentimental value, we take the original sense of the term &lt;b&gt;treasure&lt;/b&gt; here and make it refer to &lt;i&gt;jewels&lt;/i&gt; kept in one&#039;s &lt;i&gt;house&lt;/i&gt;.', '', '', 16, '2010-09-14 05:11:07', '2010-09-30 03:30:00', 16, 16),
(4950, 1, 702, 'Think of the most enourmous &lt;b&gt;pearl&lt;/b&gt; you have ever seen, a great &lt;i&gt;vermilion&lt;/i&gt;-colored &lt;i&gt;ball&lt;/i&gt;, sitting on your ring, making it difficult to move without fallwing over from the weight of the thing.', '', '', 16, '2010-09-14 05:11:16', '2010-09-30 03:30:00', 16, 16),
(4951, 1, 702, 'This kanji is for the &lt;b&gt;present&lt;/b&gt;, as in the time-frame, as distinct from the future and the past.  The kanji gives us a crystal &lt;i&gt;ball&lt;/i&gt; in which we &lt;i&gt;see&lt;/i&gt; the &lt;b&gt;present&lt;/b&gt; things going on in far away places.', '', '', 16, '2010-09-14 05:09:58', '2010-09-30 03:30:00', 16, 16),
(4952, 1, 702, 'The kanji for &lt;b&gt;lunatic&lt;/b&gt; comprises of the element &lt;i&gt;a pack of wild dogs&lt;/i&gt; and &lt;i&gt;king&lt;/i&gt;.  Imagine a crazy &lt;b&gt;lunatic&lt;/b&gt;, running with a &lt;i&gt;pack of wild dogs&lt;/i&gt; as their powerful, howling &lt;i&gt;king&lt;/i&gt;.', '', '', 16, '2010-09-14 05:11:23', '2010-09-30 03:30:00', 16, 16),
(4953, 1, 702, 'An &lt;b&gt;emperor&lt;/b&gt; is a ruler - something like a &lt;i&gt;king&lt;/i&gt;, but higher in status.  The &lt;i&gt;white bird&lt;/i&gt; perched above the &lt;i&gt;king&lt;/i&gt;, picks the &lt;i&gt;king&lt;/i&gt; up in its claws and personaly elevates him to the status of &lt;b&gt;emperor&lt;/b&gt;.', '', '', 16, '2010-09-14 05:08:33', '2010-09-30 03:30:00', 16, 16),
(4954, 1, 702, 'The kanji for &lt;b&gt;display&lt;/b&gt; shows an open &lt;i&gt;mouth&lt;/i&gt;, gasping at the &lt;i&gt;king&lt;/i&gt;, parading around in his new clothes, leaving nothing off &lt;b&gt;display&lt;/b&gt;.', '', '', 16, '2010-09-14 05:12:07', '2010-09-30 03:30:00', 16, 16),
(4955, 1, 702, 'The king&#039;s &lt;i&gt;sceptre&lt;/i&gt; is so precious, it gets a &lt;b&gt;whole&lt;/b&gt; &lt;i&gt;umbrella&lt;/i&gt; just to itself.', '', '', 16, '2010-09-14 05:08:50', '2010-09-30 03:30:00', 16, 16),
(4956, 1, 702, 'Here we think of a &lt;b&gt;plug&lt;/b&gt; in the sense of a cork stopper used to seal the mouth of a bottle, water faucet, or something with liquid running out of it.  The primitive units are: &lt;i&gt;tree...umbrella...ball&lt;/i&gt;.  Let&#039;s imagine a &lt;i&gt;tree&lt;/i&gt; with a faucet in the side out of which tennis &lt;i&gt;balls&lt;/i&gt; are flowing, bouncing all over the ground by the hundreds.  You fight your way up to the tap and shove your giant beach &lt;i&gt;umbrella&lt;/i&gt; into the &lt;i&gt;tree&lt;/i&gt; to &lt;b&gt;plug&lt;/b&gt; it up.', '', '', 16, '2010-09-14 05:08:04', '2010-09-30 03:30:00', 16, 16),
(4957, 1, 702, 'The image of &lt;b&gt;logic&lt;/b&gt; we are given is something like a chief function of a &lt;i&gt;computer&lt;/i&gt;.  Of course, Japan didn&#039;t have clans, so no chiefs; instead a &lt;i&gt;king&lt;/i&gt;.', '', '', 16, '2010-09-14 05:10:29', '2010-09-30 03:30:00', 16, 16),
(4958, 1, 702, 'Whilst a &lt;i&gt;king&lt;/i&gt; is almighty, he canhardly rule an entire coutnry by himself.  He appoints &lt;b&gt;lords&lt;/b&gt;, each with a &lt;i&gt;drop&lt;/i&gt; of the &lt;i&gt;king&lt;/i&gt;&#039;s power and duties.', '', '', 16, '2010-09-14 05:07:53', '2010-09-30 03:30:00', 16, 16);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(4959, 1, 702, 'Picture &lt;b&gt;pouring&lt;/b&gt; &lt;i&gt;water&lt;/i&gt; onto a lit &lt;i&gt;candlestick&lt;/i&gt; to remember this kanji.', '', '', 16, '2010-09-14 05:09:06', '2010-09-30 03:30:00', 16, 16),
(4960, 1, 702, 'The &lt;b&gt;pillar&lt;/b&gt; referred to here is the &lt;i&gt;wooden&lt;/i&gt; beam that stands at the entrance to a traditional Japanese house.  Carve it in your imagination into the shape of a gigantic &lt;i&gt;candlestick&lt;/i&gt;, and your work is done.', '', '', 16, '2010-09-14 05:11:41', '2010-09-30 03:30:00', 16, 16),
(4961, 1, 702, 'We want to depict bars of &lt;b&gt;gold&lt;/b&gt; bullion, with an &lt;i&gt;umbrella&lt;/i&gt; overhead, to shade them from the heat.  The bullion is made by melting down all the &lt;i&gt;scepters&lt;/i&gt; in the kingdom, &lt;i&gt;drop&lt;/i&gt; by &lt;i&gt;drop&lt;/i&gt;, and shaping them into bars.', '', '', 16, '2010-09-14 05:09:21', '2010-09-30 03:30:00', 16, 16),
(4962, 1, 702, '&lt;b&gt;Pig iron&lt;/b&gt; refers to iron in the crude form in which it emerges from the smelting furnaces.  Of all the various forms &lt;i&gt;metal&lt;/i&gt; can take, this one shows us metal &lt;i&gt;before&lt;/i&gt; it has been refined.', '', '', 16, '2010-09-14 05:10:58', '2010-09-30 03:30:00', 16, 16),
(4963, 1, 702, 'Let &lt;b&gt;bowl&lt;/b&gt; suggest a large and heavy &lt;i&gt;golden&lt;/i&gt; &lt;b&gt;bowl&lt;/b&gt; into which you are throwing all the &lt;i&gt;books&lt;/i&gt; you own to mash them into a pulp, because you have run out of porridge.', '', '', 16, '2010-09-14 05:09:31', '2010-09-30 03:30:00', 16, 16),
(4964, 1, 702, 'Picture an order of &lt;i&gt;monks&lt;/i&gt; serving as chaplains for the police force.  Their special habit, made of protective &lt;i&gt;metal&lt;/i&gt;, is distinguished by a row of &lt;b&gt;copper&lt;/b&gt; buttons, just like the &quot;cops&quot; they serve.', '', '', 16, '2010-09-14 05:08:15', '2010-09-30 03:30:00', 16, 16),
(4965, 1, 702, 'The character for &lt;b&gt;angling&lt;/b&gt; refers to fishing as a sport.  Here we see an &lt;b&gt;angling&lt;/b&gt; rod which is not just made from &lt;i&gt;gold&lt;/i&gt;, but is in the shape of a &lt;i&gt;ladle&lt;/i&gt;, and is used to scoop small goldfish out of a near-by river.', '', '', 16, '2010-09-14 05:08:25', '2010-09-30 03:30:00', 16, 16),
(4966, 1, 702, 'The kanji for &lt;b&gt;needle&lt;/b&gt; comrpises of the elements &lt;i&gt;metal&lt;/i&gt; and &lt;i&gt;needle&lt;/i&gt;, which makes sense, since most &lt;b&gt;needles&lt;/b&gt; are indeed made from &lt;i&gt;metal&lt;/i&gt;', '', '', 16, '2010-09-14 05:10:07', '2010-09-30 03:30:00', 16, 16),
(4967, 1, 702, 'Take &lt;b&gt;inscription&lt;/b&gt; in the sense of the &lt;i&gt;name&lt;/i&gt; you ask the jeweller to carve on a &lt;i&gt;gold&lt;/i&gt; bracelet to communicate a sentimental message.', '', '', 16, '2010-09-14 05:10:38', '2010-09-30 03:30:00', 16, 16),
(4968, 1, 702, 'The first lie-dectors worked by wiring pieces of &lt;i&gt;metal&lt;/i&gt; to the victim. Using these machines, the &lt;i&gt;truth&lt;/i&gt; could be discerned.  Now-a-days, &lt;b&gt;tranquilising&lt;/b&gt; drugs are used which make people tell the &lt;i&gt;truth&lt;/i&gt;.', '', '', 15, '2010-09-24 19:39:10', '2010-10-09 03:30:00', 25, 23),
(4969, 1, 703, 'The keyword &lt;b&gt;roadway&lt;/b&gt; carries both the sense of a &lt;b&gt;road&lt;/b&gt; for transit and a &lt;b&gt;way&lt;/b&gt; or method of doing something, but the former is better for forming an image.  The primitives read: the &lt;i&gt;neck&lt;/i&gt; of a &lt;i&gt;road&lt;/i&gt;.  Think of a crowded &lt;b&gt;roadway&lt;/b&gt;, where traffic has come to a stand-still - what we commonly call a bottle&lt;i&gt;neck&lt;/i&gt;.', '', '', 16, '2010-09-15 05:16:35', '2010-10-01 03:30:00', 16, 16),
(4970, 1, 703, 'When we accept someone&#039;s &lt;b&gt;guidance&lt;/b&gt;, we permit ourselves to be &lt;i&gt;glued&lt;/i&gt; to a certain &lt;i&gt;road&lt;/i&gt; or &lt;i&gt;way&lt;/i&gt; of doing something, and try to &quot;stick&quot; to it.', '', '', 16, '2010-09-15 05:18:48', '2010-10-01 03:30:00', 16, 16),
(4971, 1, 703, 'Take the first two strokes as a pictograph of a &lt;i&gt;cross&lt;/i&gt;, and set it on a &lt;i&gt;road&lt;/i&gt; to create a &lt;b&gt;crossing&lt;/b&gt;.', '', '', 16, '2010-09-15 05:17:16', '2010-10-01 03:30:00', 16, 16),
(4972, 1, 703, 'Here we see a &lt;i&gt;crossing&lt;/i&gt; in the form of a barbed &lt;i&gt;fishhook&lt;/i&gt;, suggesting a &lt;b&gt;swifter&lt;/b&gt; alternate to not only the roundabouts used in Europe, but also the &quot;cloverleaf&quot; design used on super-highways in the United States.', '', '', 16, '2010-09-15 05:17:08', '2010-10-01 03:30:00', 16, 16),
(4973, 1, 703, 'Think of &lt;b&gt;creating&lt;/b&gt; as making something out of nothing.  Then recall how the &lt;i&gt;way&lt;/i&gt; of &lt;i&gt;revelation&lt;/i&gt; laid out in the Bible begins with a story of how God &lt;b&gt;created&lt;/b&gt; the world out of a dark and chaotic nothingness.', '', '', 16, '2010-09-15 05:16:44', '2010-10-01 03:30:00', 16, 16),
(4974, 1, 703, 'To &lt;b&gt;urge&lt;/b&gt; someone to do something, you make the &lt;i&gt;way&lt;/i&gt; as appealing as possible, perhaps even &lt;i&gt;white&lt;/i&gt;washing it a litte bit.', '', '', 16, '2010-09-15 05:18:35', '2010-10-01 03:30:00', 16, 16),
(4975, 1, 703, 'When &lt;b&gt;escaping&lt;/b&gt; from something or someone, one always feels as if one is not going fast enough, like a &lt;i&gt;turtle&lt;/i&gt; on an express&lt;i&gt;way&lt;/i&gt;.', '', '', 16, '2010-09-15 05:16:56', '2010-10-01 03:30:00', 16, 16),
(4976, 1, 703, 'To keep the &lt;b&gt;environs&lt;/b&gt; clean and safe, you could cement &lt;i&gt;daggers&lt;/i&gt; in the &lt;i&gt;road&lt;/i&gt;, blade up, so that no polluting traffic could pass by.  You could, if you were an ecologically minded terrorist.', '', '', 16, '2010-09-15 05:17:45', '2010-10-01 03:30:00', 16, 16),
(4977, 1, 703, 'A virtual &lt;i&gt;deluge&lt;/i&gt; of motorcycles police washing down a &lt;i&gt;road&lt;/i&gt; is this kanji&#039;s image for a &lt;b&gt;patrol&lt;/b&gt;.', '', '', 16, '2010-09-15 05:17:35', '2010-10-01 03:30:00', 16, 16),
(4978, 1, 703, 'You may keep a whole range of connotations for this keyword, &lt;b&gt;car&lt;/b&gt;, provided it doesn&#039;t interfere with the pictograph.  There is an axel for the front wheels, a carriage below, and axel for the back wheels, and finally, the exhaust, leading from the engine in the front, to the tail at the back.', '', '', 16, '2010-09-15 05:19:26', '2010-10-01 03:30:00', 16, 16),
(4979, 1, 703, 'What you are meant to &lt;b&gt;take along&lt;/b&gt; in this kanji are not things, but people.  The image of the &lt;i&gt;car&lt;/i&gt; on the &lt;i&gt;road&lt;/i&gt; should ground your image for picking up your friends to &lt;i&gt;take&lt;/i&gt; them &lt;i&gt;along&lt;/i&gt; to a party.', '', '', 16, '2010-09-15 05:18:07', '2010-10-01 03:30:00', 16, 16),
(4980, 1, 703, 'Combine the primary and secondary meanings of this key word to form your story.  Begin with the &lt;i&gt;car&lt;/i&gt; whose tires get caught in a &lt;b&gt;rut&lt;/b&gt;, requiring a whole &lt;i&gt;baseball team&lt;/i&gt; to push the car out.', '', '', 16, '2010-09-15 05:18:17', '2010-10-01 03:30:00', 16, 16),
(4981, 1, 703, 'On the left we see a &lt;i&gt;vehicle&lt;/i&gt; used for &lt;b&gt;transport&lt;/b&gt;.  On the right, we see a new tangle of element.  The first three strokes, is the primitive for &lt;i&gt;meeting&lt;/i&gt;.  Below it we see the elements for &lt;i&gt;flesh&lt;/i&gt; and &lt;i&gt;saber&lt;/i&gt;, which combine to create a compound element for a &lt;i&gt;butcher&lt;/i&gt;.  Imagine a &lt;i&gt;vehicle&lt;/i&gt; used for &lt;b&gt;transporting&lt;/b&gt; &lt;i&gt;butchers&lt;/i&gt; to &lt;i&gt;meetings&lt;/i&gt;.', '', '', 16, '2010-09-17 05:10:33', '2010-10-03 03:30:00', 16, 16),
(4982, 1, 703, 'Picture a &lt;i&gt;butcher&lt;/i&gt; hacking away at the meat on a sheep&#039;s head.  Do you see the &lt;i&gt;horns&lt;/i&gt; &lt;b&gt;in front&lt;/b&gt; of him?', '', '', 16, '2010-09-17 05:09:02', '2010-10-03 03:30:00', 16, 16),
(4983, 1, 703, 'The kanji here comprises of &lt;i&gt;walking legs&lt;/i&gt; with a &lt;i&gt;mouth&lt;/i&gt; underneath.  The keyword is &lt;b&gt;each&lt;/b&gt;, so we need only think of a walking-race, where &lt;b&gt;each&lt;/b&gt; walker has his own vocal supporter, shown here as &lt;i&gt;mouth&lt;/i&gt;, cheering &lt;b&gt;each&lt;/b&gt; one of them on.', '', '', 16, '2010-09-17 05:09:55', '2010-10-03 03:30:00', 16, 16),
(4984, 1, 703, 'Imagine a special type of expensive &lt;i&gt;tree&lt;/i&gt;.  So expensive, in fact, that owning one has become a &lt;b&gt;status&lt;/b&gt; symbol, with people wanting their own &lt;i&gt;tree each&lt;/i&gt;.', '', '', 16, '2010-09-17 05:11:18', '2010-10-03 03:30:00', 16, 16),
(4985, 1, 703, '&lt;i&gt;Each field&lt;/i&gt; has its own &lt;b&gt;abbreviations&lt;/b&gt; (chemistry, philosphy, sports, etc).', '', '', 15, '2010-09-24 19:40:50', '2010-10-09 03:30:00', 26, 23),
(4986, 1, 703, 'When you are a &lt;b&gt;guest&lt;/b&gt; in a courteous town, &lt;i&gt;each house&lt;/i&gt;hold has its own way of welcoming you, and &lt;i&gt;each house&lt;/i&gt; becomes your home.', '', '', 16, '2010-09-17 05:08:49', '2010-10-03 03:30:00', 16, 16),
(4987, 1, 703, 'As Miss Manners will be the first to tell you, out of respect, one does not look straight in the eyes of one&#039;s &lt;i&gt;guest&lt;/i&gt;, but focuses on the part of the &lt;i&gt;head&lt;/i&gt; above their eyes: the &lt;b&gt;forehead&lt;/b&gt;.', '', '', 16, '2010-09-17 05:09:17', '2010-10-03 03:30:00', 16, 16),
(4988, 1, 703, 'In the &lt;b&gt;summer&lt;/b&gt;, fatigued by the heat, your &lt;i&gt;head&lt;/i&gt; hangs down nearly as far as your &lt;i&gt;walking legs&lt;/i&gt;, or rather, your dragging legs!', '', '', 16, '2010-09-17 05:09:39', '2010-10-03 03:30:00', 16, 16),
(4989, 1, 703, 'Both the stretching out of the &lt;i&gt;walking legs&lt;/i&gt; and the little bit of &lt;i&gt;wind&lt;/i&gt; tucked in on the right suggest using one&#039;s legs to kick something out of the way, in order to &lt;b&gt;dispose&lt;/b&gt; of it.', '', '', 16, '2010-09-17 05:10:52', '2010-10-03 03:30:00', 16, 16),
(4990, 1, 703, 'Geppetto made &lt;i&gt;walking legs&lt;/i&gt; for his little Pinocchio from two &lt;b&gt;twigs&lt;/b&gt; of a &lt;i&gt;tree&lt;/i&gt;, giving him a set of &lt;b&gt;twiggy&lt;/b&gt; shanks.', '', '', 16, '2010-09-19 08:39:07', '2010-10-05 03:30:00', 19, 18),
(4991, 1, 703, 'When &lt;i&gt;water&lt;/i&gt; &lt;b&gt;falls&lt;/b&gt;, it splashes and splashes; when &lt;i&gt;flower&lt;/i&gt; petals &lt;b&gt;fall&lt;/b&gt;, they float gently in the breeze.  For &lt;i&gt;each&lt;/i&gt; has its own way of &lt;b&gt;falling&lt;/b&gt;.', '', '', 16, '2010-09-17 05:11:03', '2010-10-03 03:30:00', 16, 16),
(4992, 1, 704, 'Picture a &lt;i&gt;weather vane&lt;/i&gt; beneath a regal &lt;i&gt;crown&lt;/i&gt;, spinning around and around.  It is not only &lt;b&gt;superfluous&lt;/b&gt;, but makes a perfect ass out of the one who wears it.', '', '', 16, '2010-09-17 05:14:32', '2010-10-03 03:30:00', 16, 16),
(4993, 1, 704, 'The &lt;i&gt;crowned vehicle&lt;/i&gt; depicted here is a &quot;chariot&quot;, symbol of an &lt;b&gt;army&lt;/b&gt;.', '', '', 16, '2010-09-17 05:13:05', '2010-10-03 03:30:00', 16, 16),
(4994, 1, 704, 'Take advantage of the first sullable of the keyword &lt;b&gt;radiance&lt;/b&gt; to thin of the &lt;i&gt;ray&lt;/i&gt; of light to the left.  Now add the glittering &lt;i&gt;chariot&lt;/i&gt; that is emitting those rays, and you have &lt;b&gt;radiance&lt;/b&gt;.', '', '', 13, '2010-09-20 05:17:16', '2010-10-03 03:30:00', 23, 22),
(4995, 1, 704, 'A row of &quot;sweet&quot; &lt;i&gt;chariots&lt;/i&gt; &quot;swinging low&quot; to our &lt;i&gt;roads&lt;i&gt; is a sure sign that the Lord is &quot;commin&#039; for to &lt;b&gt;carry&lt;/b&gt;&quot; anyone home.', '', '', 16, '2010-09-17 05:14:18', '2010-10-03 03:30:00', 16, 16),
(4996, 1, 704, 'By having the &lt;b&gt;crown&lt;/b&gt; pass from one age to the next, a people keeps itself &lt;i&gt;glued&lt;/i&gt; to its &lt;i&gt;beginnings&lt;/i&gt;.', '', '', 16, '2010-09-18 09:45:35', '2010-10-04 03:30:00', 18, 17),
(4997, 1, 704, 'To have a &lt;b&gt;dream&lt;/b&gt; after going to bed is really the &lt;i&gt;crown&lt;/i&gt; of a perfect &lt;i&gt;evening&lt;/i&gt; .  The &lt;i&gt;flower&lt;/i&gt; petals over the &lt;i&gt;eyes&lt;/i&gt; only confirms the image of a pleasant &lt;b&gt;dream&lt;/b&gt;, conveyed by this kanji.', '', '', 16, '2010-09-17 05:13:37', '2010-10-03 03:30:00', 16, 16),
(4998, 1, 704, 'A &lt;i&gt;whirlwind&lt;/i&gt; begins to dig its way into the &lt;i&gt;soil&lt;/i&gt; like a drill until it makes a deep &lt;b&gt;pit&lt;/b&gt;.', '', '', 15, '2010-09-13 20:22:09', '2010-09-28 03:30:00', 22, 20),
(4999, 1, 704, 'Recalling an image from earlier, we see the &lt;i&gt;mouth&lt;/i&gt; under the extraterrestrial&#039;s glass &lt;i&gt;hood&lt;/i&gt;, and then the &lt;i&gt;mouth&lt;/i&gt; under the &lt;i&gt;top hat&lt;/i&gt; of one of his mates who has tried on a strange earthling&#039;s head-gear, only to find out that it makes him look much, much, &lt;b&gt;taller&lt;/b&gt; than everyone else.', '', '', 16, '2010-09-17 05:12:09', '2010-10-03 03:30:00', 16, 16),
(5000, 1, 704, '&lt;i&gt;Tall chidren&lt;/i&gt; &lt;b&gt;receive&lt;/b&gt; more attention.', '', '', 16, '2010-09-17 05:12:50', '2010-10-03 03:30:00', 16, 16),
(5001, 1, 704, '&lt;b&gt;Cram schools&lt;/b&gt; are after-hours educational institutions where kids can do concentrated preparing for their coming entrance exams or drill what they missed during regular class hours.  The exceptions are the &lt;i&gt;tall children&lt;/i&gt;, who are out on the school &lt;i&gt;gounds&lt;/i&gt;, practicing sports, and the &lt;i&gt;fat&lt;/i&gt; ones, who are also out on the &lt;i&gt;grounds&lt;/i&gt; to burn calories.  So this character depicts those who don&#039;t go to &lt;b&gt;cram school&lt;/b&gt;, rather than the other way round.', '', '', 16, '2010-09-17 05:11:58', '2010-10-03 03:30:00', 16, 16),
(5002, 1, 704, 'The &lt;i&gt;tall children&lt;/i&gt; and the &lt;i&gt;fat&lt;/i&gt; ones too are here cast into a cauldron over an &lt;i&gt;oven flame&lt;/i&gt; until they have sufficiently &lt;b&gt;mellowed&lt;/b&gt; that they can return to the normal life of a student.', '', '', 16, '2010-09-17 05:14:06', '2010-10-03 03:30:00', 16, 16),
(5003, 1, 704, 'Think of all the &lt;b&gt;pavillions&lt;/b&gt; at county fairs or world expos you have wandered into or seen advertised in the media, and you will no doubt see rising up among them the towering &lt;i&gt;tall crowned nail&lt;/i&gt; (the crown being a revolving restaurant).  For some reason, this is a staple of science and modernity.', '', '', 16, '2010-09-18 09:46:11', '2010-10-04 03:30:00', 18, 17),
(5004, 1, 707, 'New Question', 'New Answer', '', 0, '2010-05-20 20:23:57', '2010-05-20 20:23:57', 0, 0),
(5005, 1, 707, 'New Question', 'New Answer', '', 0, '2010-05-20 20:24:07', '2010-05-20 20:24:07', 0, 0),
(5006, 1, 708, 'New Question', 'New Answer', '', 0, '2010-05-20 20:24:15', '2010-05-20 20:24:15', 0, 0),
(5007, 1, 713, 'New Question', 'New Answer', '', 0, '2010-05-20 21:02:56', '2010-05-20 21:02:56', 0, 0),
(5008, 1, 713, 'New Question 2', 'New Answer 2', '', 0, '2010-05-20 21:04:14', '2010-05-20 21:04:14', 0, 0),
(5009, 1, 713, 'New Question 3', 'New Answer 3', '', 0, '2010-05-20 21:13:01', '2010-05-20 21:13:01', 0, 0),
(5010, 1, 713, 'New Question 4', 'New Answer 4', '', 1, '2010-05-20 21:28:50', '2010-05-21 03:30:00', 1, 1),
