(5015, 1, 713, 'New Question 8', 'New Answer 8', '', 1, '2010-05-20 21:29:53', '2010-05-21 03:30:00', 1, 1),
(5016, 1, 715, 'I New Question', 'I New Answer', '', 0, '2010-05-20 21:38:23', '2010-05-20 21:38:23', 0, 0),
(5017, 1, 716, 'II New Question', 'II New Answer', '', 0, '2010-05-20 21:38:38', '2010-05-20 21:38:38', 0, 0),
(5018, 1, 714, 'III New Question', 'III New Answer', '', 0, '2010-05-20 21:39:01', '2010-05-20 21:39:01', 0, 0),
(5019, 1, 704, 'Think of some &lt;i&gt;tall&lt;/i&gt;, domed &lt;b&gt;capital&lt;/b&gt; building with swarms of &lt;i&gt;little&lt;/i&gt; folg gathered around its base, demonstrating for their government&#039;s attention.', '', '', 16, '2010-09-18 09:46:01', '2010-10-04 03:30:00', 16, 16),
(5020, 1, 704, 'Since few things are as &lt;b&gt;refreshing&lt;/b&gt; on a warm day as the splash of cool &lt;i&gt;water&lt;/i&gt;, here we see a &lt;i&gt;capital&lt;/i&gt; building cooling down with a huge tidal-wave of &lt;i&gt;water&lt;/i&gt;, as high as the building itself.', '', '', 16, '2010-09-18 09:45:53', '2010-10-04 03:30:00', 16, 16),
(5021, 1, 704, '&lt;b&gt;Scenery&lt;/b&gt; is depicted as a &lt;i&gt;sun&lt;/i&gt; rising over a &lt;i&gt;capital&lt;/i&gt;, which is as close as some city dwellers get to natural &lt;b&gt;scenery&lt;/b&gt; for years at a time!', '', '', 16, '2010-09-18 09:46:30', '2010-10-04 03:30:00', 16, 16),
(5022, 1, 704, 'The &lt;b&gt;whale&lt;/b&gt; swallows a whole school of &lt;i&gt;fish&lt;/i&gt;, who turn their new home into a proper little &lt;i&gt;fish capital&lt;/i&gt;.', '', '', 16, '2010-09-21 16:56:07', '2010-10-07 03:30:00', 19, 18),
(5023, 1, 704, 'A &lt;i&gt;lidded crock&lt;/i&gt; with an &lt;i&gt;umbrella&lt;/i&gt; overhead gives us a mixture of the modern and the nostaligc in this design for a &lt;b&gt;cottage&lt;/b&gt;.', '', '', 16, '2010-09-18 09:44:31', '2010-10-04 03:30:00', 16, 16),
(5024, 1, 704, 'Look more closely at your &lt;i&gt;lidded crock&lt;/i&gt; and you will see little ruler marks along its bottom edge.  This is so you can use it to calculate the &lt;b&gt;circumference&lt;/b&gt; of your &lt;i&gt;motorcycle helmet&lt;/i&gt;, in lidded-crock &lt;b&gt;circumferences&lt;/b&gt;.', '', '', 16, '2010-09-18 09:45:15', '2010-10-04 03:30:00', 16, 16),
(5025, 1, 704, 'Picture a circular &lt;i&gt;road&lt;/i&gt; with 7 markers on it, one for each day of the &lt;b&gt;week&lt;/b&gt;.  When you have walked one complete &lt;i&gt;lap&lt;/i&gt; on this &lt;i&gt;road&lt;/i&gt;, you shall have completed one &lt;b&gt;week&lt;/b&gt;.', '', '', 16, '2010-09-18 09:45:25', '2010-10-04 03:30:00', 16, 16),
(5026, 1, 704, 'The shape of this kanji, differing from that for soil by virtue of its shorter final stroke, hints at a broad-shouldererd, slender-waisted warrior standing at attention.  When feudalism collapsed, these warriprs began Japan&#039;s &lt;b&gt;gentlemen&lt;/b&gt;.', '', '', 16, '2010-09-18 09:44:45', '2010-10-04 03:30:00', 16, 16),
(5027, 1, 704, 'Here we have a &lt;i&gt;samurai&lt;/i&gt; standing on a street with an open &lt;i&gt;mouth&lt;/i&gt; which people walk up to and look down deep inside of for &lt;b&gt;good luck&lt;/b&gt;.', '', '', 16, '2010-09-18 09:46:19', '2010-10-04 03:30:00', 16, 16),
(5028, 1, 704, '&lt;b&gt;Robust&lt;/b&gt; is seen as a &lt;i&gt;turtle&lt;/i&gt; turned &lt;i&gt;samurai&lt;/i&gt;.', '', '', 16, '2010-09-18 09:44:39', '2010-10-04 03:30:00', 16, 16),
(5029, 1, 704, 'The &lt;b&gt;villa&lt;/b&gt; pictured here is filled with exotic &lt;i&gt;flowers&lt;/i&gt; at every turn, and has a pair of &lt;i&gt;turtle-samurai&lt;/i&gt; standing before its gates.', '', '', 16, '2010-09-18 09:45:04', '2010-10-04 03:30:00', 16, 16),
(5030, 1, 704, 'A &lt;i&gt;samurai&lt;/i&gt;, out of a job, is going door-to-door, &lt;b&gt;selling&lt;/b&gt; little windup &lt;i&gt;crowns&lt;/i&gt; with &lt;i&gt;human legs&lt;/i&gt; attached, that run around on the floor, looking like headless French monarchs.', '', '', 16, '2010-09-18 09:44:55', '2010-10-04 03:30:00', 16, 16),
(5031, 1, 717, 'The &lt;i&gt;child&lt;/i&gt; in the little red &lt;i&gt;schoolhouse&lt;/i&gt; is there for one reason only: to &lt;b&gt;study&lt;/b&gt;.  Anyone who has gone through the schooling system knows well enough that &lt;b&gt;study&lt;/b&gt; is one thing, and learning another.', '', '', 16, '2010-09-19 08:42:19', '2010-10-05 03:30:00', 16, 16),
(5032, 1, 717, 'The idea of &lt;b&gt;memorising&lt;/b&gt; things is easily related to the &lt;i&gt;schoolhouse&lt;/i&gt;; and since we have been at it for more than a hundred pages, the idea that &lt;b&gt;memorising&lt;/b&gt; involves &lt;i&gt;seeing&lt;/i&gt; things which aren&#039;t really there should make it easy to put the two elements together.', '', '', 16, '2010-09-19 08:46:14', '2010-10-05 03:30:00', 16, 16),
(5033, 1, 717, 'The botanical connotations of the word &lt;b&gt;flourish&lt;/b&gt; (to bud and burst into bloom, much as a &lt;i&gt;tree&lt;/i&gt; does) are part of the ideal of the &lt;i&gt;schoolhouse&lt;/i&gt; as well.', '', '', 16, '2010-09-19 08:43:40', '2010-10-05 03:30:00', 17, 16),
(5034, 1, 717, 'The sage talks rapidly with his &lt;i&gt;tongue wagging in his mouth&lt;/i&gt; while the &lt;i&gt;brush&lt;/i&gt; of the sribe runs apace to &lt;b&gt;write&lt;/b&gt; down the master&#039;s words.', '', '', 16, '2010-09-19 08:42:39', '2010-10-05 03:30:00', 16, 16),
(5035, 1, 717, 'Seeing the tiny boats of poor mortals tossed about in a stormy sea like so many corks, the All-Merciful tookits &lt;i&gt;brush&lt;/i&gt; and drew little inlets of &lt;i&gt;water&lt;/i&gt; where the hapless creatures might seek shelter.  And so it is that we have &lt;b&gt;havens&lt;/b&gt;.', '', '', 16, '2010-09-19 08:40:02', '2010-10-05 03:30:00', 16, 16),
(5036, 1, 717, 'When it is time to &lt;b&gt;breed&lt;/b&gt; new cattle, the bull is usually willing but the &lt;i&gt;cow&lt;/i&gt; is not.  Thus the &lt;i&gt;taskmaster&lt;/i&gt; to the right forces the &lt;i&gt;cow&lt;/i&gt; into a compromising position, so to speak, so that she and her mate can &lt;b&gt;breed&lt;/b&gt;.', '', '', 16, '2010-09-19 08:40:19', '2010-10-05 03:30:00', 16, 16),
(5037, 1, 717, 'The special &lt;i&gt;craft&lt;/i&gt; of successful &lt;i&gt;taskmasters&lt;/i&gt; is their ability to remain constantly on the &lt;b&gt;aggressive&lt;/b&gt;, never allowing their underlings a moment to ponder a counter-&lt;b&gt;aggression&lt;/b&gt;.', '', '', 16, '2010-09-19 08:41:09', '2010-10-05 03:30:00', 16, 16),
(5038, 1, 717, 'The &lt;i&gt;taskmaster&lt;/i&gt; is acknowledgin the &lt;b&gt;failure&lt;/b&gt; of a &lt;i&gt;clam&lt;/i&gt; to make the grade in some marine school or other.', '', '', 16, '2010-09-19 08:40:54', '2010-10-05 03:30:00', 16, 16),
(5039, 1, 717, 'English counts thin, flat objects, like bed linen and paper, in &lt;b&gt;sheets&lt;/b&gt;.  The kanji does this with a &lt;i&gt;taskmaster&lt;/i&gt; whipping a &lt;i&gt;tree&lt;/i&gt; into producing &lt;b&gt;sheets&lt;/b&gt; against its will.', '', '', 16, '2010-09-19 08:42:02', '2010-10-05 03:30:00', 16, 16),
(5040, 1, 717, 'Call it fate or providence or plain old Lady Luck, &lt;b&gt;happenstance&lt;/b&gt; is the &lt;i&gt;oldest taskmaster&lt;/i&gt; we know.  It nearly always has its way.', '', '', 16, '2010-09-19 08:45:23', '2010-10-05 03:30:00', 16, 16),
(5041, 1, 717, 'Standing in &lt;b&gt;awe&lt;/b&gt; of someone, you get self-conscious and may try to speak in &lt;i&gt;flowery phrases&lt;/i&gt; out of veneration or fear.  The &lt;i&gt;taskmaster&lt;/i&gt; at the right is drilling you in the practice of your &quot;honorifics&quot;.', '', '', 16, '2010-09-19 08:45:41', '2010-10-05 03:30:00', 16, 16),
(5042, 1, 717, 'Of all the things we can do with our &lt;i&gt;mouth&lt;/i&gt;, speech requires the greatest distinctness and clarity.  Hence the kanji for &lt;b&gt;say&lt;/b&gt; has four little sound-waves, to show the complexity of the task.', '', '', 16, '2010-09-19 08:45:13', '2010-10-05 03:30:00', 16, 16),
(5043, 1, 717, 'The idea of being &lt;b&gt;admonished&lt;/b&gt; for something already sets up a superior-inferior relationship between you and the person you are supposed to stand in &lt;i&gt;awe&lt;/i&gt; of.  while you are restricted to answering in honorifics, the superior can use straightforward and ordinary &lt;i&gt;words&lt;/i&gt;.', '', '', 16, '2010-09-21 17:00:04', '2010-10-07 03:30:00', 18, 17),
(5044, 1, 717, '&lt;i&gt;Words&lt;/i&gt; and a meter&#039;s &lt;i&gt;needle&lt;/i&gt; combine to form the sense of &lt;b&gt;plot&lt;/b&gt;: to talk over plans and to calculate a course of action.', '', '', 16, '2010-09-19 08:45:54', '2010-10-05 03:30:00', 16, 16),
(5045, 1, 717, 'Although we did not make note of it at the time, the kanji for &lt;i&gt;dog&lt;/i&gt; is also a low-grade term for a spy.  And later we will meet another association of criminals with dogs.  The &lt;b&gt;prison&lt;/b&gt; here depicts a &lt;i&gt;pack of wild dogs&lt;/i&gt; (the long-timers and hardened criminals) into which the poor little &lt;i&gt;chihuahua&lt;/i&gt; (first offender) has been cast.  The only thing he has to protect himself against the pack are his shrill and frightened &lt;i&gt;words&lt;/i&gt;.', '', '', 16, '2010-09-19 08:41:51', '2010-10-05 03:30:00', 16, 16),
