(5068, 1, 747, 'New Question', 'New Answer', '', 1, '2010-05-23 13:55:56', '2010-05-24 03:30:00', 1, 1),
(5069, 1, 717, '&lt;b&gt;Revise&lt;/b&gt; japanese &lt;i&gt;words&lt;/i&gt; in order to get them &lt;i&gt;nailed&lt;/i&gt; down.', '', '', 16, '2010-09-21 16:58:50', '2010-10-07 03:30:00', 16, 16),
(5070, 1, 717, '&lt;i&gt;Words&lt;/i&gt; spoken to &lt;b&gt;chastise&lt;/b&gt; us stick to us like &lt;i&gt;glue&lt;/i&gt; in a way no other &lt;i&gt;words&lt;/i&gt; can.', '', '', 16, '2010-09-21 16:58:09', '2010-10-07 03:30:00', 16, 16),
(5071, 1, 717, 'The personalism connoted by the word &lt;b&gt;instruction&lt;/b&gt; as opposed to &quot;teaching&quot; or &quot;discipline&quot; suit the picture here of &lt;i&gt;words&lt;/i&gt; guiding one&#039;s progress like the gentle flowing of a &lt;i&gt;stream&lt;/i&gt;.', '', '', 16, '2010-09-21 16:57:09', '2010-10-07 03:30:00', 16, 16),
(5072, 1, 717, 'The &lt;b&gt;imperial edict&lt;/i&gt;, spoken with the fore of unquestionable law, is made up of &lt;i&gt;words&lt;/i&gt; intended to &lt;i&gt;seduce&lt;/i&gt; the masses - be it through fear or respect - to follow obediently.', '', '', 16, '2010-09-21 16:57:59', '2010-10-07 03:30:00', 16, 16),
(5073, 1, 717, 'A piece of writing that is pregnant with meaning and needs to be reread several times to be understood we refer to colloquially as &quot;&lt;b&gt;packed&lt;/b&gt;&quot;.  The character sees the &lt;i&gt;words&lt;/i&gt; as sealed tightly inside an &lt;i&gt;aerosol can&lt;/i&gt;.', '', '', 16, '2010-09-21 16:58:23', '2010-10-07 03:30:00', 16, 16),
(5074, 1, 717, 'That the &lt;i&gt;words&lt;/i&gt; of the &lt;i&gt;tongue&lt;/i&gt; come to mean a &lt;b&gt;tale&lt;/b&gt; is clear the the etymology: a &lt;b&gt;tale&lt;/b&gt; is somethign &quot;talked&quot;, not something read from a book.', '', '', 16, '2010-09-21 16:59:23', '2010-10-07 03:30:00', 16, 16),
(5075, 1, 717, 'Listening to the &lt;i&gt;words&lt;/i&gt; of poets &lt;b&gt;reciting&lt;/b&gt; their poetry is like being transported for a moment into &lt;i&gt;eternity&lt;/i&gt; where the rules of everyday life have been suspended.', '', '', 16, '2010-09-21 16:59:10', '2010-10-07 03:30:00', 16, 16),
(5076, 1, 717, 'Since silence is treasured so highly at a &lt;i&gt;Buddhist temple&lt;/i&gt; the &lt;i&gt;words&lt;/i&gt; spoken there must be well-chosen.  Perhaps this is why the records of the monks often read to us like &lt;b&gt;poems&lt;/b&gt;.', '', '', 16, '2010-09-21 16:59:33', '2010-10-07 03:30:00', 16, 16),
(5077, 1, 717, 'Whereas the character for &lt;i&gt;say&lt;/i&gt; focused on the actual talking, the kanji for &lt;b&gt;words&lt;/b&gt; stressed the fact that although it is &lt;i&gt;I&lt;/i&gt; who say them, the &lt;b&gt;words&lt;/b&gt; of a language are not my own.  You can see the clear distinction between &lt;i&gt;I&lt;/i&gt; and &lt;i&gt;words&lt;/i&gt; just by looking at it!', '', '', 16, '2010-09-21 16:57:21', '2010-10-07 03:30:00', 16, 16),
(5078, 1, 717, 'In the age of advertising, most &lt;i&gt;words&lt;/i&gt; we &lt;b&gt;read&lt;/b&gt; are out to &lt;i&gt;sell&lt;/i&gt; some product or point of view.', '', '', 16, '2010-09-21 16:56:54', '2010-10-07 03:30:00', 16, 16),
(5079, 1, 717, 'A complete &lt;b&gt;tune&lt;/b&gt; is composed not only of a succession of notes, but also of one &lt;i&gt;lap&lt;/i&gt; of the &lt;i&gt;words&lt;/i&gt; that go with it.  Several, in the case of a chorus.', '', '', 16, '2010-09-21 17:00:20', '2010-10-07 03:30:00', 16, 16),
(5080, 1, 717, 'In almost every attempt to &lt;b&gt;discuss&lt;/b&gt; an issue, the fervor of one&#039;s convictions comes to the surface and creates an &lt;i&gt;inflammation&lt;/i&gt; of &lt;i&gt;words&lt;/i&gt; (the &#039;cuss&#039; in &lt;b&gt;discuss&lt;/b&gt;).', '', '', 16, '2010-09-21 16:58:32', '2010-10-07 03:30:00', 16, 16),
(5081, 1, 717, 'The &lt;i&gt;words&lt;/i&gt; of the &lt;i&gt;young&lt;/i&gt; do not have enough legal validity unless backed by parental &lt;b&gt;consent&lt;/b&gt;.', '', '', 16, '2010-09-21 16:57:48', '2010-10-07 03:30:00', 16, 16),
(5082, 1, 717, 'The stern tone of a &lt;b&gt;rebuke&lt;/b&gt; is seen here in the image of &lt;i&gt;words&lt;/i&gt; spoken at a &lt;i&gt;meeting&lt;/i&gt; of &lt;i&gt;butchers&lt;/i&gt;, waving their choppers at one another and &quot;cutting one another down&quot; as only &lt;i&gt;butchers&lt;/i&gt; can.', '', '', 16, '2010-09-21 16:56:41', '2010-10-07 03:30:00', 16, 16),
(5083, 1, 748, 'Take &lt;b&gt;style&lt;/b&gt; in its sense of some fashion design or model.  Then let the element &lt;i&gt;arrow&lt;/i&gt; and &lt;i&gt;craft&lt;/i&gt; stand for the well-known &lt;b&gt;style&lt;/b&gt; of shirts known as &quot;&lt;i&gt;Arrow&lt;/i&gt; shirts&quot; because of the little &lt;i&gt;arrow&lt;/i&gt; sewn onto each one.', '', '', 13, '2010-09-24 19:41:56', '2010-10-07 03:30:00', 23, 22),
(5084, 1, 748, 'When a manufacturer produces a new &lt;i&gt;style&lt;/i&gt; for he market, the first thing that is done it to run a &lt;b&gt;test&lt;/b&gt; on consumers, asking them to &lt;i&gt;speak&lt;/i&gt; frankly about the porduct.', '', '', 16, '2010-09-21 17:04:39', '2010-10-07 03:30:00', 16, 16),
(5085, 1, 748, 'We use the Roman numeral &lt;b&gt;II&lt;/b&gt; here to stress that this kanji is an older from of the kanji for &lt;i&gt;two&lt;/i&gt;.  Think of &lt;i&gt;two&lt;/i&gt; arrows in a &lt;i&gt;quiver&lt;/i&gt;.', '', '', 16, '2010-09-21 17:04:19', '2010-10-07 03:30:00', 16, 16),
(5086, 1, 748, 'From its original meaning of a defined a area or zone, a &lt;b&gt;range&lt;/b&gt; has also come to mean a grazing &lt;i&gt;land&lt;/i&gt; where cowboys roam and do whatever it is they do with cows.  When the herds have all been driven to market, there is a great homecoming &lt;i&gt;fiesta&lt;/i&gt; like that pictured here.  As soon as the cowboys come home, home on the &lt;b&gt;range&lt;/b&gt;, the first thing they do is kiss the ground (&lt;i&gt;mouth&lt;/i&gt; on the &lt;i&gt;floor&lt;/i&gt;), and get a mouth full of &lt;i&gt;dirt&lt;/i&gt;, before going on with the &lt;i&gt;fiesta&lt;/i&gt;!', '', '', 16, '2010-09-21 17:03:31', '2010-10-07 03:30:00', 16, 16),
(5087, 1, 748, 'From a &lt;b&gt;burglar&#039;s&lt;/b&gt; point of view, a &lt;i&gt;fiest&lt;/i&gt; is an occasion to take out the old lickpicking &lt;i&gt;needle&lt;/i&gt; and break into the unattended safe filled with the family &lt;i&gt;shells&lt;/i&gt;.', '', '', 16, '2010-09-21 17:04:52', '2010-10-07 03:30:00', 16, 16),
(5088, 1, 748, 'On a fruit &lt;b&gt;plantation&lt;/b&gt; it is the &lt;i&gt;trees&lt;/i&gt; that one is particularly grateful for at the time of &lt;i&gt;Thanksgiving&lt;/i&gt;.  Imagine yourself inviting a few representative &lt;i&gt;trees&lt;/i&gt; from the fields and orchards to join you around the table to give thanks.', '', '', 16, '2010-09-21 17:03:57', '2010-10-07 03:30:00', 16, 16),
(5089, 1, 748, 'One &lt;b&gt;loads&lt;/b&gt; bales on a wagon or &lt;i&gt;cart&lt;/i&gt; in preparatio for the great Hay Ride that follows the &lt;i&gt;Thanksgiving&lt;/i&gt; dinner each year.', '', '', 16, '2010-09-21 17:03:20', '2010-10-07 03:30:00', 16, 16),
(5090, 1, 748, 'The sense of the keyword &lt;b&gt;overgrown&lt;/b&gt; is of something growing luxuriously, though not necessarily in excess - in this case, a whole &lt;i&gt;parade&lt;/i&gt; of &lt;i&gt;flowers&lt;/i&gt;.  By way of exception, the &lt;i&gt;flowers&lt;/i&gt; take their normal place over the enclosure.', '', '', 16, '2010-09-21 17:02:53', '2010-10-07 03:30:00', 16, 16),
(5091, 1, 748, 'Let the phrase &quot;&lt;b&gt;turn into&lt;/b&gt;&quot; suggest some sort of magical change.  What happens here is that the &lt;i&gt;parade&lt;/i&gt; marching down main street &lt;b&gt;turns into&lt;/b&gt; a &lt;i&gt;dagger&lt;/i&gt;-throwing bout between competing bands.  Note how only one stroke need be added to make the change.', '', '', 16, '2010-09-21 17:03:46', '2010-10-07 03:30:00', 16, 16),
(5092, 1, 748, 'In this frame we see a &lt;i&gt;mound of dirt&lt;/i&gt; that is being &lt;i&gt;turned into&lt;/i&gt; a castle, just like a sandcastle at the beach, only this time it&#039;s real.', '', '', 16, '2010-09-22 16:48:26', '2010-10-08 03:30:00', 16, 16),
(5093, 1, 748, 'The sure sign of &lt;b&gt;sincerity&lt;/b&gt; is that one&#039;s mere &lt;i&gt;words&lt;/i&gt; are &lt;i&gt;turned into&lt;/i&gt; deeds.', '', '', 16, '2010-09-22 16:53:07', '2010-10-08 03:30:00', 16, 16),
(5094, 1, 748, 'Here we see a &lt;i&gt;march&lt;/i&gt; of &lt;i&gt;women&lt;/i&gt; demonstrating on behalf of equal rights, something extremely &lt;b&gt;intimidating&lt;/b&gt; to the male chauvinist population.', '', '', 16, '2010-09-22 16:53:19', '2010-10-08 03:30:00', 16, 16),
(5095, 1, 748, 'Picture a &lt;i&gt;march&lt;/i&gt; of &lt;i&gt;flames&lt;/i&gt; demonstrating against the Fire Department for their right to &lt;b&gt;destroy&lt;/b&gt;, but being doused with &lt;i&gt;water&lt;/i&gt; by the police riot squads.', '', '', 16, '2010-09-22 16:49:01', '2010-10-08 03:30:00', 16, 16),
(5096, 1, 748, 'A group of unquenchable &lt;i&gt;mouths&lt;/i&gt; sets out on a &lt;i&gt;march&lt;/i&gt; across the country, drinking &lt;i&gt;water&lt;/i&gt; wherever they can find it until the &lt;i&gt;water&lt;/i&gt; supply has &lt;b&gt;dwindled&lt;/b&gt; to a trickle, triggering a national disaster.', '', '', 16, '2010-09-22 16:48:14', '2010-10-08 03:30:00', 16, 16),
(5097, 1, 748, 'Prior to the use of metal, &lt;i&gt;trees&lt;/i&gt; were once cut down and bound together for use as &lt;b&gt;scaffolding&lt;/b&gt; material.  In the case of the kanji shown here, what is being constructed is not a skyscraper by simply a &lt;i&gt;float&lt;/i&gt;.', '', '', 16, '2010-09-22 16:48:47', '2010-10-08 03:30:00', 16, 16),
(5098, 1, 748, 'Those special &lt;i&gt;gold&lt;/i&gt;-coloured tokens minted each year for the Mardi Gras and thrown into the crowds form people on the &lt;i&gt;floats&lt;/i&gt; give us the kanji for &lt;b&gt;coins&lt;/b&gt;.', '', '', 16, '2010-09-22 16:49:20', '2010-10-08 03:30:00', 16, 16),
(5099, 1, 748, 'An entourage of &lt;i&gt;floats&lt;/i&gt; going from one town to the next must always seek a &lt;b&gt;shallow&lt;/b&gt; place to cross the &lt;i&gt;water&lt;/i&gt;.  Try to picture what happens if they don&#039;t.', '', '', 16, '2010-09-22 16:48:37', '2010-10-08 03:30:00', 16, 16),
(5100, 1, 749, 'The character for &lt;b&gt;stop&lt;/b&gt; is easiest to learn as a pictograph, though you have to take a moment to see it.  Take it as a rather crude drawing of a footprint: the first three strokes represent the front of the foor, adn the last the heel.  The big toe (stroke 2, sticking out to the right) on the right indicates that this is a left foot.', '', '', 16, '2010-09-23 05:38:49', '2010-10-09 03:30:00', 16, 16),
(5101, 1, 749, '&lt;i&gt;Footprints&lt;/i&gt; that follow one and other a &lt;i&gt;few&lt;/i&gt; times indicate &lt;b&gt;walking&lt;/b&gt;.', '', '', 16, '2010-09-23 05:40:14', '2010-10-09 03:30:00', 16, 16),
(5102, 1, 749, 'To &lt;b&gt;ford&lt;/b&gt; a body of &lt;i&gt;water&lt;/i&gt; is to &lt;i&gt;walk&lt;/i&gt; across it.', '', '', 16, '2010-09-23 05:38:27', '2010-10-09 03:30:00', 16, 16),
(5103, 1, 749, 'The image of something occurring &lt;b&gt;repeatedly&lt;/b&gt;, over and over again, is of having one&#039;s &lt;i&gt;head walked&lt;/i&gt; one.', '', '', 13, '2010-09-13 20:23:23', '2010-09-26 03:30:00', 24, 22),
(5104, 1, 749, 'Seeing &lt;i&gt;footprints&lt;/i&gt; on someone&#039;s &lt;i&gt;flesh&lt;/i&gt; indicates a rather brutal way of having secured a person&#039;s &lt;b&gt;agreement&lt;/b&gt;.', '', '', 16, '2010-09-23 05:38:39', '2010-10-09 03:30:00', 16, 16),
(5105, 1, 749, 'To &lt;b&gt;undertake&lt;/b&gt; a project is to take some idea floating in the air and &lt;i&gt;stop&lt;/i&gt; it so that it can be brought down to earth and become reality.  here we see some &lt;b&gt;undertaking&lt;/b&gt; made to &lt;i&gt;stop&lt;/i&gt; under a beach &lt;i&gt;umbrella&lt;/i&gt;.', '', '', 16, '2010-09-23 05:40:00', '2010-10-09 03:30:00', 16, 16),
(5106, 1, 749, 'That same &lt;i&gt;grove of trees&lt;/i&gt; we met earlier shows up here in the character for &lt;b&gt;curriculum&lt;/b&gt; (in the sense of a record of one&#039;s life or academic achievements, the curriculum vitae).  Instead of the &lt;i&gt;grove&lt;/i&gt; making its way slowly through the surface of the &lt;i&gt;cliff&lt;/i&gt; as before, here we see it &lt;i&gt;stopped&lt;/i&gt;, much the same as a &lt;b&gt;curriculum&lt;/b&gt; vitae calls a halt to the alendar and talks only about the past.', '', '', 16, '2010-09-23 05:39:18', '2010-10-09 03:30:00', 16, 16),
(5107, 1, 749, 'With a &lt;i&gt;quiver of arrows&lt;/i&gt; set on one&#039;s back, the goal of a &lt;b&gt;warrior&lt;/b&gt; is not to attack, but to &lt;i&gt;stop&lt;/i&gt; the attack of others: the oldest excuse in history!', '', '', 16, '2010-09-23 05:39:47', '2010-10-09 03:30:00', 16, 16),
(5108, 1, 749, 'A certain portion of &lt;i&gt;shells&lt;/i&gt; is collected by the &lt;i&gt;warrior&lt;/i&gt; from the local villages as he passes through to defray the costs of keeping the land safe, and this is called a &lt;b&gt;levy&lt;/b&gt;.', '', '', 16, '2010-09-23 05:40:30', '2010-10-09 03:30:00', 16, 16),
(5109, 1, 749, '&quot;A journey of a thousand miles begins with a single step&quot;, says the Chinese proverb.  Here we see &lt;i&gt;one footprint&lt;/i&gt;, complementing that proverb with the sound advice that if the first step is not made &lt;b&gt;correctly&lt;/b&gt;, the whole point of the journey will be forfeited.  This is the ideal that teachers are supposed to have in &lt;b&gt;correcting&lt;/b&gt; their student, and parents in &lt;b&gt;correcting&lt;/b&gt; their children.', '', '', 16, '2010-09-23 05:39:00', '2010-10-09 03:30:00', 16, 16),
(5110, 1, 749, '&lt;i&gt;Words&lt;/i&gt; that testify to the &lt;i&gt;correctness&lt;/i&gt; of some fact are classified as &lt;b&gt;evidence&lt;/b&gt;.', '', '', 16, '2010-09-23 05:39:31', '2010-10-09 03:30:00', 16, 16),
(5111, 1, 749, 'To the many definitions for &lt;b&gt;politics&lt;/b&gt; that already exist, this character offers yet another: &lt;i&gt;correct taskmastering&lt;/i&gt;.', '', '', 16, '2010-09-23 05:37:58', '2010-10-09 03:30:00', 16, 16),
(5112, 1, 749, '&lt;b&gt;Determination&lt;/b&gt;, in the sense of settling on a certain course of action, is likened here to &lt;i&gt;mending&lt;/i&gt; one&#039;s &lt;i&gt;house&lt;/i&gt;.', '', '', 16, '2010-09-23 05:38:11', '2010-10-09 03:30:00', 16, 16),
(5113, 1, 749, 'A &lt;i&gt;golden&lt;/i&gt; &lt;b&gt;lock&lt;/b&gt; is tempting to all who are &lt;i&gt;determined&lt;/i&gt; to open it.', '', '', 15, '2010-09-12 18:08:19', '2010-09-27 03:30:00', 18, 17),
(5114, 1, 749, '&lt;b&gt;Running&lt;/b&gt;, we are told here, &lt;i&gt;mends&lt;/i&gt; the &lt;i&gt;soil&lt;/i&gt;.  It&#039;s like giving the soil an intensive massage.', '', '', 15, '2010-09-15 05:20:05', '2010-09-30 03:30:00', 19, 18),
(5115, 1, 749, 'When one is &lt;i&gt;running&lt;/i&gt; after something, the goal that &lt;i&gt;seduces&lt;/i&gt; one is said to &lt;b&gt;transcend&lt;/b&gt; the seeker.', '', '', 16, '2010-09-25 10:57:07', '2010-10-11 03:30:00', 16, 16),
(5116, 1, 749, 'In &lt;b&gt;proceeding&lt;/b&gt; to a new city or new job, something in you &lt;i&gt;runs&lt;/i&gt; ahead with excitement, and something else holds you back, like a &lt;i&gt;divining rod&lt;/i&gt; built into your psyche, warnign you to check things out carefully before rushing in too wildly.', '', '', 16, '2010-09-25 10:55:30', '2010-10-11 03:30:00', 16, 16),
(5117, 1, 749, 'Here we see two &lt;i&gt;parades&lt;/i&gt; in competition, each trying to &lt;b&gt;surpass&lt;/b&gt; the other by &lt;i&gt;running&lt;/i&gt; at high speed from one town to the next.', '', '', 15, '2010-09-15 05:20:17', '2010-09-30 03:30:00', 19, 18),
(5118, 1, 749, 'In this kanji we are shown someone spending an entire &lt;i&gt;day&lt;/i&gt; at &lt;i&gt;mending&lt;/i&gt; one stocking, because they want the job done &quot;&lt;b&gt;just so&lt;/b&gt;&quot;.  Be sure to make a clear image of a finicky old fusspot to make the idea as concrete as possible.', '', '', 16, '2010-09-25 10:56:48', '2010-10-11 03:30:00', 16, 16),
(5119, 1, 749, 'In many kinds of research, one can find information on a given &lt;b&gt;topic&lt;/b&gt; only if the &lt;i&gt;headings&lt;/i&gt; are prepared &lt;i&gt;just so&lt;/i&gt;.', '', '', 15, '2010-09-12 18:08:06', '2010-09-27 03:30:00', 18, 17),
(5120, 1, 749, 'A &lt;b&gt;dike&lt;/b&gt; is a successful bit of engineering only if the amount of &lt;i&gt;earth&lt;/i&gt; piled up is measured &lt;i&gt;just so&lt;/i&gt; for the height and pressure of the water it is meant to contain.', '', '', 15, '2010-09-15 05:20:30', '2010-09-30 03:30:00', 19, 18),
(5121, 1, 749, 'To construct a &lt;b&gt;building&lt;/b&gt;, you first draw a set of plans (the writing &lt;i&gt;brush&lt;/i&gt;), and then &lt;i&gt;s-t-r-e-t-c-h&lt;/i&gt; your drawing out to scale in reality.', '', '', 16, '2010-09-25 10:56:35', '2010-10-11 03:30:00', 16, 16),
(5122, 1, 749, 'This character is a kind of pictographic image of how &lt;b&gt;prolonging&lt;/b&gt; is a clever way of &lt;i&gt;stopping&lt;/i&gt; things by trying to &lt;i&gt;stretch&lt;/i&gt; them out a little bit at a time (the extra &lt;i&gt;drop&lt;/i&gt; at the top of &lt;i&gt;stop&lt;/i&gt;).  Imagine yourself &lt;b&gt;prolonging&lt;/b&gt; something you can really, physically, &lt;i&gt;stretch&lt;/i&gt;.', '', '', 16, '2010-09-25 10:56:19', '2010-10-11 03:30:00', 16, 16),
(5123, 1, 749, 'As the famous poem at the start of St. John&#039;s gospel tells us, the &lt;b&gt;nativity&lt;/b&gt; we celebrate at Christmas had its origins at the very start of time, and governs all of human history: it represents the &lt;i&gt;prolongation&lt;/i&gt; of the eternal &lt;i&gt;Word&lt;/i&gt; in time and space.', '', '', 9, '2010-09-19 08:47:23', '2010-09-28 03:30:00', 22, 21),
(5124, 1, 749, 'This character depicts a &lt;b&gt;cornerstone&lt;/b&gt; as a &lt;i&gt;stone&lt;/i&gt; set at the end of a wildlife preserve: a &lt;i&gt;zoo&lt;/i&gt; in a &lt;i&gt;grove&lt;/i&gt;.', '', '', 11, '2010-09-16 05:17:16', '2010-09-27 03:30:00', 27, 25),
(5125, 1, 749, 'What makes a man a &lt;b&gt;bridegroom&lt;/b&gt; is obviously a &lt;i&gt;woman&lt;/i&gt; and her dowry, here presented as a small &lt;i&gt;zoo&lt;/i&gt;, and a &lt;i&gt;month&lt;/i&gt; away from it all, being on their honey&lt;i&gt;moon&lt;/i&gt;.', '', '', 16, '2010-09-25 10:57:23', '2010-10-11 03:30:00', 16, 16),
(5126, 1, 750, 'At the top we see the &lt;i&gt;top hat&lt;/i&gt;, and at the bottom, a pictographic representation of the folds of a &lt;b&gt;garment&lt;/b&gt;.  If you break the &quot;4-fold&quot; into two sets of two strokes, you will find it easier to remember.', '', '', 16, '2010-09-25 10:59:02', '2010-10-11 03:30:00', 16, 16),
(5127, 1, 750, 'You might think here of &lt;i&gt;garments&lt;/i&gt; that have been specially &lt;b&gt;tailored&lt;/b&gt; for &lt;i&gt;Thanksgiving&lt;/i&gt; celebrations to look like traditional Pilgrim garb.', '', '', 16, '2010-09-25 10:59:21', '2010-10-11 03:30:00', 16, 16),
(5128, 1, 750, 'The character &lt;b&gt;attire&lt;/b&gt; can be remembered as a picture of what we may call a &quot;&lt;i&gt;turtle-samurai&lt;/i&gt;&quot; sweater.  At the top, we see the &lt;i&gt;turtle-samurai&lt;/i&gt;, and at the bottom the element for &lt;i&gt;garment&lt;/i&gt;.', '', '', 16, '2010-09-25 10:59:49', '2010-10-11 03:30:00', 16, 16),
(5129, 1, 750, 'An innocent looking &lt;i&gt;top hat and scarf&lt;/i&gt; lying there in front of you, turned over, reveal a hidden &lt;i&gt;computer&lt;/i&gt; sewn into the &lt;b&gt;back&lt;/b&gt; of each - obviously the tool of a master spy.  Such experiences teach one always to have a look at the &lt;b&gt;back&lt;/b&gt; side of things.', '', '', 16, '2010-09-25 11:01:12', '2010-10-11 03:30:00', 16, 16),
(5130, 1, 750, 'The right half of this character shows a &lt;i&gt;garment&lt;/i&gt; woven so fine that it can pass through the &lt;i&gt;eye&lt;/i&gt; of a &lt;i&gt;needle&lt;/i&gt;, fittingly draped around the slithering, ethereal form of a poltergeist.  In this frame, our eerie visitor brushes its robes against a nearby block of apartments and completely &lt;b&gt;demolishes&lt;/b&gt; them, razing them to the &lt;i&gt;ground&lt;/i&gt;.', '', '', 16, '2010-09-25 11:00:11', '2010-10-11 03:30:00', 16, 16),
(5131, 1, 750, 'A drunken sod in a tattered &lt;i&gt;top hat&lt;/i&gt; and soiled silk &lt;i&gt;scarf&lt;/i&gt; with a giant &lt;i&gt;mouth&lt;/i&gt; guzzling somethign or other gives us a &lt;b&gt;pathetic&lt;/b&gt; character role in which W.C. Fields might find himself right at home.', '', '', 16, '2010-09-25 10:58:19', '2010-10-11 03:30:00', 16, 16),
(5132, 1, 750, 'A &lt;b&gt;distant&lt;/b&gt; figure on the &lt;i&gt;road&lt;/i&gt; is such a blur it looks like a &lt;i&gt;lidded crock&lt;/i&gt; wearing a silk &lt;i&gt;scarf&lt;/i&gt;.', '', '', 16, '2010-09-25 10:59:36', '2010-10-11 03:30:00', 16, 16),
(5133, 1, 750, 'This clever little &lt;b&gt;monkey&lt;/b&gt; has captured an entire pack of &lt;i&gt;wild dogs&lt;/i&gt;, locked them inside a &lt;i&gt;lidded crock&lt;/i&gt;, and wrapped the whole thing up in a silk &lt;i&gt;scarf&lt;/i&gt; to present to the dog-catcher.', '', '', 16, '2010-09-25 11:00:25', '2010-10-11 03:30:00', 16, 16),
(5134, 1, 750, 'The primitives here take care of themselves: &lt;i&gt;cloak&lt;/i&gt; and &lt;i&gt;dagger&lt;/i&gt;.  A &lt;b&gt;first-time&lt;/b&gt; murderer uses a &lt;i&gt;cloak&lt;/i&gt; and &lt;i&gt;dagger&lt;/i&gt;.', '', '', 15, '2010-09-12 18:12:13', '2010-09-27 03:30:00', 17, 16),
(5135, 1, 750, 'The maid, &lt;i&gt;towels by her side&lt;/i&gt;, distributes the &lt;b&gt;linen&lt;/b&gt;.', '', '', 16, '2010-09-25 11:01:25', '2010-10-11 03:30:00', 16, 16),
(5136, 1, 750, 'A &lt;b&gt;sail&lt;/b&gt; made of a &lt;i&gt;towel&lt;/i&gt; makes for a &lt;i&gt;mediocre&lt;/i&gt; vessel.', '', '', 16, '2010-09-25 11:01:39', '2010-10-11 03:30:00', 16, 16);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(5137, 1, 750, 'A &lt;i&gt;towel&lt;/i&gt; owned by the &lt;i&gt;wealthiest&lt;/i&gt; tycoon is the world is made into a &lt;b&gt;hanging scroll&lt;/b&gt; after his death and auctioned off to the highest bidder.', '', '', 16, '2010-09-25 11:00:55', '2010-10-11 03:30:00', 16, 16),
(5138, 1, 750, 'Because of the &lt;i&gt;risk&lt;/i&gt; involved, one puts together a makeshift &lt;b&gt;cap&lt;/b&gt; out of a dirty old &lt;i&gt;towel&lt;/i&gt;.', '', '', 16, '2010-09-25 11:00:40', '2010-10-11 03:30:00', 16, 16),
(5139, 1, 750, 'a dirty &lt;i&gt;towel&lt;/i&gt; draped over the entrance to the old &lt;i&gt;graveyard&lt;/i&gt; is painted to look like the &lt;b&gt;curtain&lt;/b&gt; of death that leads to the other world.', '', '', 16, '2010-09-25 10:58:41', '2010-10-11 03:30:00', 16, 16),
(5140, 1, 750, 'A large &lt;i&gt;towel&lt;/i&gt; stretched overhead with only a few of the &lt;i&gt;sun&#039;s rays&lt;/i&gt; breaking through represents a &lt;b&gt;canopy&lt;/b&gt; over one&#039;s bed.', '', '', 10, '2010-09-18 09:48:23', '2010-09-28 03:30:00', 22, 21),
(5141, 1, 750, 'a strip of &lt;i&gt;white towel&lt;/i&gt; and some craps of &lt;i&gt;metal&lt;/i&gt; have the makings of a primitive kind of &lt;b&gt;brocade&lt;/b&gt;.', '', '', 15, '2010-09-12 18:11:43', '2010-09-27 03:30:00', 15, 15),
(5142, 1, 750, 'Dressed in nothing but a bath &lt;i&gt;towel&lt;/i&gt; and &lt;i&gt;top hat&lt;/i&gt;, one sets off to &lt;b&gt;market&lt;/b&gt; in search of a bargain or two.', '', '', 15, '2010-09-12 18:12:22', '2010-09-27 03:30:00', 15, 15),
(5143, 1, 750, 'Of all the &lt;i&gt;women&lt;/i&gt; in the family, it is the &lt;b&gt;elder sister&lt;/b&gt; who has the duty to go to &lt;i&gt;market&lt;/i&gt; to do the shopping.', '', '', 15, '2010-09-12 18:11:00', '2010-09-27 03:30:00', 15, 15),
(5144, 1, 750, 'One is surprised, strolling through the &lt;i&gt;market&lt;/i&gt;, to find among the &lt;i&gt;meats&lt;/i&gt; hung out for sale a slab marked: &lt;b&gt;lungs&lt;/b&gt;.', '', '', 15, '2010-09-12 18:10:52', '2010-09-27 03:30:00', 15, 15),
(5145, 1, 750, 'The part of the &lt;i&gt;apron&lt;/i&gt; where one finds the buckle is on the &lt;b&gt;sash&lt;/b&gt;.', '', '', 15, '2010-09-12 18:10:44', '2010-09-27 03:30:00', 15, 15),
(5146, 1, 750, 'People that have been &lt;i&gt;sashed&lt;/i&gt; to something (whether their mother&#039;s apron strings or a particular job) for too long become like &lt;i&gt;water&lt;/i&gt; that has stopped moving: they start to &lt;b&gt;stagnate&lt;/b&gt;.', '', '', 15, '2010-09-12 18:09:55', '2010-09-27 03:30:00', 15, 15),
(5147, 1, 750, '&lt;b&gt;Thorns&lt;/b&gt; grow on a bush here that has wrapped itself around a &lt;i&gt;tree&lt;/i&gt; like a &lt;i&gt;belt&lt;/i&gt;, cutting into the poor &lt;i&gt;tree&lt;/i&gt; like little &lt;i&gt;sabers&lt;/i&gt;.', '', '', 15, '2010-09-12 18:11:24', '2010-09-27 03:30:00', 15, 15),
(5148, 1, 750, 'This kanji shows a unique &lt;b&gt;system&lt;/b&gt; for leading &lt;i&gt;cows&lt;/i&gt; to the slaughterer&#039;s &lt;i&gt;saber&lt;/i&gt;: one ties a &lt;i&gt;belt&lt;/i&gt; about their waist and fixes that &lt;i&gt;belt&lt;/i&gt; to an overhead cable, pulling the &lt;i&gt;cow&lt;/i&gt; up into the air where it hangs suspended, helpless against the fate that awaits it.', '', '', 15, '2010-09-12 18:10:30', '2010-09-27 03:30:00', 15, 15),
(5149, 1, 750, 'A label indicating that a &lt;i&gt;garment&lt;/i&gt; was &lt;b&gt;made in&lt;/b&gt; USA, or Taiwan, or Japan itself is a symbol for the &lt;i&gt;systemisation&lt;/i&gt; of the &lt;i&gt;garment&lt;/i&gt; industry.', '', '', 15, '2010-09-18 09:48:00', '2010-10-03 03:30:00', 19, 18),
(5150, 1, 750, 'As the wheels of the &lt;i&gt;car&lt;/i&gt; &lt;b&gt;revolve&lt;/b&gt;, they kick up small &lt;i&gt;rising clouds&lt;/i&gt; of dust and debris behind them.', '', '', 15, '2010-09-12 18:12:32', '2010-09-27 03:30:00', 15, 15),
(5151, 1, 750, 'The secret &lt;b&gt;technique&lt;/b&gt; of making a &lt;i&gt;rising cloud&lt;/i&gt; of smoke turn into a bouquet of &lt;i&gt;flowers&lt;/i&gt; is shown here in the kanji for &lt;b&gt;technique&lt;/b&gt;.', '', '', 15, '2010-09-12 18:10:17', '2010-09-27 03:30:00', 15, 15),
(5152, 1, 750, 'This kanji, also a primitive, is one of the clearest instances we have of a complex pictograph.  The top line is the sky, the next 3 strokes a pair of clouds, and the final four dots the &lt;b&gt;rain&lt;/b&gt; collected their, just waiting to fall.', '', '', 15, '2010-09-12 18:11:12', '2010-09-27 03:30:00', 15, 15),
(5153, 1, 750, 'Here is the full character for &lt;b&gt;cloud&lt;/b&gt; from which the primitive for a &lt;i&gt;rising cloud&lt;/i&gt; derives.  &lt;i&gt;Clouds&lt;/i&gt; begin with vapors &lt;i&gt;rising&lt;/i&gt; up in small &lt;i&gt;clouds&lt;/i&gt; from the surface of the earth, and then gathering to make the &lt;b&gt;clouds&lt;/b&gt; that eventually dump their &lt;i&gt;rain&lt;/i&gt; back on the earth.', '', '', 15, '2010-09-18 09:47:50', '2010-10-03 03:30:00', 19, 18),
(5154, 1, 750, 'We refer to days when the &lt;i&gt;sun&lt;/i&gt; is covered by the &lt;i&gt;clouds&lt;/i&gt; as &lt;b&gt;cloudy weather&lt;/b&gt;.', '', '', 10, '2010-09-20 05:18:18', '2010-09-30 03:30:00', 24, 22),
(5155, 1, 750, 'The full rumble and roar and terror of &lt;b&gt;thunder&lt;/b&gt; is best felt not with your head tucked under your pillow safe in bed, but out in an open &lt;i&gt;rice field&lt;/i&gt; where you can get the real feel of the &lt;i&gt;weather&lt;/i&gt;.', '', '', 10, '2010-09-19 08:48:24', '2010-09-29 03:30:00', 22, 21),
(5156, 1, 750, 'Think of &lt;b&gt;frost&lt;/b&gt; as a cooperative venture, an &lt;i&gt;inter&lt;/i&gt;-action of the malevolent force of &lt;i&gt;weather&lt;/i&gt; that sit around a conference table and finally decide to allow a very light amount of moisture to fall just before a short and sudden freeze.', '', '', 10, '2010-09-19 08:48:08', '2010-09-29 03:30:00', 26, 24),
(5157, 1, 750, '&lt;i&gt;Walking legs&lt;/i&gt; slipping on the &lt;i&gt;ice&lt;/i&gt; are a sure sign of &lt;b&gt;winter&lt;/b&gt;.', '', '', 15, '2010-09-13 20:23:53', '2010-09-28 03:30:00', 15, 15),
(5158, 1, 750, 'This character is meant to be a pictograph of a great man, said to represent the Lord of the &lt;b&gt;Heavens&lt;/b&gt;.', '', '', 15, '2010-09-13 20:24:43', '2010-09-28 03:30:00', 15, 15),
(5159, 1, 750, 'The &lt;b&gt;bridge&lt;/b&gt; shown here is made of &lt;i&gt;trees&lt;/i&gt; in their natural form, except that the trunks have been carved into the forms of &lt;i&gt;angels&lt;/i&gt;, a sort of &quot;Ponte degli Angeli&quot;.', '', '', 15, '2010-09-13 20:24:25', '2010-09-28 03:30:00', 15, 15),
(5160, 1, 750, 'Associating a particularly &lt;b&gt;attractive&lt;/b&gt; &lt;i&gt;woman&lt;/i&gt; you know with an &lt;i&gt;angel&lt;/i&gt; should be no problem.', '', '', 15, '2010-09-13 20:24:54', '2010-09-28 03:30:00', 15, 15),
(5161, 1, 750, 'This picture of a vase &lt;b&gt;standing up&lt;/b&gt; has its meaning extended to represent the general posture of anything &lt;b&gt;standing up&lt;/b&gt;.', '', '', 15, '2010-09-13 20:25:16', '2010-09-28 03:30:00', 15, 15),
(5162, 1, 750, 'One &lt;b&gt;cries&lt;/b&gt; and &lt;b&gt;cries&lt;/b&gt; until one is &lt;i&gt;standing up&lt;/i&gt; knee-deep in &lt;i&gt;water&lt;/i&gt;.', '', '', 15, '2010-09-13 20:24:13', '2010-09-28 03:30:00', 15, 15),
(5163, 1, 750, 'Try to imagine a club &lt;b&gt;badge&lt;/b&gt; pinned to your lapel in the form of a mammoth &lt;i&gt;sunflower&lt;/i&gt; protruding from a wee little vase.', '', '', 15, '2010-09-13 20:25:05', '2010-09-28 03:30:00', 15, 15),
(5164, 1, 750, 'Two &lt;i&gt;teenagers&lt;/i&gt; are seen here &lt;i&gt;standing up&lt;/i&gt; to one another, &lt;b&gt;vying&lt;/b&gt; for the attention of their peers.', '', '', 15, '2010-09-13 20:24:05', '2010-09-28 03:30:00', 15, 15),
(5165, 1, 750, 'An uncommen, but not altogether unlikely picture of a reigning &lt;b&gt;sovereign&lt;/b&gt; has him &lt;i&gt;standing up&lt;/i&gt; in his &lt;i&gt;apron&lt;/i&gt;, presumably at the behest of HIS &lt;b&gt;sovereign&lt;/b&gt; (she who is to be obeyed), who needs help with washing the dishes.', '', '', 15, '2010-09-17 05:16:39', '2010-10-02 03:30:00', 18, 17),
(5166, 1, 750, 'This frame shows up the image of a &lt;b&gt;juvenile&lt;/b&gt; hacker &lt;i&gt;standing&lt;/i&gt; on top of a &lt;i&gt;computer&lt;/i&gt;, or rather jumping up and down on it , because it refused to come up with the right answer.', '', '', 15, '2010-09-13 20:24:35', '2010-09-28 03:30:00', 15, 15),
(5167, 1, 750, 'Begin with the double meaning of the keyword &lt;b&gt;pupil&lt;/b&gt;: &quot;student&quot; and the &quot;apple of one&#039;s &lt;i&gt;eye&lt;/i&gt;&quot;.  Now all you have to do is dwell on the phrase &quot;&lt;i&gt;juvenile&lt;/i&gt; of one&#039;s &lt;i&gt;eye&lt;/i&gt;&quot; (the meaning here) until it provides you with an image.', '', '', 15, '2010-09-14 05:13:40', '2010-09-29 03:30:00', 15, 15),
(5168, 1, 750, 'This &lt;b&gt;bell&lt;/b&gt; is made of cheap &lt;i&gt;metal&lt;/i&gt;, and so badly made that when you ring it, it lets out a noise like the &quot;&lt;b&gt;bell&lt;/b&gt;owing&quot; of &lt;i&gt;juveniles&lt;/i&gt; who aren&#039;t getting their own way.', '', '', 15, '2010-09-14 05:14:26', '2010-09-29 03:30:00', 15, 15),
(5169, 1, 750, 'See the peddler &lt;i&gt;standing&lt;/i&gt; atop his &lt;i&gt;motorcycle helmet&lt;/i&gt; as if it were a soapbox, hawking his wares to passers-by.  The &lt;i&gt;legs&lt;/i&gt; and &lt;i&gt;mouth&lt;/i&gt; represent the tools of the trade of &lt;b&gt;making a deal&lt;/b&gt; any way you can.', '', '', 15, '2010-09-15 05:23:22', '2010-09-30 03:30:00', 17, 16),
(5170, 1, 750, 'The phrase &lt;b&gt;legitimate wife&lt;/b&gt; would have no meaning if there were not such things as &quot;illigitimate wives&quot;, taken because one&#039;s legal &lt;i&gt;woman&lt;/i&gt; has turned into an &lt;i&gt;antique&lt;/i&gt;.  The very offense of the idea should help you remember the kanji.', '', '', 10, '2010-09-20 05:18:01', '2010-09-30 03:30:00', 22, 21),
(5171, 1, 750, 'Can you imagine anything less &lt;b&gt;suitable&lt;/b&gt; to do with one&#039;s precious &lt;i&gt;antiques&lt;/i&gt; than to display them in the middle of a crowded &lt;i&gt;road-way&lt;/i&gt;?', '', '', 15, '2010-09-14 05:15:05', '2010-09-29 03:30:00', 15, 15),
(5172, 1, 750, 'Picture &lt;i&gt;water&lt;/i&gt; &lt;b&gt;dripping&lt;/b&gt; on what you thought were precious &lt;i&gt;antiques&lt;/i&gt;, only to find that the artificial aging painted on them is running!', '', '', 15, '2010-09-14 05:13:58', '2010-09-29 03:30:00', 15, 15),
(5173, 1, 750, 'Picture your most precious &lt;i&gt;antique&lt;/i&gt; being knocked over by your most unlikable &lt;i&gt;taskmaster&lt;/i&gt; and you have a good picture of how people make themselves &lt;i&gt;enemies&lt;/i&gt; for life.', '', '', 15, '2010-09-15 05:23:07', '2010-09-30 03:30:00', 17, 16),
(5174, 1, 750, 'This character, a pictograph of a &lt;b&gt;spoon&lt;b&gt; is easy enough to remember, provided you keep it distinct from that for &lt;i&gt;seven&lt;/i&gt;, where the first stroke is written left to right (the opposite of here), and cuts noticeably across the second (not so here again).', '', '', 15, '2010-09-14 05:16:08', '2010-09-29 03:30:00', 15, 15),
(5175, 1, 750, 'The cold air fromt eh &lt;b&gt;north&lt;/b&gt; is so strong that we see &lt;i&gt;two people sitting on the ground&lt;/i&gt;, back-to-back, their arms interlocked so they don&#039;t blow away.', '', '', 15, '2010-09-14 05:15:42', '2010-09-29 03:30:00', 15, 15),
(5176, 1, 750, 'One&#039;s &lt;b&gt;stature&lt;/b&gt; is measured according to the &quot;&lt;i&gt;northern&lt;/i&gt;-most&quot; &lt;i&gt;part of the body&lt;/i&gt;.', '', '', 15, '2010-09-14 05:14:40', '2010-09-29 03:30:00', 15, 15),
(5177, 1, 750, 'With &lt;i&gt;two spoons&lt;/i&gt;, one in each hand, you are &lt;b&gt;comparing&lt;/b&gt; your mother&#039;s cooking with that of your mother-in-law.  Dangerous.', '', '', 15, '2010-09-14 05:15:14', '2010-09-29 03:30:00', 15, 15),
(5178, 1, 750, 'Think of the housewives in TV commercials &quot;&lt;i&gt;comparing&lt;/i&gt; the &lt;i&gt;whiteness&lt;/i&gt;&quot; of their laundry across the fence, a typical advertisement for the popular detergent known as &lt;b&gt;All&lt;/b&gt;.', '', '', 15, '2010-09-14 05:15:26', '2010-09-29 03:30:00', 15, 15),
(5179, 1, 750, 'By &lt;i&gt;comparing&lt;/i&gt; apes with anthropoids, we not only discover the latter have &lt;b&gt;descended&lt;/b&gt; from those progenitors educated in the higher branches, but that the very idea of seeing everything &lt;b&gt;descend&lt;/b&gt; from everything else, one way or another, means that there is &quot;nothing new under the &lt;i&gt;sun&lt;/i&gt;&quot;.', '', '', 15, '2010-09-14 05:15:55', '2010-09-29 03:30:00', 15, 15),
(5180, 1, 751, 'New Question', 'New Answer', '', 1, '2010-06-01 20:39:30', '2010-06-02 03:30:00', 1, 1),
(5181, 1, 751, 'New Question', 'New Answer', '', 1, '2010-06-01 20:39:28', '2010-06-02 03:30:00', 1, 1),
(5182, 1, 751, 'New Question', 'New Answer', '', 1, '2010-06-01 20:39:26', '2010-06-02 03:30:00', 1, 1),
(5183, 1, 750, '&lt;b&gt;Mixed&lt;/b&gt; marriages, this character suggests, &lt;i&gt;water&lt;/i&gt; down the quality one&#039;s &lt;i&gt;descendants&lt;/i&gt; - the oldest racial nonsense in the world.', '', '', 15, '2010-09-15 05:22:20', '2010-09-30 03:30:00', 15, 15),
(5184, 1, 750, 'As you pass by the muchacho taking the &lt;i&gt;siesta&lt;/i&gt;, he cries out that he is &lt;b&gt;thirsty&lt;/b&gt; and asks for something to drink.  So you turn the &lt;i&gt;water&lt;/i&gt; hose on him.', '', '', 15, '2010-09-15 05:25:20', '2010-09-30 03:30:00', 15, 15),
(5185, 1, 750, 'Imagine an &lt;b&gt;audience&lt;/b&gt; with the emperor or the pope in which all those attending are sitting down, leaning against a wall, sleeping like our muchacho on &lt;i&gt;siest&lt;/i&gt;, as the honorable host delivers his &lt;i&gt;speech&lt;/i&gt;.', '', '', 15, '2010-09-15 05:24:55', '2010-09-30 03:30:00', 15, 15),
(5186, 1, 750, 'The color of the serape or &lt;i&gt;cloack&lt;/i&gt; of our muchacho on &lt;i&gt;siesta&lt;/i&gt; is a dull &lt;b&gt;brown&lt;/b&gt;, the color this kanji indicates.', '', '', 15, '2010-09-15 05:24:29', '2010-09-30 03:30:00', 15, 15),
(5187, 1, 750, 'When the muchacho on &lt;i&gt;siesta&lt;/i&gt; looks up and opens his &lt;i&gt;mouth&lt;/i&gt; to talk, his voice is so &lt;b&gt;hoarse&lt;/b&gt; you canno understand him.', '', '', 15, '2010-09-15 05:23:38', '2010-09-30 03:30:00', 15, 15),
(5188, 1, 750, 'Something is so downright &lt;b&gt;delicious&lt;/b&gt; that one spends the entire &lt;i&gt;day&lt;/i&gt; with a &lt;i&gt;spoon&lt;/i&gt; in hand, gobbling it up.', '', '', 15, '2010-09-15 05:22:31', '2010-09-30 03:30:00', 15, 15),
(5189, 1, 750, 'This kanji tells us that if you feed the &lt;i&gt;flesh&lt;/i&gt; too many &lt;i&gt;delicious&lt;/i&gt; things, it soon picks up a thick layer of &lt;b&gt;fat&lt;/b&gt;.', '', '', 15, '2010-09-15 05:22:41', '2010-09-30 03:30:00', 15, 15),
(5190, 1, 750, 'The Roman numeral &lt;b&gt;I&lt;/b&gt; - like that for II we met earlier, is only rarely used now.  In the midst of all the &lt;i&gt;samurai&lt;/i&gt;, we notice on in particular, &lt;i&gt;sitting on the ground&lt;/i&gt; with a &lt;i&gt;crown&lt;/i&gt; on his head, indicating that the is &quot;number &lt;b&gt;I&lt;/b&gt;&quot; in the current rankings.', '', '', 15, '2010-09-15 05:24:02', '2010-09-30 03:30:00', 15, 15),
(5191, 1, 750, '&quot;Behind &lt;b&gt;every&lt;/b&gt; successful person &lt;i&gt;reclines&lt;/i&gt; a woman...&quot;, who usually turn out to be one&#039;s &lt;i&gt;mama&lt;/i&gt;!', '', '', 15, '2010-09-15 05:21:24', '2010-09-30 03:30:00', 15, 15),
(5192, 1, 750, 'Behind &lt;i&gt;every&lt;/i&gt; successful &lt;i&gt;taskmaster&lt;/i&gt;, the &lt;b&gt;cleverness&lt;/b&gt; of a fox to outwit his charges.', '', '', 15, '2010-09-15 05:25:08', '2010-09-30 03:30:00', 15, 15),
(5193, 1, 750, 'Behind &lt;i&gt;every&lt;/i&gt; Jack Horner&#039;s pie maker, a &lt;i&gt;tree&lt;/i&gt; full of &lt;b&gt;plums&lt;/b&gt;.', '', '', 15, '2010-09-18 09:48:07', '2010-10-03 03:30:00', 18, 17),
(5194, 1, 750, 'Behind &lt;i&gt;every drop of water&lt;/i&gt; a &lt;b&gt;sea&lt;/b&gt; from which is originated.', '', '', 15, '2010-09-15 05:22:04', '2010-09-30 03:30:00', 15, 15),
(5195, 1, 750, 'See someone &lt;i&gt;reclining&lt;/i&gt; in a public place with a &lt;i&gt;hook&lt;/i&gt; in place of a hand, &lt;b&gt;begging&lt;/b&gt; a morsel of rice or a few pence.', '', '', 15, '2010-09-15 05:23:50', '2010-09-30 03:30:00', 15, 15),
(5196, 1, 750, 'In times of &lt;b&gt;drought&lt;/b&gt; ahything at all will do.  Here we see the victims &lt;i&gt;begging&lt;/i&gt; for just a little &lt;i&gt;mist&lt;/i&gt; for relief.', '', '', 10, '2010-09-23 05:41:12', '2010-10-03 03:30:00', 22, 21),
(5197, 1, 750, 'If you &lt;i&gt;double back&lt;/i&gt; (fold over) most animals - or people for that matter - in the middle, the &lt;i&gt;part of the body&lt;/i&gt; where the crease comes is the &lt;b&gt;abdomen&lt;/b&gt;.', '', '', 14, '2010-09-14 05:14:10', '2010-09-28 03:30:00', 21, 19),
(5198, 1, 750, 'In its original and etymologically transparent sense, to &lt;b&gt;duplicate&lt;/b&gt; something means to &lt;i&gt;double&lt;/i&gt; it &lt;i&gt;back&lt;/i&gt; with a fold, like the fold of a &lt;i&gt;cloak&lt;/i&gt;.', '', '', 15, '2010-09-23 05:41:28', '2010-10-08 03:30:00', 21, 19),
(5199, 1, 750, 'The pictograph hidden in this character is of someone yawning.  The first stroke shows the head thrown back; the second, the arm bent at the elbow as the hand reaches up to cover the mouth; and the last two, the legs.  Since yawning shows a lack of something (pyschologically, interest; physiologically, sleep), the connection is plain to see.', '', '', 15, '2010-09-17 05:16:08', '2010-10-02 03:30:00', 15, 15),
(5200, 1, 750, 'To &lt;b&gt;blow&lt;/b&gt; is really no more than a deliberate effort to make one&#039;s &lt;i&gt;mouth lack&lt;/i&gt; all the air that is in it.', '', '', 12, '2010-09-14 05:14:53', '2010-09-26 03:30:00', 21, 20),
(5201, 1, 750, 'Better to picture what happens when you do not pay attention to your work in the kitchen.  Here we see a blazing &lt;i&gt;fire&lt;/i&gt;, and an inattentive, &lt;i&gt;yawning&lt;/i&gt; &lt;b&gt;cook&lt;/b&gt; who let things get out of control.', '', '', 15, '2010-09-17 05:17:45', '2010-10-02 03:30:00', 15, 15),
(5202, 1, 750, 'The &lt;b&gt;song&lt;/b&gt; in this kanji is being sung by a chorus line of &lt;i&gt;can-can&lt;/i&gt; girls.  Why it should be eliciting nothing but &lt;i&gt;yawning&lt;/i&gt; from the audience is up to you to decide.', '', '', 15, '2010-09-17 05:17:08', '2010-10-02 03:30:00', 15, 15),
(5203, 1, 750, 'If the cushions of one&#039;s &lt;i&gt;car&lt;/i&gt; are too &lt;b&gt;soft&lt;/b&gt;, one may begin &lt;i&gt;yawning&lt;/i&gt; at the wheel.', '', '', 15, '2010-09-17 05:16:24', '2010-10-02 03:30:00', 15, 15),
(5204, 1, 750, 'This keyword connotes the &quot;&lt;b&gt;next&lt;/b&gt; in line&quot; of a succession of people or things.  Let there be a &lt;i&gt;lack&lt;/i&gt; of &lt;i&gt;ice&lt;/i&gt; on the hottest day of summer, and you stand impatiently in line, waiting for the distributor to call out &quot;&lt;b&gt;Next&lt;/b&gt;!&quot;.', '', '', 15, '2010-09-17 05:17:22', '2010-10-02 03:30:00', 15, 15),
(5205, 1, 750, 'Earlier we made mention of the sotry of &lt;b&gt;Briar&lt;/b&gt; Rose (or &quot;Sleeping Beauty&quot;), and drew attention to the &lt;b&gt;briar&lt;/b&gt; hedge that grew up all about her castle.  But in the &lt;i&gt;second&lt;/i&gt; part of the story, these &lt;b&gt;briars&lt;/b&gt; blossomed into &lt;i&gt;flowers&lt;/i&gt;.  Hence her name, &lt;b&gt;Briar&lt;/b&gt; Rose.', '', '', 15, '2010-09-17 05:15:33', '2010-10-02 03:30:00', 15, 15),
(5206, 1, 750, 'The first &lt;i&gt;shells&lt;/i&lt; you earn, you use to pay your debt.  From then on, the &lt;i&gt;next shells&lt;/i&gt; you accumulate become your &lt;b&gt;assets&lt;/b&gt;.', '', '', 15, '2010-09-19 08:47:52', '2010-10-04 03:30:00', 18, 17),
(5207, 1, 750, 'This kanji depicts a &lt;i&gt;woman&#039;s&lt;/i&gt; &lt;b&gt;figure&lt;/b&gt; as a sort of &lt;i&gt;second&lt;/i&gt; self.', '', '', 15, '2010-09-17 05:17:32', '2010-10-02 03:30:00', 17, 16),
(5208, 1, 750, 'To seek the &lt;i&gt;words&lt;/i&gt; of a &lt;i&gt;second mouth&lt;/i&gt; is to &lt;b&gt;consult with&lt;/b&gt; someone about something.', '', '', 15, '2010-09-17 05:15:57', '2010-10-02 03:30:00', 15, 15),
(5209, 1, 752, '', 'Blant tog og buss, hvilken er den raskeste?', '', 8, '2010-09-26 14:27:32', '2010-10-04 03:30:00', 8, 8),
(5210, 1, 752, '', 'Toget er raskere enn bussen.', '', 8, '2010-09-26 14:05:12', '2010-10-04 03:30:00', 8, 8),
(5211, 1, 752, '', 'Blant lyntog og buss, hvilken er den raskeste?', '', 8, '2010-09-26 14:13:44', '2010-10-04 03:30:00', 8, 8),
(5212, 1, 752, '', 'Lyntog er raskere enn buss.', '', 8, '2010-09-26 14:14:34', '2010-10-04 03:30:00', 8, 8),
(5213, 1, 752, '', 'Blant lyntog og tog, hvilken er den treigste?', '', 8, '2010-09-26 14:24:19', '2010-10-04 03:30:00', 8, 8),
(5214, 1, 752, '', 'Tog er treigere enn lyntog.', '', 8, '2010-09-26 14:25:57', '2010-10-04 03:30:00', 8, 8),
(5215, 1, 752, '', 'Blant tog og buss, hvilken er den billigste?', '', 8, '2010-09-26 14:25:11', '2010-10-04 03:30:00', 8, 8),
(5216, 1, 752, '', 'Buss er billigere enn tog.', '', 8, '2010-09-26 14:15:33', '2010-10-04 03:30:00', 8, 8),
(5217, 1, 752, '', 'Blant tog og bus, hvilken er den dyrste?', '', 8, '2010-09-26 13:28:07', '2010-10-04 03:30:00', 8, 8),
(5218, 1, 752, '', 'Tog er dyrere enn buss.', '', 8, '2010-09-26 13:47:08', '2010-10-04 03:30:00', 8, 8),
(5219, 1, 752, '', 'Blant Tokyo og Osaka, hvilken er den st&oslash;rste?', '', 8, '2010-09-26 14:15:46', '2010-10-04 03:30:00', 8, 8),
(5220, 1, 752, '', 'Tokyo er st&oslash;rre enn Osaka.', '', 8, '2010-09-26 13:29:26', '2010-10-04 03:30:00', 8, 8),
(5221, 1, 752, '', 'Blant Kyoto og Osaka, hvilken er den liteste?', '', 8, '2010-09-26 13:46:18', '2010-10-04 03:30:00', 8, 8),
(5222, 1, 752, '', 'Kyoto er den liteste.', '', 8, '2010-09-26 14:13:35', '2010-10-04 03:30:00', 8, 8),
(5223, 1, 752, '', 'Blant Tanaka og Yamada, hvem er den h&oslash;yste?', '', 8, '2010-09-26 14:16:51', '2010-10-04 03:30:00', 8, 8),
(5224, 1, 752, '', 'Tanaka er h&oslash;yre enn Yamada.', '', 8, '2010-09-26 14:15:57', '2010-10-04 03:30:00', 8, 8),
(5225, 1, 752, '', 'Blant Yamada og Suzuki, hvem er den lavste?', '', 8, '2010-09-26 14:05:05', '2010-10-04 03:30:00', 8, 8),
(5226, 1, 752, '', 'Yamada er lavere enn Suzuki.', '', 8, '2010-09-26 14:23:54', '2010-10-04 03:30:00', 8, 8),
(5227, 1, 752, '', 'Blant Tanaka og Suzuki, hvem er den yngste?', '', 8, '2010-09-26 14:05:19', '2010-10-04 03:30:00', 8, 8),
(5228, 1, 752, '', 'Tanaka yngre enn Suzuki.', '', 8, '2010-09-26 14:24:03', '2010-10-04 03:30:00', 8, 8),
(5229, 1, 752, '', 'Blant Yamada og Suzuki, hvem har den lengste h&aring;r?', '', 8, '2010-09-26 14:11:55', '2010-10-04 03:30:00', 8, 8),
(5230, 1, 752, '', 'Suzuki sitt h&aring;r er lengre enn Yamada sitt h&aring;r.', '', 8, '2010-09-26 14:17:03', '2010-10-04 03:30:00', 8, 8),
(5231, 1, 752, '', 'Blant sommer og vinter, hvilken liker du best?', '', 8, '2010-09-26 13:27:06', '2010-10-04 03:30:00', 8, 8),
(5232, 1, 752, '', 'Jeg liker sommer bedre enn vinter.', '', 8, '2010-09-26 13:41:03', '2010-10-04 03:30:00', 8, 8),
(5233, 1, 752, '', 'Hvorfor det?', '', 8, '2010-09-26 14:25:19', '2010-10-04 03:30:00', 8, 8),
