(5375, 1, 756, '', 'Jeg &oslash;ver p&aring; piano hver dag, derfor er ejg flink.', '', 8, '2010-09-25 10:11:28', '2010-10-03 03:30:00', 8, 8),
(5376, 1, 756, '', 'Jeg drakk mye alkohol og ansikten min ble hvitere.', '', 8, '2010-09-25 10:14:57', '2010-10-03 03:30:00', 8, 8),
(5377, 1, 756, '', 'I november var det varmt, disse dagene blir det kaldere.', '', 8, '2010-09-25 10:12:05', '2010-10-03 03:30:00', 8, 8),
(5378, 1, 757, '', 'Jeg g&aring;r med sykkel fra huset mitt til stasjonen.', '', 8, '2010-09-26 12:37:54', '2010-10-04 03:30:00', 8, 8),
(5379, 1, 757, '', 'Jeg g&aring;r med bussen fra huset mitt til skole.', '', 8, '2010-09-26 12:46:16', '2010-10-04 03:30:00', 8, 8),
