(5381, 1, 757, '', 'Jeg g&aring;r med bilen fra huset mitt til bedriften.', '', 8, '2010-09-26 12:41:13', '2010-10-04 03:30:00', 8, 8),
(5382, 1, 757, '', 'Jeg g&aring;r med tog fra Yokohama til Tokyo.', '', 8, '2010-09-26 12:37:01', '2010-10-04 03:30:00', 8, 8),
