(5384, 1, 757, '', 'Jeg g&aring;r med h&oslash;yhastighetstog fra Nagoya til Tokyo.', '', 8, '2010-09-26 12:37:21', '2010-10-04 03:30:00', 8, 8),
(5385, 1, 757, '', 'Jeg g&aring;r med fly fra Japan til Hawaii.', '', 8, '2010-09-26 12:29:18', '2010-10-04 03:30:00', 8, 8),
(5386, 1, 757, '', 'Jeg g&aring;r med b&aring;t fra Japan til Indonesia.', '', 8, '2010-09-26 12:34:47', '2010-10-04 03:30:00', 8, 8),
(5387, 1, 757, '', 'Det tar ti minutter fra huset mitt til stasjonen.', '', 8, '2010-09-26 12:40:45', '2010-10-04 03:30:00', 8, 8),
(5388, 1, 757, '', 'Det tar f&oslash;rti fra huset mitt til skole.', '', 8, '2010-09-26 12:37:33', '2010-10-04 03:30:00', 8, 8),
