(5390, 1, 757, '', 'Det tar ei time fra huset mitt til bedriften.', '', 8, '2010-09-26 12:34:39', '2010-10-04 03:30:00', 8, 8),
(5391, 1, 757, '', 'Det tar tretti minutter fra Yokohama til Tokyo.', '', 8, '2010-09-26 12:39:21', '2010-10-04 03:30:00', 8, 8),
(5392, 1, 757, '', 'Det tar femton minutter fra bedriften til varehuset.', '', 8, '2010-09-26 12:32:03', '2010-10-04 03:30:00', 8, 8),
(5393, 1, 757, '', 'Det tar to timer fra Nagoya til Tokyo.', '', 8, '2010-09-26 12:29:36', '2010-10-04 03:30:00', 8, 8),
(5394, 1, 757, '', 'Det tar &aring;tte timer fra Japan til Hawaii.', '', 8, '2010-09-26 12:37:27', '2010-10-04 03:30:00', 8, 8),
(5395, 1, 757, '', 'Det tar ei uke fra Japan til Indonesia.', '', 8, '2010-09-26 12:37:38', '2010-10-04 03:30:00', 8, 8),
(5396, 1, 757, '', 'Jeg g&aring;r med sykkel fra huset mitt til Minami stasjon.  Det tar fem minutt.', '', 8, '2010-09-26 12:40:38', '2010-10-04 03:30:00', 8, 8),
(5397, 1, 757, '', 'Jeg rir toget fra Minami stasjon til Nishi stasjon.  Det tar tjue minutt.', '', 8, '2010-09-26 12:31:59', '2010-10-04 03:30:00', 8, 8),
(5398, 1, 757, '', 'Jeg g&aring;r p&aring; fots fra Nishi stasjon til skolen.  Det tar omtrent ti minutter.', '', 8, '2010-09-26 12:36:52', '2010-10-04 03:30:00', 8, 8),
(5399, 1, 764, '', 'Mary, Jeg har ikke sett den for lenge.  Hvordan var ferien din?', '', 7, '2010-09-20 17:00:07', '2010-09-27 03:30:00', 7, 7),
(5400, 1, 764, '', 'Det var kjempe g&oslash;y.  Jeg handlet, spiste koreanske rett, og s&aring;nn type ting i korea.', '', 7, '2010-09-20 16:59:58', '2010-09-27 03:30:00', 7, 7),
(5401, 1, 764, '', 'H&oslash;res flott.  Jeg vil ogs&aring; reise.', '', 7, '2010-09-20 17:00:31', '2010-09-27 03:30:00', 7, 7),
(5402, 1, 764, '', 'Hadde du det g&oslash;y p&aring; ferie, Michiko?', '', 7, '2010-09-20 17:00:27', '2010-09-27 03:30:00', 7, 7),
(5403, 1, 764, '', 'Det var greit.  Jeg kj&oslash;rte bare i en dag, men jeg jobbet deltid hver dag.', '', 7, '2010-09-20 17:00:15', '2010-09-27 03:30:00', 7, 7),
(5404, 1, 765, '', 'Michiko, jeg vil presentere deg til vennen min.  Han her er John.  Han kom til japan for en m&aring;nad siden.', '', 7, '2010-09-20 17:01:41', '2010-09-27 03:30:00', 7, 7),
(5405, 1, 765, '', 'Hyggelig.', '', 7, '2010-09-20 17:01:45', '2010-09-27 03:30:00', 7, 7),
(5406, 1, 765, '', 'Hyggelig &aring; treffe.', '', 7, '2010-09-20 17:01:49', '2010-09-27 03:30:00', 7, 7),
(5407, 1, 766, '', 'John, hvor kommer du fra?', '', 7, '2010-09-20 17:02:31', '2010-09-27 03:30:00', 7, 7),
(5408, 1, 766, '', 'Jeg kommer fra Cairns, Australia.', '', 7, '2010-09-20 17:02:36', '2010-09-27 03:30:00', 7, 7),
(5409, 1, 766, '', 'Just det.', '', 7, '2010-09-20 17:02:45', '2010-09-27 03:30:00', 7, 7),
(5410, 1, 766, '', 'Har du v&aelig;rt i Cairns?', '', 7, '2010-09-20 17:02:54', '2010-09-27 03:30:00', 7, 7),
(5411, 1, 766, '', 'Nei, det har jeg ikke.', '', 7, '2010-09-20 17:02:12', '2010-09-27 03:30:00', 7, 7),
(5412, 1, 766, '', 'Den har fjell og havet, og er et vakkert sted.  Det er kjent for Great Barrier Reef.  Hvor kommer du fra, Michiko?', '', 7, '2010-09-20 17:02:40', '2010-09-27 03:30:00', 7, 7),
(5413, 1, 766, '', 'Jeg kommer fra nagano.  Vennligst kom og bes&oslash;ke meg.  Maten er god, &oacute;g.', '', 7, '2010-09-20 17:02:49', '2010-09-27 03:30:00', 7, 7),
