(5471, 1, 773, '', 'Jeg studerte og snakket med vennene mine, blant annet, p&aring; helgen.', '', 7, '2010-09-21 17:35:17', '2010-09-28 03:30:00', 7, 7),
(5472, 1, 773, '', 'Jeg liker &aring; danse, &aring; h&oslash;re p&aring; musikk, og s&aring; videre.', '', 7, '2010-09-21 17:35:04', '2010-09-28 03:30:00', 7, 7),
