(5478, 1, 775, '', 'Jeg reiste til kyoto og nara, for eksampel.', '', 7, '2010-09-21 17:36:14', '2010-09-28 03:30:00', 7, 7),
(5479, 1, 763, '', 'Begge deler g&aring;r greit.', '', 7, '2010-09-21 17:45:53', '2010-09-28 03:30:00', 7, 7),
(5480, 1, 763, '', 'Samme tingen.', '', 7, '2010-09-21 17:45:37', '2010-09-28 03:30:00', 7, 7),
(5481, 1, 763, '', 'Mer eller mindre den samme.', '', 7, '2010-09-21 17:44:00', '2010-09-28 03:30:00', 7, 7),
(5482, 1, 763, '', 'Litt ulike.', '', 7, '2010-09-21 17:43:28', '2010-09-28 03:30:00', 7, 7),
