(5574, 1, 779, '', 'Jeg vil ikke jobbe i japan.', '', 7, '2010-09-22 15:16:42', '2010-09-29 03:30:00', 7, 7),
(5575, 1, 779, '', 'Jeg vil kj&oslash;pe bil.', '', 7, '2010-09-22 15:15:56', '2010-09-29 03:30:00', 7, 7),
(5576, 1, 779, '', 'Jeg vil ikke bo i japan.', '', 7, '2010-09-22 15:41:52', '2010-09-29 03:30:00', 7, 7),
