(5579, 1, 779, '', 'N&aring;r jeg var et barn, ville jeg spille med elektriske leket&oslash;y.', '', 7, '2010-09-22 15:24:27', '2010-09-29 03:30:00', 7, 7),
(5580, 1, 779, '', 'N&aring;r jeg var et barn, ville jeg ikke spille med elektriske leket&oslash;y.', '', 7, '2010-09-22 15:26:32', '2010-09-29 03:30:00', 7, 7),
