(5705, 1, 778, 'Pluralizing the &lt;i&gt;snake&lt;/i&gt; and focusing on a single &lt;i&gt;taskmaster&lt;/i&gt; may help recommend the image of Ireland&#039;s most famous &lt;b&gt;reformer&lt;/b&gt;, St. Patrick, who, legend has it, drove away the &lt;i&gt;snakes&lt;/i&gt; from the land.', '', '', 14, '2010-09-18 09:52:26', '2010-10-02 03:30:00', 19, 18),
(5706, 1, 778, 'Medieval &lt;b&gt;scribes&lt;/b&gt; always wrote the &lt;i&gt;words&lt;/i&gt; of the victors.  Like &lt;i&gt;snakes&lt;/i&gt; they would distort the truth to please the winners of battles.', '', '', 15, '2010-09-23 05:45:10', '2010-10-08 03:30:00', 15, 15),
(5707, 1, 778, 'The natural state of a &lt;i&gt;snake&lt;/i&gt; is all &lt;i&gt;bound up&lt;/i&gt;, &lt;b&gt;wrapped&lt;/b&gt; all over itself.', '', '', 15, '2010-09-23 05:44:39', '2010-10-08 03:30:00', 15, 15),
(5708, 1, 778, 'The &lt;b&gt;placenta&lt;/b&gt; is the &lt;i&gt;part of the body wrapped&lt;/i&gt; around the womb, used to feed the baby.', '', '', 15, '2010-09-23 05:43:56', '2010-10-08 03:30:00', 15, 15),
(5709, 1, 778, 'Firing a &lt;b&gt;cannon&lt;/b&gt; in the middle of Tokyo will leave &lt;i&gt;stones wrapped&lt;/i&gt; around buildings, parks, and people.', '', '', 15, '2010-09-23 05:44:10', '2010-10-08 03:30:00', 15, 15),
(5710, 1, 778, '&lt;i&gt;Water&lt;/i&gt; &lt;b&gt;bubbling&lt;/b&gt; up is an attempt by the &lt;i&gt;water&lt;/i&gt; to &lt;i&gt;wrap&lt;/i&gt; its way around the air.', '', '', 15, '2010-09-23 05:43:23', '2010-10-08 03:30:00', 15, 15),
(5711, 1, 778, 'This is not a turtle, but a &lt;b&gt;tortoise&lt;/b&gt;.  The &lt;i&gt;bound up&lt;/i&gt; here is the head, the two &lt;i&gt;suns&lt;/i&gt; and the long tail are the shell.', '', '', 15, '2010-09-23 05:44:57', '2010-10-08 03:30:00', 15, 15),
(5712, 1, 778, 'When it &lt;i&gt;rains&lt;/i&gt;, &lt;i&gt;eels&lt;/i&gt; become activated and produce &lt;b&gt;electricity&lt;/b&gt;.', '', '', 15, '2010-09-23 05:42:26', '2010-10-08 03:30:00', 15, 15),
(5713, 1, 778, 'When &lt;b&gt;dragons&lt;/b&gt; are born, they look more like &lt;i&gt;eels&lt;/i&gt;, and are carried around in &lt;i&gt;vases&lt;/i&gt; until they mature.', '', '', 15, '2010-09-23 05:42:55', '2010-10-08 03:30:00', 15, 15),
(5714, 1, 778, 'The particular &lt;b&gt;waterfall&lt;/b&gt; you should imagine is one with &lt;i&gt;eels&lt;/i&gt; swimming around at the bottom, in and out of smashed &lt;i&gt;vases&lt;/i&gt;, ready to electrocute anyone that goes near them.', '', '', 15, '2010-09-23 05:43:10', '2010-10-08 03:30:00', 15, 15),
(5715, 1, 778, 'The &lt;i&gt;flesh&lt;/i&gt; of a &lt;i&gt;sow&lt;/i&gt; is called &lt;b&gt;pork&lt;/b&gt;.', '', '', 15, '2010-09-23 05:42:39', '2010-10-08 03:30:00', 15, 15),
(5716, 1, 778, 'For the keyword &lt;b&gt;pursue&lt;/b&gt;, imagine &lt;b&gt;pursuing&lt;/b&gt; a filthy &lt;i&gt;sow&lt;/i&gt;, who has just rolled around in the mud and then your bed, down the &lt;i&gt;road&lt;/i&gt; and off into infinity.', '', '', 15, '2010-09-23 05:44:26', '2010-10-08 03:30:00', 15, 15),
(5717, 1, 778, 'The &lt;i&gt;horns&lt;/i&gt; above the &lt;i&gt;sow&lt;/i&gt; represents a boar, &lt;b&gt;consumating&lt;/b&gt; with the &lt;i&gt;sow&lt;/i&gt; in broad daylight, right in the middle of a &lt;i&gt;road&lt;/i&gt;!', '', '', 15, '2010-09-23 05:43:40', '2010-10-08 03:30:00', 15, 15),
(5718, 1, 778, 'This is the full character whose primitive form we learned already.  To help a little, this kanji recalls the times when the &quot;domestic&quot; animals were, as the word itself suggests, really kept in the &lt;b&gt;house&lt;/b&gt;.  Hence: &lt;i&gt;house... sow&lt;/i&gt;.', '', '', 15, '2010-09-24 19:50:57', '2010-10-09 03:30:00', 15, 15),
(5719, 1, 778, 'The kanji in this frame demonstrates the traditional Japanese approach to marriage: it is the &lt;i&gt;woman&lt;/i&gt; who leaves her family for another &lt;i&gt;house&lt;/i&gt;hold, thus &lt;b&gt;marrying into&lt;/b&gt; a man&#039;s family.', '', '', 15, '2010-09-24 19:57:03', '2010-10-09 03:30:00', 15, 15),
(5720, 1, 778, 'The most &lt;b&gt;overpowering&lt;/b&gt; animal is Napoleon from animal farm, a &lt;i&gt;tall, crowned sow&lt;/i&gt;.', '', '', 15, '2010-09-24 19:55:22', '2010-10-09 03:30:00', 15, 15),
(5721, 1, 778, 'Golden nuggets of poop, from the &lt;b&gt;intestines&lt;/b&gt; are what one puts in a &lt;i&gt;flesh piggybank&lt;/i&gt;.', '', '', 15, '2010-09-24 19:50:01', '2010-10-09 03:30:00', 15, 15),
(5722, 1, 778, 'A &lt;i&gt;piggy bank&lt;/i&gt; full of money should be stored in a safe &lt;b&gt;location&lt;/b&gt;, maybe even buried in the &lt;i&gt;ground&lt;/i&gt;.', '', '', 15, '2010-09-24 19:49:37', '2010-10-09 03:30:00', 15, 15),
(5723, 1, 778, 'The kanji for &lt;b&gt;hot water&lt;/b&gt; combines, unsurprisingly, &lt;i&gt;water&lt;/i&gt;, with the element &lt;i&gt;piggy bank&lt;/i&gt;.  When one has trouble with ones finances (i.e., when we have no money in our &lt;i&gt;piggy banks&lt;/i&gt;), we say that one is in &lt;b&gt;hot water&lt;/b&gt;.', '', '', 15, '2010-09-24 19:53:22', '2010-10-09 03:30:00', 15, 15),
(5724, 1, 778, 'This pictograph shows the animal &lt;i&gt;horns&lt;/i&gt; at the top attached to the head, the front and back legs, and the body, to give a &lt;b&gt;sheep&lt;/b&gt;.', '', '', 15, '2010-09-24 19:54:35', '2010-10-09 03:30:00', 15, 15),
(5725, 1, 778, 'The Chinese take &lt;i&gt;sheep&lt;/i&gt;-love one step further than the Scottish and the Welsh, recognising &lt;b&gt;beauty&lt;/b&gt; as a &lt;i&gt;big sheep&lt;/i&gt;.', '', '', 15, '2010-09-24 19:44:51', '2010-10-09 03:30:00', 15, 15),
(5726, 1, 778, 'Just as a flock of &lt;i&gt;sheep&lt;/i&gt; is bigger than a single one, so two is a flock of &lt;i&gt;water&lt;/i&gt; bigger than a few drops.  What do we call the biggest flock?  An &lt;b&gt;ocean&lt;/b&gt;.', '', '', 15, '2010-09-24 19:54:52', '2010-10-09 03:30:00', 15, 15),
(5727, 1, 778, 'When someone is &lt;i&gt;speaking&lt;/i&gt; in a &lt;b&gt;detailed&lt;/b&gt; manner, they might as well be talking gibberish, just bleeting away like a &lt;i&gt;sheep&lt;/i&gt;.', '', '', 15, '2010-09-24 19:52:02', '2010-10-09 03:30:00', 15, 15),
(5728, 1, 778, 'When we buy &lt;i&gt;fish&lt;/i&gt; and &lt;i&gt;sheep&lt;/i&gt; we want it to be &lt;b&gt;fresh&lt;/b&gt;.', '', '', 15, '2010-09-24 19:45:44', '2010-10-09 03:30:00', 15, 15),
(5729, 1, 778, 'Someone who is &lt;b&gt;accomplished&lt;/b&gt; is skilled in one or other thing. A &lt;i&gt;sheep&lt;/i&gt; on the &lt;i&gt;road&lt;/i&gt;, with balancing &lt;i&gt;soil&lt;/i&gt; on its head is a very &lt;b&gt;accomplished&lt;/b&gt; &lt;i&gt;sheep&lt;/i&gt; indeed!', '', '', 15, '2010-09-24 19:52:56', '2010-10-09 03:30:00', 15, 15),
(5730, 1, 778, '&lt;i&gt;Sheep&lt;/i&gt; follow the crowd, and are more likely to become &lt;b&gt;envious&lt;/b&gt; of what others have, and what they themselves &lt;i&gt;lack&lt;/i&gt;.  They may even get into a &lt;i&gt;watery&lt;/i&gt; sweat, about their &lt;b&gt;envious&lt;/b&gt; nature.', '', '', 14, '2010-09-14 05:16:58', '2010-09-28 03:30:00', 17, 16),
(5731, 1, 778, 'There is a fine &lt;b&gt;distinction&lt;/b&gt; between &lt;i&gt;wool craft&lt;/i&gt; and art, but what that distinction is is probably based on pretence.', '', '', 15, '2010-09-24 19:48:55', '2010-10-09 03:30:00', 15, 15),
(5732, 1, 778, 'This kanji clearly describes &lt;b&gt;donning&lt;/b&gt; one&#039;s clothes as &quot;pulling the &lt;i&gt;wool&lt;/i&gt; over one&#039;s &lt;i&gt;eyes&lt;/i&gt;&quot;.', '', '', 15, '2010-09-24 19:54:10', '2010-10-09 03:30:00', 15, 15),
(5733, 1, 778, 'If you can put a whole &lt;i&gt;turkey&lt;/i&gt; in your &lt;i&gt;mouth&lt;/i&gt; at Christmas, then it will be &lt;b&gt;solely&lt;/b&gt; you who gets to eat.', '', '', 14, '2010-09-25 11:02:22', '2010-10-09 03:30:00', 20, 19),
(5734, 1, 778, 'Put the Christmas &lt;i&gt;turkey&lt;/i&gt; into the &lt;i&gt;oven fire&lt;/i&gt;, leave it for too long, and will come out all &lt;b&gt;charred&lt;/b&gt;.', '', '', 15, '2010-09-24 19:57:29', '2010-10-09 03:30:00', 15, 15),
(5735, 1, 778, 'A &lt;b&gt;reef&lt;/b&gt; is made from coral, which is essentially &lt;i&gt;charred&lt;/i&gt; dead sea animals and ground up &lt;i&gt;rocks&lt;/i&gt;.', '', '', 15, '2010-09-24 19:55:51', '2010-10-09 03:30:00', 15, 15),
(5736, 1, 778, '&lt;i&gt;Turkeys&lt;/i&gt; &lt;b&gt;gathering&lt;/b&gt; at the top of a &lt;i&gt;tree&lt;/i&gt; makes for a very strange &lt;b&gt;gathering&lt;/b&gt; indeed.', '', '', 15, '2010-09-24 19:46:52', '2010-10-09 03:30:00', 15, 15),
(5737, 1, 778, 'If you put a cooked &lt;i&gt;turkey&lt;/i&gt; on &lt;i&gt;ice&lt;/i&gt;, it will always be ready to eat, but will only ever be &lt;b&gt;quasi-&lt;/b&gt;ready-to-eat.', '', '', 15, '2010-09-24 19:56:38', '2010-10-09 03:30:00', 15, 15),
(5738, 1, 778, 'Imagine the &lt;b&gt;advance&lt;/b&gt; of an army of &lt;i&gt;turkeys&lt;/i&gt;, marching down the &lt;i&gt;road&lt;/i&gt;.', '', '', 15, '2010-09-24 19:47:35', '2010-10-09 03:30:00', 15, 15),
(5739, 1, 778, 'What better way to remember the word &lt;b&gt;miscellaneous&lt;/b&gt; than a kanji made up of &lt;b&gt;miscellaneous&lt;/b&gt; items: &lt;i&gt;baseball, trees, turkey&lt;/i&gt;.', '', '', 14, '2010-09-12 18:14:10', '2010-09-26 03:30:00', 16, 15),
(5740, 1, 778, 'The kanji for &lt;b&gt;female&lt;/b&gt; hints at all the traditional qualities of a woman: &lt;i&gt;stop&lt;/i&gt; for &lt;i&gt;stopping&lt;/i&gt; the children from doing bad things, &lt;i&gt;spoon&lt;/i&gt; for cooking, and &lt;i&gt;turkey&lt;/i&gt; to represent the mothering instinct of a &lt;b&gt;female&lt;/b&gt;.', '', '', 15, '2010-09-24 19:51:21', '2010-10-09 03:30:00', 15, 15),
(5741, 1, 778, 'At a &lt;b&gt;semi-&lt;/b&gt;final of the world cup in &lt;i&gt;water&lt;/i&gt;-polo, people were given free bits of &lt;i&gt;turkey&lt;/i&gt; on a &lt;i&gt;needle&lt;/i&gt;, instead of a hotdog on a stick, because water polo is a weird sport.', '', '', 15, '2010-09-24 19:46:15', '2010-10-09 03:30:00', 15, 15),
(5742, 1, 778, 'A &lt;i&gt;St Bernard&lt;/i&gt; chasing a &lt;i&gt;turkey&lt;/i&gt; at a farm leaves the &lt;i&gt;ricefields&lt;/i&gt; all &lt;b&gt;stirred up&lt;/b&gt;.', '', '', 15, '2010-09-24 19:45:20', '2010-10-09 03:30:00', 15, 15),
(5743, 1, 778, 'If you send your &lt;i&gt;St Bernards&lt;/i&gt; out to do the shopping for Christmas day, then he might get &lt;b&gt;robbed&lt;/b&gt; of your Christmas &lt;i&gt;turkey&lt;/i&gt;.  To stop this happening, &lt;i&gt;glue&lt;/i&gt; it under his chin, where the cask of brandy goes.', '', '', 14, '2010-09-12 18:13:59', '2010-09-26 03:30:00', 14, 14),
(5744, 1, 778, 'One the left we have a &lt;i&gt;stone&lt;/i&gt;, which you will throw at the &lt;i&gt;turkey house&lt;/i&gt; on the left, to give &lt;b&gt;assurance&lt;/b&gt; to nervous &lt;i&gt;turkeys&lt;/i&gt; that you are still outside, watching over them.', '', '', 14, '2010-09-12 18:16:09', '2010-09-26 03:30:00', 14, 14),
(5745, 1, 778, 'Do you see the horse&#039;s head in this kanji?  In the Chinese Zodiac, &lt;b&gt;noon&lt;/b&gt; was the hour of the horse.', '', '', 14, '2010-09-12 18:15:19', '2010-09-26 03:30:00', 14, 14),
(5746, 1, 778, 'To be &lt;b&gt;permitted&lt;/b&gt; to do something, you usually need to hear the &lt;i&gt;words&lt;/i&gt; straight from the &lt;i&gt;horse&#039;s&lt;/i&gt; mouth.  Otheriwse, it might just be false &lt;b&gt;permition&lt;/b&gt;.', '', '', 14, '2010-09-15 05:27:38', '2010-09-29 03:30:00', 17, 16),
(5747, 1, 778, 'If you&#039;ve ever seen Disney&#039;s Fantasia, you will recall what was done there with Beethoven&#039;s Pastoral Symphony, and the &lt;i&gt;flying horses&lt;/i&gt; that figured in it.  The mares are bathing in the stream and the stallions begin to gather.  As dusk sets in, the &lt;i&gt;flying horses&lt;/i&gt; all start &lt;i&gt;yawning&lt;/i&gt; and pair off for the night: a perfectly &lt;b&gt;delightful&lt;/b&gt; portrait of &lt;b&gt;delight&lt;/b&gt;.', '', '', 14, '2010-09-12 18:14:42', '2010-09-26 03:30:00', 14, 14),
(5748, 1, 778, 'Imagine that the police &lt;b&gt;authorities&lt;/b&gt; went around on &lt;i&gt;flying horses&lt;/i&gt;, exercising their &lt;b&gt;authority&lt;/b&gt; by dropping &lt;i&gt;trees&lt;/i&gt; on people who don&#039;t do as they&#039;re told. ', '', '', 14, '2010-09-12 18:15:04', '2010-09-26 03:30:00', 14, 14),
(5749, 1, 778, 'The best &lt;b&gt;outlook&lt;/b&gt; is one that takes in all possible views and opinions.  The only way to do that is to take a &lt;i&gt;flying horse&lt;/i&gt; up into the air to &lt;i&gt;see&lt;/i&gt; all the &lt;b&gt;outlooks&lt;/b&gt; for yourself.', '', '', 10, '2010-09-21 17:12:04', '2010-10-01 03:30:00', 21, 20),
(5750, 1, 778, 'The kanji for &lt;b&gt;feathers&lt;/b&gt; is two bird&#039;s wings.  We can break this down into two &lt;i&gt;drops of&lt;/i&gt; &lt;b&gt;feathers&lt;/b&gt; &lt;i&gt;boundup&lt;/i&gt; on each wing.', '', '', 14, '2010-09-12 18:15:10', '2010-09-26 03:30:00', 14, 14),
(5751, 1, 778, 'The owl is a &lt;i&gt;feathred white bird&lt;/i&gt;, the wisest animal in the woods.  But why is he so wise?  Because he has taken the time to &lt;b&gt;learn&lt;/b&gt;.', '', '', 14, '2010-09-12 18:14:20', '2010-09-26 03:30:00', 14, 14),
(5752, 1, 778, 'Here we see two &lt;i&gt;wings&lt;/i&gt;, one after the other.  The first bird spots &lt;i&gt;vase&lt;/i&gt;, and does a little poop into it.  Unfortunatly, the poop doesn&#039;t make it into the &lt;i&gt;vase&lt;/i&gt;, but rather the face of &lt;b&gt;the following&lt;/b&gt; bird!', '', '', 14, '2010-09-12 18:14:29', '2010-09-26 03:30:00', 14, 14),
(5753, 1, 778, '&lt;b&gt;Weekdays&lt;/b&gt; are the &lt;i&gt;days&lt;/i&gt; we go to work.  We sit in our cubicles, like &lt;i&gt;turkeys&lt;/i&gt; waiting for Christmas, fluffing our &lt;i&gt;feathers&lt;/i&gt; until the next financial crisis puts us out of a job, giving us even less to do on &lt;b&gt;weekdays&lt;/b&gt;.', '', '', 14, '2010-09-12 18:14:53', '2010-09-26 03:30:00', 14, 14),
(5754, 1, 778, 'The kanji for &lt;b&gt;laundry&lt;/b&gt; is the same as that for &lt;i&gt;weekday&lt;/i&gt;, except with &lt;i&gt;water&lt;/i&gt; instead of the element for day.  Most people do their &lt;b&gt;laundry&lt;/b&gt; at the weekends, so that comes as no surprise.', '', '', 14, '2010-09-12 18:16:22', '2010-09-26 03:30:00', 14, 14),
(5755, 1, 808, 'See the &lt;i&gt;one&lt;/i&gt; &lt;b&gt;famous saying&lt;/b&gt; &lt;i&gt;pent in&lt;/i&gt; in it&#039;s purest format, ready to be deployed by some know it all.', '', '', 14, '2010-09-14 05:21:34', '2010-09-28 03:30:00', 14, 14),
(5756, 1, 808, 'When a &lt;i&gt;tree&lt;/i&gt; is &lt;i&gt;pent in&lt;/i&gt;, it cannot grow, but if it is not &lt;i&gt;pent in&lt;/i&gt;, then the &lt;i&gt;tree&lt;/i&gt; would get too tall to prune!  Where the let the &lt;i&gt;tree&lt;/i&gt; grow or keep it &lt;i&gt;penned in&lt;/b&gt; is a bit of a &lt;b&gt;quandry&lt;/b&gt;.', '', '', 14, '2010-09-14 05:27:23', '2010-09-28 03:30:00', 14, 14),
(5757, 1, 808, 'Something which h&lt;b&gt;hardened&lt;/b&gt; is usually &lt;i&gt;old&lt;/i&gt;, and &lt;i&gt;pent in&lt;/i&gt;, like a &lt;b&gt;hardened&lt;/b&gt; criminal.', '', '', 14, '2010-09-14 05:20:57', '2010-09-28 03:30:00', 14, 14),
(5758, 1, 808, 'The kanji for &lt;b&gt;country&lt;/b&gt; shows all the &lt;i&gt;jewels&lt;/i&gt; and riches of the &lt;b&gt;country&lt;/b&gt; &lt;i&gt;pent in&lt;/i&gt; within its borders.', '', '', 14, '2010-09-14 05:17:56', '2010-09-28 03:30:00', 14, 14),
(5759, 1, 808, 'A &lt;b&gt;group&lt;/b&gt; of anything can be said to be &lt;i&gt;glued&lt;/i&gt; together, and are often &lt;i&gt;pent in&lt;/i&gt; in a box or room, to make usre that the &lt;b&gt;group&lt;/b&gt; remains seperate.', '', '', 14, '2010-09-14 05:25:26', '2010-09-28 03:30:00', 14, 14),
(5760, 1, 808, 'If you have a &lt;i&gt;big dog&lt;/i&gt;, then you can&#039;t keep it &lt;i&gt;pent in&lt;/i&gt; inside.  Doing so, as this kanji reminds us, will &lt;b&gt;cause&lt;/b&gt; him damage.', '', '', 14, '2010-09-14 05:19:29', '2010-09-28 03:30:00', 14, 14),
(5761, 1, 808, 'Although it is the man who usually does the asking, the state of &lt;b&gt;matrimony&lt;/b&gt; is usually &lt;i&gt;caused&lt;/i&gt; by the &lt;i&gt;woman&lt;/i&gt; dropping lots of helpful hints.', '', '', 14, '2010-09-14 05:22:33', '2010-09-28 03:30:00', 14, 14),
(5762, 1, 808, 'Imagine a &lt;b&gt;park&lt;/b&gt; on a spring day.  It&#039;s a &lt;i&gt;pent in&lt;/i&gt; area where people are having a picnic.  They have a &lt;i&gt;lidded crock&lt;/i&gt; full of food, and since it&#039;s a little bit chilly, one of them is wearing a &lt;i&gt;scarf&lt;/i&gt;.', '', '', 14, '2010-09-14 05:27:02', '2010-09-28 03:30:00', 14, 14),
(5763, 1, 808, 'The kanji for &lt;b&gt;-times&lt;/b&gt;, or a number of repetitions, shows one circle (squared, of course), revolving inside another.', '', '', 14, '2010-09-14 05:26:45', '2010-09-28 03:30:00', 14, 14),
(5764, 1, 808, 'A &lt;b&gt;podium&lt;/b&gt; is placed on the &lt;i&gt;ground&lt;/i&gt; outside, behind which stands a man practicing his speach in &lt;i&gt;top-hat&lt;/i&gt;, many &lt;i&gt;times&lt;/i&gt;, from daybreak to &lt;i&gt;nightbreak&lt;/i&gt;.  What is his speach about?  &lt;b&gt;Podiums&lt;/b&gt;.', '', '', 14, '2010-09-14 05:22:50', '2010-09-28 03:30:00', 14, 14),
(5765, 1, 808, 'Ali Baba and his forty theives used a &lt;i&gt;cave&lt;/i&gt; to &lt;b&gt;store&lt;/b&gt; all their treausres.  Their most precious treasure was a &lt;i&gt;fortune-telling&lt;/i&gt; magic lamp.', '', '', 14, '2010-09-14 05:20:47', '2010-09-28 03:30:00', 14, 14),
(5766, 1, 808, 'In a secret &lt;b&gt;warehouse&lt;/b&gt;, built into the bat&lt;i&gt;cave&lt;/i&gt;, the bat&lt;i&gt;car&lt;/i&gt; waits for its MOT.', '', '', 14, '2010-09-14 05:19:19', '2010-09-28 03:30:00', 14, 14),
(5767, 1, 808, 'A &lt;b&gt;courtyard&lt;/b&gt; has never before been so fittingly named!  The &lt;b&gt;courtyard&lt;/b&gt; of Ali Baba, where his &lt;i&gt;courts&lt;/i&gt; judged the people he stole from, was inside Ali Baba&#039;s secret &lt;i&gt;cave&lt;/i&gt;, just as this kanji shows us.', '', '', 14, '2010-09-14 05:25:17', '2010-09-28 03:30:00', 14, 14),
(5768, 1, 808, 'A &lt;i&gt;spike&lt;/i&gt; in a &lt;i&gt;cave&lt;/i&gt; marks the &lt;b&gt;government office&lt;/b&gt; for taxing Ali Baba.', '', '', 14, '2010-09-14 05:24:50', '2010-09-28 03:30:00', 14, 14),
(5769, 1, 808, 'Here we see a &lt;i&gt;wooden&lt;/i&gt; &lt;b&gt;bed&lt;/b&gt;, in a &lt;i&gt;cave&lt;/i&gt;, to give it that little extra bit of luxury.', '', '', 14, '2010-09-14 05:26:36', '2010-09-28 03:30:00', 14, 14),
(5770, 1, 808, 'When growing &lt;b&gt;hemp&lt;/b&gt; &lt;i&gt;trees&lt;/i&gt;, one must be careful to hide it from the authorities.  The perfect place to hide the &lt;b&gt;hemp&lt;/b&gt;, therefor is in a &lt;i&gt;cave&lt;/i&gt;.', '', '', 14, '2010-09-14 05:18:30', '2010-09-28 03:30:00', 14, 14),
(5771, 1, 808, 'The next step in the process of turning &lt;i&gt;hemp&lt;/i&gt; into marijuana is to &lt;b&gt;grind&lt;/b&gt; the &lt;i&gt;hemp&lt;/i&gt; with a large &lt;i&gt;stone&lt;/i&gt;.', '', '', 14, '2010-09-14 05:20:05', '2010-09-28 03:30:00', 14, 14),
(5772, 1, 808, 'This character, a pictographic representation of the &lt;b&gt;heart&lt;/b&gt;, is among the most widely used primitives we shall meet.', '', '', 14, '2010-09-14 05:18:05', '2010-09-28 03:30:00', 14, 14),
(5773, 1, 808, 'When we &lt;b&gt;forget&lt;/b&gt; a person, it&#039;s like their memory has &lt;i&gt;perished&lt;/i&gt; in our &lt;i&gt;heart&lt;/i&gt;.', '', '', 14, '2010-09-14 05:20:14', '2010-09-28 03:30:00', 14, 14),
(5774, 1, 808, 'If someone takes a &lt;i&gt;blade&lt;/i&gt; to your &lt;i&gt;heart&lt;/i&gt;, metaphorically or physical, you will be forced to &lt;b&gt;endure&lt;/b&gt; a long-suffering patience.', '', '', 14, '2010-09-14 05:18:43', '2010-09-28 03:30:00', 14, 14),
(5775, 1, 808, 'To &lt;b&gt;acknowledge&lt;/b&gt; someone is put into &lt;i&gt;words&lt;/i&gt; their &lt;i&gt;endurance&lt;/i&gt; in struggling to gain your &lt;b&gt;acknowledgement&lt;/b&gt;.', '', '', 14, '2010-09-16 05:19:03', '2010-09-30 03:30:00', 17, 16),
(5776, 1, 808, 'Even the slipper &lt;i&gt;snake&lt;/i&gt; has a &lt;i&gt;heart&lt;/i&gt; that weeps when he is in &lt;b&gt;mourning&lt;/b&gt;.', '', '', 14, '2010-09-14 05:23:58', '2010-09-28 03:30:00', 14, 14),
(5777, 1, 808, 'An honourable &lt;i&gt;samurai&lt;/i&gt; makes sure to meet his &lt;b&gt;intentions&lt;/b&gt;, but trusting in his &lt;i&gt;heart&lt;/i&gt;', '', '', 14, '2010-09-14 05:19:53', '2010-09-28 03:30:00', 14, 14),
(5778, 1, 808, 'A &lt;b&gt;document&lt;/b&gt; is filled with &lt;i&gt;words&lt;/i&gt; and also the &lt;i&gt;intentions&lt;/i&gt; of the party writing it, or sometimes, the &lt;i&gt;intentions&lt;/i&gt; of others, or those receiving.', '', '', 14, '2010-09-14 05:20:28', '2010-09-28 03:30:00', 14, 14),
(5779, 1, 808, 'The person you are most &lt;b&gt;loyal&lt;/b&gt; to resides in the &lt;i&gt;middle&lt;/i&gt; of one&#039;s &lt;i&gt;heart&lt;/i&gt;.', '', '', 14, '2010-09-14 05:23:46', '2010-09-28 03:30:00', 14, 14),
(5780, 1, 808, 'This is a pictograph of two pieces of meat on a skewer: a &lt;b&gt;shish kebab&lt;/b&gt;.', '', '', 14, '2010-09-14 05:22:01', '2010-09-28 03:30:00', 14, 14),
(5781, 1, 808, 'You would be &lt;b&gt;afflicted&lt;/b&gt; with a nasty addiction, if you &lt;i&gt;shish kebabs&lt;/i&gt; held a place in your &lt;i&gt;heart&lt;/i&gt;, and your &lt;i&gt;heart&lt;/i&gt; would be &lt;b&gt;afflicted&lt;/b&gt; by all that extra fat!', '', '', 14, '2010-09-14 05:18:17', '2010-09-28 03:30:00', 14, 14),
(5782, 1, 808, 'To &lt;b&gt;think&lt;/b&gt; is to use your &lt;i&gt;brains&lt;/i&gt; to reflect on what your &lt;i&gt;heart&lt;/i&gt; is telling you.', '', '', 14, '2010-09-14 05:20:38', '2010-09-28 03:30:00', 14, 14),
(5783, 1, 808, 'The &lt;i&gt;cause&lt;/i&gt; of the &lt;i&gt;heart&lt;/i&gt; is to give freely, something which we call good &lt;b&gt;grace&lt;/b&gt;.', '', '', 14, '2010-09-14 05:23:37', '2010-09-28 03:30:00', 14, 14),
(5784, 1, 808, 'Something that &lt;b&gt;applies&lt;/b&gt; fits a particular need.  Here, we see that a &lt;i&gt;heart&lt;/i&gt; applies to a &lt;i&gt;cave&#039;s&lt;/i&gt; paricular need for its vampire bats to be feed plenty of blood.', '', '', 14, '2010-09-14 05:22:17', '2010-09-28 03:30:00', 14, 14),
(5785, 1, 808, '&lt;b&gt;Ideas&lt;/b&gt; from the &lt;i&gt;heart&lt;/i&gt; should be &lt;i&gt;sounded&lt;/i&gt; out first, in order to make sure thay they are good &lt;b&gt;ideas&lt;/b&gt;.', '', '', 14, '2010-09-14 05:18:55', '2010-09-28 03:30:00', 14, 14),
(5786, 1, 808, 'Once you have a good idea, you can move on to the &lt;b&gt;concept&lt;/b&gt; stage.  At this stage, the &lt;i&gt;heart&lt;/i&gt; must &lt;i&gt;inter&lt;/i&gt;act fully with the head.', '', '', 14, '2010-09-14 05:21:09', '2010-09-28 03:30:00', 14, 14),
(5787, 1, 808, '&lt;b&gt;Breath&lt;/b&gt; in through your &lt;i&gt;nose&lt;/i&gt; to get oxygen to your &lt;i&gt;heart&lt;/i&gt; and other organs.', '', '', 14, '2010-09-14 05:25:56', '2010-09-28 03:30:00', 14, 14),
(5788, 1, 808, 'The &lt;i&gt;tongue&lt;/i&gt;, &lt;i&gt;nose&lt;/i&gt;, and &lt;i&gt;heart&lt;/i&gt; are all either inside or make &lt;b&gt;recesses&lt;/b&gt; in the body.', '', '', 14, '2010-09-14 05:24:29', '2010-09-28 03:30:00', 14, 14),
(5789, 1, 808, 'Doing a &lt;i&gt;ten brain&lt;/i&gt; &lt;b&gt;favour&lt;/b&gt; takes an equally big &lt;i&gt;heart&lt;/i&gt;.', '', '', 14, '2010-09-14 05:21:49', '2010-09-28 03:30:00', 14, 14),
(5790, 1, 808, 'The greatest &lt;b&gt;fear&lt;/b&gt; is feeling in your &lt;i&gt;heart&lt;/i&gt; that you will always be &lt;i&gt;mediocre&lt;/i&gt; at your &lt;i&gt;craft&lt;/i&gt;, and will never reach your full potential.', '', '', 13, '2010-09-22 16:54:29', '2010-10-05 03:30:00', 20, 19),
(5791, 1, 808, 'A cowboy with the his &lt;i&gt;range&lt;/i&gt; on his mind, and in his &lt;i&gt;heart&lt;/i&gt; doesn&#039;t think about the &lt;s&gt;dirt&lt;/s&gt;, onyl the romance of the &lt;i&gt;range&lt;/i&gt;.  The romance is exactly what &lt;b&gt;beguiles&lt;/b&gt; him.', '', '', 14, '2010-09-14 05:26:22', '2010-09-28 03:30:00', 14, 14),
(5792, 1, 808, 'When we let our &lt;b&gt;emotions&lt;/b&gt; get away frm us, our &lt;i&gt;mouths march&lt;/i&gt; with the words of our &lt;i&gt;hearts&lt;/i&gt;.', '', '', 14, '2010-09-14 05:23:25', '2010-09-28 03:30:00', 14, 14),
(5793, 1, 808, 'Often, statues of Jesus in a &lt;b&gt;melancholy&lt;/b&gt; position picture his &lt;i&gt;head&lt;/i&gt; with a &lt;i&gt;crown&lt;/i&gt; of thorns slipped down, his red &lt;i&gt;heart&lt;/i&gt; full of grace, and his &lt;i&gt;walking legs&lt;/i&gt; pointed towards the path of righteousness.', '', '', 14, '2010-09-14 05:25:45', '2010-09-28 03:30:00', 14, 14),
(5794, 1, 808, 'If the &lt;i&gt;house-head&lt;/i&gt; has been killed with a &lt;i&gt;dagger&lt;/i&gt;, then the weeping wife becomes a &lt;b&gt;widow&lt;/b&gt;.', '', '', 9, '2010-09-18 09:52:59', '2010-09-27 03:30:00', 25, 22),
(5795, 1, 808, 'There was a woman who owned a house that hse kept on expanding because her &lt;i&gt;state of mind&lt;/i&gt; was that if she did not keep &lt;b&gt;busy&lt;/b&gt;, she would &lt;i&gt;perish&lt;/i&gt;.', '', '', 14, '2010-09-14 05:26:05', '2010-09-28 03:30:00', 14, 14),
(5796, 1, 808, 'Just as pride comes before a fall, &lt;b&gt;ecstasy&lt;/b&gt; is the &lt;i&gt;state of mind&lt;/i&gt; of the &lt;i&gt;devil&lt;/i&gt;.', '', '', 14, '2010-09-14 05:24:09', '2010-09-28 03:30:00', 14, 14),
(5797, 1, 808, 'A &lt;i&gt;state of mind&lt;/i&gt; which &lt;i&gt;spans&lt;/i&gt; several days, no matter how positive or negative, at least has some &lt;b&gt;constancy&lt;/b&gt;.', '', '', 14, '2010-09-14 05:19:40', '2010-09-28 03:30:00', 14, 14),
(5798, 1, 808, 'To keep this kanji distinct form the others of similar connotation, one need only think of the Prophet Jeremiah whose poetry gave &lt;i&gt;eminence&lt;/i&gt; to &lt;i&gt;the state of mind&lt;/i&gt; we call &lt;b&gt;lamentation&lt;/b&gt;.', '', '', 14, '2010-09-14 05:25:04', '2010-09-28 03:30:00', 14, 14),
(5799, 1, 808, 'I know of an Indian religious sect which teaches that &lt;b&gt;enlightenment&lt;/b&gt; is to be had be covering the &lt;i&gt;five holes&lt;/i&gt; of one&#039;s head with the fingers.  The idea is to achieve that certain &lt;i&gt;state of mind&lt;/i&gt; known as &lt;b&gt;enlightenment&lt;/b&gt;.', '', '', 14, '2010-09-14 05:21:24', '2010-09-28 03:30:00', 14, 14),
(5800, 1, 808, 'When your &lt;i&gt;state of mind&lt;/i&gt; is like torn sheets of &lt;i&gt;linen&lt;/i&gt;, that&#039;s pretty &lt;b&gt;dreadful&lt;/b&gt;.', '', '', 11, '2010-09-24 19:58:34', '2010-10-05 03:30:00', 21, 20),
(5801, 1, 808, 'When one is &lt;b&gt;disconcerted&lt;/b&gt;, also known as embaressed, one&#039;s &lt;i&gt;state of mind&lt;/i&gt; is totally &lt;i&gt;laid to waste&lt;/i&gt;.', '', '', 14, '2010-09-15 05:29:59', '2010-09-29 03:30:00', 14, 14),
(5802, 1, 808, 'A priest would encourage us to &lt;b&gt;repent&lt;/b&gt; in &lt;i&gt;every state of mind&lt;/i&gt;.', '', '', 14, '2010-09-15 05:28:37', '2010-09-29 03:30:00', 14, 14),
(5803, 1, 808, 'The &lt;i&gt;state of mind&lt;/i&gt; known as &lt;b&gt;hate&lt;/b&gt; is worringly on the &lt;i&gt;increase&lt;/i&gt;.', '', '', 14, '2010-09-15 05:30:15', '2010-09-29 03:30:00', 14, 14),
(5804, 1, 808, 'It takes a certain &lt;i&gt;state of mind&lt;/i&gt; to get &lt;b&gt;accustomed&lt;/b&gt; to &lt;i&gt;piercings&lt;/i&gt;.', '', '', 14, '2010-09-15 05:28:51', '2010-09-29 03:30:00', 14, 14),
(5805, 1, 808, 'When a &lt;i&gt;butcher&lt;/i&gt; is cleaving meat, it&#039;s best to have the &lt;i&gt;state of mind&lt;/i&gt; which one associates with &lt;b&gt;pleasure&lt;/b&gt;, otherwise, butchering would be a much harder job emotionally.', '', '', 14, '2010-09-15 05:30:55', '2010-09-29 03:30:00', 14, 14),
(5806, 1, 808, 'A &lt;b&gt;lazy&lt;/b&gt; &lt;i&gt;state of mind&lt;/i&gt; is synonomous with &lt;i&gt;left&lt;/i&gt;-sided (sinister) sins of the &lt;i&gt;flesh&lt;/i&gt;.', '', '', 14, '2010-09-15 05:30:29', '2010-09-29 03:30:00', 14, 14),
(5807, 1, 808, '&lt;b&gt;Humility&lt;/b&gt; is a &lt;i&gt;state of mind&lt;/i&gt; where one is humble before the &lt;i&gt;truth&lt;/i&gt;.', '', '', 14, '2010-09-15 05:31:06', '2010-09-29 03:30:00', 14, 14),
(5808, 1, 808, '&lt;b&gt;Remorse&lt;/b&gt; is another &lt;i&gt;state of mind&lt;/i&gt;.  This time, it&#039;s a very strong &lt;i&gt;emotion&lt;/i&gt;.', '', '', 9, '2010-09-21 17:15:47', '2010-09-30 03:30:00', 35, 29),
(5809, 1, 808, 'A &lt;b&gt;recollection&lt;/b&gt; is the &lt;i&gt;state of mind&lt;/i&gt; where we remember some &lt;i&gt;idea&lt;/i&gt; or other.', '', '', 14, '2010-09-16 05:18:47', '2010-09-30 03:30:00', 16, 15),
(5810, 1, 808, 'A &lt;i&gt;valentine&lt;/i&gt; in a &lt;i&lt;graveyard&lt;/i&gt; shows someone is &lt;b&gt;pining&lt;/b&gt; for a lost love.', '', '', 14, '2010-09-15 05:29:04', '2010-09-29 03:30:00', 14, 14),
(5811, 1, 808, 'If &lt;i&gt;water&lt;/i&gt; was used to make a stream to &lt;i&gt;heaven&lt;/i&gt;, we could &lt;b&gt;annex&lt;/b&gt; &lt;i&gt;heaven&lt;/i&gt;, and meet all our old &lt;i&gt;valentines&lt;/i&gt;.', '', '', 14, '2010-09-15 05:29:37', '2010-09-29 03:30:00', 14, 14),
(5812, 1, 808, 'If one takes it is a pictograph &quot;dividing&quot; the &lt;i&gt;heart&lt;/i&gt; in half, then one has one of those &lt;b&gt;invariably&lt;/b&gt; true bits of human anatomy: the fact that each &lt;i&gt;heart&lt;/i&gt; is divided into two halves.', '', '', 14, '2010-09-15 05:29:46', '2010-09-29 03:30:00', 14, 14),
(5813, 1, 808, 'Squeezing the &lt;i&gt;invariably divided heart&lt;/i&gt; in a basin of &lt;i&gt;water&lt;/i&gt;, will lead to blood &lt;b&gt;oozing&lt;/b&gt; out.', '', '', 14, '2010-09-15 05:31:15', '2010-09-29 03:30:00', 14, 14),
(5814, 1, 809, 'This is a pictograph of a &lt;b&gt;hand&lt;/b&gt;.', '', '', 14, '2010-09-16 05:20:57', '2010-09-30 03:30:00', 14, 14),
(5815, 1, 809, 'If you put your &lt;i&gt;hand&lt;/i&gt; up above your &lt;i&gt;eyes&lt;/i&gt;, you can shade your sight from the sun and &lt;b&gt;watch over&lt;/b&gt; people more easily.', '', '', 14, '2010-09-16 05:21:24', '2010-09-30 03:30:00', 14, 14),
(5816, 1, 809, 'If you&#039;re alergic to &lt;i&gt;hemp&lt;/i&gt;, just holding some will make your &lt;i&gt;hand&lt;/i&gt; &lt;b&gt;chafe&lt;/b&gt;.', '', '', 14, '2010-09-16 05:20:16', '2010-09-30 03:30:00', 14, 14),
(5817, 1, 809, 'The biggest &lt;b&gt;egos&lt;/b&gt; in the world, think so much of themselves, that their mere &lt;i&gt;hands&lt;/i&gt; should get their own &lt;i&gt;fiestas&lt;/i&gt;.', '', '', 14, '2010-09-16 05:22:30', '2010-09-30 03:30:00', 14, 14),
(5818, 1, 809, 'Those who live in &lt;b&gt;righteousness&lt;/b&gt; have the &lt;i&gt;ego&lt;/i&gt; of a &lt;i&gt;sheep&lt;/i&gt;, which is to say, none at all.', '', '', 14, '2010-09-16 05:22:21', '2010-09-30 03:30:00', 14, 14),
(5819, 1, 809, '&lt;b&gt;Deliberation&lt;/b&gt; is what&#039;s needed in order to find &lt;i&gt;words&lt;/i&gt; of &lt;i&gt;righteousness&lt;/i&gt;.', '', '', 14, '2010-09-16 05:20:03', '2010-09-30 03:30:00', 14, 14),
(5820, 1, 809, 'When you &lt;b&gt;sacrifice&lt;/b&gt; something, you give something up.  Here, we see a &lt;i&gt;cow&lt;/i&gt; &lt;b&gt;sacrificing&lt;/b&gt; his own &lt;i&gt;righteousness&lt;/i&gt;.', '', '', 14, '2010-09-16 05:21:13', '2010-09-30 03:30:00', 14, 14),
(5821, 1, 809, 'When we ask someone else to &lt;b&gt;rub&lt;/b&gt; us, it&#039;s usually because there is some &lt;i&gt;extremity&lt;/i&gt; on our body which our &lt;i&gt;fingers&lt;/i&gt; can&#039;t reach.', '', '', 14, '2010-09-16 05:21:50', '2010-09-30 03:30:00', 14, 14),
(5822, 1, 809, 'When your lover &lt;i&gt;wraps&lt;/i&gt; her &lt;i&gt;fingers&lt;/i&gt; round your body, we call that an &lt;b&gt;embrace&lt;/b&gt;.', '', '', 14, '2010-09-16 05:20:26', '2010-09-30 03:30:00', 14, 14),
(5823, 1, 809, 'When &lt;b&gt;boarding&lt;/b&gt; a cruise ship, after one&#039;s &lt;i&gt;fingers&lt;/i&gt; open the cabin door, one sees &lt;i&gt;flowers&lt;/i&gt; on the bedside table, and a bed that &lt;i&gt;fits together&lt;/i&gt; into the wall.', '', '', 14, '2010-09-16 05:22:02', '2010-09-30 03:30:00', 14, 14),
(5824, 1, 809, 'To &lt;b&gt;extract&lt;/b&gt; something is such a delicate process, that one must have a &lt;i&gt;few&lt;/i&gt; good and nimble &lt;i&gt;fingers&lt;/i&gt; in order to &lt;b&gt;extract&lt;/b&gt; correctly.', '', '', 14, '2010-09-16 05:20:36', '2010-09-30 03:30:00', 14, 14),
(5825, 1, 809, 'A wizard would &lt;b&gt;confront&lt;/b&gt; a &lt;i&gt;whirlwind&lt;/i&gt; with his &lt;i&gt;fingers&lt;/i&gt; alone, casting spells to stop its blustering.', '', '', 14, '2010-09-16 05:21:40', '2010-09-30 03:30:00', 14, 14),
(5826, 1, 809, '&lt;b&gt;Criticism&lt;/b&gt; is the grown-up way of wagging your &lt;i&gt;finger&lt;/i&gt; whilst making unflattering &lt;i&gt;comparisons&lt;/i&gt;.', '', '', 10, '2010-09-25 11:03:18', '2010-10-05 03:30:00', 21, 20),
(5827, 1, 809, 'In the west, when we &lt;b&gt;beckon&lt;/b&gt; someone come over, we use our first &lt;i&gt;finger&lt;/i&gt; to try and &lt;i&gt;seduce&lt;/i&gt; them our way.', '', '', 14, '2010-09-16 05:21:32', '2010-09-30 03:30:00', 14, 14),
(5828, 1, 809, 'To &lt;b&gt;clear the land&lt;/b&gt;, one must simply use the &lt;i&gt;fingers&lt;/i&gt; to remove all the &lt;i&gt;stones&lt;/i&gt; from the area.', '', '', 14, '2010-09-16 05:19:47', '2010-09-30 03:30:00', 14, 14),
(5829, 1, 809, '&lt;b&gt;Clap&lt;/b&gt; and &lt;b&gt;clap&lt;/b&gt; as much as you can, and you&#039;ll turn your &lt;i&gt;fingers white&lt;/i&gt;.', '', '', 14, '2010-09-18 10:10:23', '2010-10-02 03:30:00', 14, 14),
(5830, 1, 809, 'Take your &lt;i&gt;fingers&lt;/i&gt; and hold the &lt;i&gt;spike&lt;/i&gt;, reading to receive the &lt;b&gt;strike&lt;/b&gt; of a hammer.', '', '', 14, '2010-09-18 10:12:30', '2010-10-02 03:30:00', 14, 14),
(5831, 1, 809, 'When one gets &lt;b&gt;arrested&lt;/b&gt;, your &lt;i&gt;fingers&lt;/i&gt; are put into little tiny handcuffs, and the police constable will read you the standard &lt;i&gt;phrase&lt;/i&gt; that explains your rights.', '', '', 14, '2010-09-18 10:08:32', '2010-10-02 03:30:00', 14, 14),
(5832, 1, 809, 'It takes only the stroke of a pen, guided by the &lt;i&gt;fingers&lt;/i&gt; to &lt;b&gt;discard&lt;/b&gt; a beautiful &lt;i&gt;cottage&lt;/i&gt;, in favour of a block of luxury apartments.', '', '', 14, '2010-09-18 10:09:48', '2010-10-02 03:30:00', 14, 14),
(5833, 1, 809, 'Imagine &lt;b&gt;kidnapping&lt;/b&gt; someone.  How would you do it?  Cover their &lt;i&gt;mouth&lt;/i&gt; with your &lt;i&gt;fingers&lt;/i&gt;, and show them your &lt;i&gt;dagger&lt;/i&gt;!', '', '', 14, '2010-09-18 10:12:40', '2010-10-02 03:30:00', 14, 14),
(5834, 1, 809, 'An &lt;i&gt;antique&lt;/i&gt; vase is so brittle, that &lt;b&gt;pinching&lt;/b&gt; it with your &lt;i&gt;fingers&lt;/i&gt; will make it crumble.  Best not to &lt;b&gt;pinch&lt;/b&gt; at all.', '', '', 14, '2010-09-18 10:13:10', '2010-10-02 03:30:00', 14, 14),
(5835, 1, 809, 'Not being particularly nimble with your &lt;i&gt;fingers portents&lt;/i&gt; that one will fail when faced with the &lt;b&gt;challenge&lt;/b&gt; of origami.', '', '', 14, '2010-09-18 10:11:00', '2010-10-02 03:30:00', 14, 14),
(5836, 1, 809, 'The kanji for &lt;b&gt;finger&lt;/b&gt; itself contains the elements &lt;i&gt;finger&lt;/i&gt; and &lt;i&gt;delicious&lt;/i&gt;.  Clearly, when the Japanese think of their &lt;i&gt;fingers&lt;/i&gt;, they think of something so &lt;i&gt;delicious&lt;/i&gt;, it&#039;s &lt;b&gt;finger&lt;/b&gt; lickin&#039; good!', '', '', 14, '2010-09-18 10:09:06', '2010-10-02 03:30:00', 14, 14),
(5837, 1, 809, 'The &lt;i&gt;fingers&lt;/i&gt; in &lt;i&gt;buddhist temples&lt;/i&gt; all &lt;b&gt;hold&lt;/b&gt; buddhist roasries, for they give them out as free gifts for your soul.', '', '', 14, '2010-09-18 10:10:50', '2010-10-02 03:30:00', 14, 14),
(5838, 1, 809, 'When you &lt;b&gt;fasten&lt;b&gt; your seatbelt, you take the &lt;i&gt;finger&lt;/i&gt; pert, and stick it into the mouth part, where the &lt;i&gt;tongue&lt;/i&gt; holds it all in place.', '', '', 14, '2010-09-18 10:12:58', '2010-10-02 03:30:00', 14, 14),
(5839, 1, 809, 'What one holds in ones &lt;i&gt;fingers&lt;/i&gt; whilst riding a &lt;i&gt;chariot&lt;/i&gt; is surely whatever one is &lt;b&gt;brandishing&lt;/b&gt;?', '', '', 14, '2010-09-18 10:09:39', '2010-10-02 03:30:00', 14, 14),
(5840, 1, 809, 'It&#039;s just &lt;b&gt;conjecture&lt;/b&gt;, but let&#039;s suppose &lt;i&gt;turkeys&lt;/i&gt; have &lt;i&gt;fingers&lt;/i&gt;.  Hilarious.', '', '', 14, '2010-09-18 10:13:18', '2010-10-02 03:30:00', 14, 14),
(5841, 1, 809, 'Make a little pulley system and use your &lt;i&gt;fingers&lt;/i&gt; to &lt;b&gt;hoist&lt;/b&gt; your precious &lt;i&gt;piggy bank&lt;/i&gt; safe and out of reach.', '', '', 14, '2010-09-18 10:12:50', '2010-10-02 03:30:00', 14, 14),
(5842, 1, 809, 'When you &lt;b&gt;propose&lt;/b&gt; a solution, cross your &lt;i&gt;fingers&lt;/i&gt; that it won&#039;t be ruined because most solutions need to be carried out &lt;i&gt;just so&lt;/i&gt; in order to work.  Probably best not to &lt;b&gt;propose&lt;/b&gt; anything at all!', '', '', 14, '2010-09-18 10:11:10', '2010-10-02 03:30:00', 14, 14),
(5843, 1, 809, 'A clumsy &lt;i&gt;employee&lt;/i&gt; with even clumsier &lt;i&gt;fingers&lt;/i&gt; could do worse &lt;b&gt;damage&lt;/b&gt; than a customer!', '', '', 14, '2010-09-18 10:08:41', '2010-10-02 03:30:00', 14, 14),
(5844, 1, 809, 'When &lt;b&gt;picking up&lt;/b&gt; something, you need to make usre that it &lt;i&gt;fits&lt;/i&gt; in between your &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-24 20:10:55', '2010-10-08 03:30:00', 18, 17),
(5845, 1, 809, 'The rest-bite one gets from &lt;b&gt;shouldering&lt;/b&gt; a burden is when one sleeps.  When one wakes up at &lt;i&gt;nightbreak&lt;/i&gt;, the burden must be taken with the &lt;i&gt;fingers&lt;/i&gt;, and &lt;b&gt;shouldered&lt;/b&gt; once more.', '', '', 14, '2010-09-18 10:09:29', '2010-10-02 03:30:00', 14, 14),
(5846, 1, 809, 'When climbing a rockface, a &lt;b&gt;foothold&lt;/b&gt; is a place to put your foot, after your &lt;i&gt;fingers&lt;/i&gt; have &lt;i&gt;disposed&lt;/i&gt; of the use of it.', '', '', 10, '2010-09-17 05:21:25', '2010-09-27 03:30:00', 20, 19),
(5847, 1, 809, 'A &lt;b&gt;sketch&lt;/b&gt; is a rough outline, a mere &lt;i&gt;seedling&lt;/i&gt; of a true drawing, made with the &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-18 10:12:15', '2010-10-02 03:30:00', 14, 14),
(5848, 1, 809, '&lt;b&gt;Maneuvering&lt;/b&gt; &lt;i&gt;goods&lt;/i&gt; into place beneath the Christmas &lt;i&gt;tree&lt;/i&gt; should always take into account keeping the gifts out of reach of little &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-18 10:10:15', '2010-10-02 03:30:00', 14, 14);
INSERT INTO `card` (`id`, `owner_id`, `category_id`, `question`, `answer`, `hint`, `deck`, `last_test`, `next_test`, `total_test`, `tests_passed`) VALUES
(5849, 1, 809, '&lt;b&gt;Touch&lt;/b&gt; a precious &lt;i&gt;vase&lt;/i&gt; in the same way you would &lt;b&gt;touch&lt;/b&gt; a &lt;i&gt;woman&lt;/i&gt;, delicately, with soft &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-18 10:11:31', '2010-10-02 03:30:00', 14, 14),
(5850, 1, 809, 'During the &lt;i&gt;siesta&lt;/i&gt;, at high noon, shadowy &lt;i&gt;fingers&lt;/i&gt; &lt;b&gt;put up a notice&lt;/b&gt; proclaiming a duel between him and anyone else, during &lt;i&gt;siesta&lt;/i&gt; time tomorrow.', '', '', 14, '2010-09-18 10:11:45', '2010-10-02 03:30:00', 14, 14),
(5851, 1, 809, '&lt;i&gt;Fingers&lt;/i&gt; tie a noose made of &lt;i&gt;ivy&lt;/i&gt;, round a floating &lt;i&gt;magic wand&lt;/i&gt;, for a mystical magical, &lt;b&gt;hanging&lt;/b&gt;.', '', '', 14, '2010-09-18 10:10:42', '2010-10-02 03:30:00', 14, 14),
(5852, 1, 809, 'When &lt;b&gt;polishing&lt;/b&gt; a &lt;i&gt;stone&lt;/i&gt;, one needs &lt;i&gt;two hands&lt;/i&gt;: one to hold the &lt;i&gt;stone&lt;/i&gt;, and one to &lt;b&gt;polish&lt;/b&gt; it.', '', '', 14, '2010-09-18 10:11:20', '2010-10-02 03:30:00', 14, 14),
(5853, 1, 809, 'The ten &lt;b&gt;commandments&lt;/b&gt; can be counted on &lt;i&gt;two hands&lt;/i&gt;.  If you can keep all those &lt;b&gt;commandments&lt;/b&gt;, then you are worthy of a little &lt;i&gt;fiesta&lt;/i&gt; in your honour.', '', '', 14, '2010-09-18 10:06:33', '2010-10-02 03:30:00', 14, 14),
(5854, 1, 809, 'To help you keep your &lt;i&gt;commandments&lt;/i&gt;, you could build a &lt;b&gt;contraption&lt;/b&gt; out of &lt;i&gt;wood&lt;/i&gt;.  Every time you broke a &lt;i&gt;commandment&lt;/i&gt;, a &lt;i&gt;tree&lt;/i&gt; would fall on top of you.', '', '', 14, '2010-09-18 10:12:23', '2010-10-02 03:30:00', 14, 14),
(5855, 1, 809, 'Imagine taking your &lt;i&gt;two hand&lt;/i&gt; and reachign up into someone&#039;s &lt;i&gt;nostrils&lt;/i&gt;.  Once inside, you grab hold of the &lt;i&gt;brain&lt;/i&gt; and yank it out.  At the end, you would have a pciture something like that of this character, the full kanji for &lt;b&gt;nose&lt;/b&gt;.', '', '', 14, '2010-09-18 10:10:04', '2010-10-02 03:30:00', 14, 14),
(5856, 1, 809, 'The kanji for &lt;b&gt;punish&lt;/b&gt; shows the &lt;b&gt;punishment&lt;b&gt; for stealing: your &lt;i&gt;two hands&lt;/i&gt; get cut off by a &lt;i&gt;saber&lt;/i&gt;.', '', '', 14, '2010-09-18 10:12:06', '2010-10-02 03:30:00', 14, 14),
(5857, 1, 809, 'If you were &lt;b&gt;moulding&lt;/b&gt; a clay pot, you would take your &lt;i&gt;two hands&lt;/i&gt;, and a &lt;i&gt;saber&lt;/i&gt;-like tool, and work them against a bunch of clay-filled &lt;i&gt;soil&lt;/i&gt;, until it was moulded into the shape of a beautiful pot.', '', '', 14, '2010-09-18 10:08:55', '2010-10-02 03:30:00', 14, 14),
(5858, 1, 809, 'Whatever one is particularly adep at - one&#039;s special &quot;&lt;b&gt;genius&lt;/b&gt;&quot; - one can do very easily, &quot;with one finger&quot; as the phrase goes.  This kanji is a pictograph of that one finger.', '', '', 14, '2010-09-18 10:11:54', '2010-10-02 03:30:00', 14, 14),
(5859, 1, 809, 'A magic &lt;i&gt;genie&lt;/i&gt; can take your &lt;i&gt;clams&lt;/i&gt; and turn them itno &lt;b&gt;property&lt;/b&gt;, just like an estate agent.', '', '', 14, '2010-09-19 08:57:46', '2010-10-03 03:30:00', 14, 14),
(5860, 1, 809, 'A &lt;i&gt;genie&lt;/i&gt; can turn a &lt;i&gt;tree&lt;/i&gt; into &lt;b&gt;lumber&lt;/b&gt; with using a saber or saw.', '', '', 14, '2010-09-19 08:57:34', '2010-10-03 03:30:00', 14, 14),
(5861, 1, 809, 'The word &lt;b&gt;suppose&lt;/b&gt; has the meaning &quot;make believe&quot;, just like the &lt;i&gt;genie in a bottle&lt;/i&gt; of a &lt;i&gt;child&#039;s&lt;/i&gt; imagination.', '', '', 14, '2010-09-19 09:00:55', '2010-10-03 03:30:00', 14, 14),
(5862, 1, 809, 'When looking at the &lt;i&gt;soil&lt;/i&gt;, no-one would suspect that just below the surface, a &lt;i&gt;genie in a bottle&lt;/i&gt; &lt;b&gt;exists&lt;/b&gt;.', '', '', 14, '2010-09-19 08:59:43', '2010-10-03 03:30:00', 14, 14),
(5863, 1, 809, 'This pictograph of a clenched fist is another of the &quot;hand-primitives&quot;.  Take note of its rather peculiar drawing.  Try to think of drawing a &lt;i&gt;fist&lt;/i&gt; &quot;&lt;b&gt;from&lt;/b&gt;&quot; this character to give yourself a connotation for the otherwise abstract key word.', '', '', 14, '2010-09-19 09:01:08', '2010-10-03 03:30:00', 14, 14),
(5864, 1, 809, 'Holding a &lt;i&gt;turkey&lt;/i&gt; with your &lt;i&gt;fingers&lt;/i&gt; is not enough to make it &lt;b&gt;portable&lt;b&gt;.  You need to punch through the thing with your &lt;i&gt;fist&lt;/i&gt; in order to make a handle.  Only then will it be truely &lt;b&gt;portable&lt;/b&gt;.', '', '', 14, '2010-09-19 08:59:24', '2010-10-03 03:30:00', 14, 14),
(5865, 1, 809, 'The addition of a final stroke transforms this character from the primitive for a clenched &lt;i&gt;fist&lt;/i&gt; into the kanji for &lt;b&gt;reaching out&lt;/b&gt;, much as a stroke of kindness can often turnn anger into acceptance.', '', '', 14, '2010-09-19 09:00:34', '2010-10-03 03:30:00', 14, 14),
(5866, 1, 809, 'Here we see a baby&#039;s &lt;i&gt;mouth&lt;/i&gt; and &lt;i&gt;outstretched hands&lt;/i&gt; reaching for his mother&#039;s breast to &lt;b&gt;suck&lt;/b&gt; on.', '', '', 14, '2010-09-19 08:58:53', '2010-10-03 03:30:00', 14, 14),
(5867, 1, 809, 'A &lt;b&gt;handle&lt;/b&gt; is like a set of &lt;i&gt;outstretched hands&lt;/i&gt; waiting for your &lt;i&gt;fingers&lt;/i&gt; to connect.', '', '', 14, '2010-09-19 08:59:03', '2010-10-03 03:30:00', 14, 14),
(5868, 1, 809, 'The &lt;b&gt;length&lt;/b&gt; measured by this kanji, is the &lt;b&gt;length&lt;/b&gt; of just &lt;i&gt;one arm&lt;/i&gt;.', '', '', 14, '2010-09-19 08:59:34', '2010-10-03 03:30:00', 14, 14),
(5869, 1, 809, 'The kanji for &lt;b&gt;history&lt;/b&gt; shows the beheaded Louis XVI with his &lt;i&gt;mouth tucked under his arm&lt;/i&gt;.', '', '', 14, '2010-09-19 09:00:27', '2010-10-03 03:30:00', 14, 14),
(5870, 1, 809, 'Here we see an &lt;b&gt;officer&lt;/b&gt; from the police with &lt;i&gt;one&lt;/i&gt; criminal&#039;s &lt;i&gt;mouth tucked under each arm&lt;/i&gt;, in some sort of kick-ass headlock.', '', '', 14, '2010-09-19 08:57:24', '2010-10-03 03:30:00', 14, 14),
(5871, 1, 809, 'The implicaion behind the meaning &lt;b&gt;grow late&lt;/b&gt; is that things are changing in the same way that the day turns into night.  Here, this is visualised as the &lt;i&gt;sun&lt;/i&gt; going down below the &lt;i&gt;ceiling&lt;/i&gt;, and being &lt;i&gt;tucked under the arm&lt;/i&gt; of time.', '', '', 14, '2010-09-19 09:01:18', '2010-10-03 03:30:00', 14, 14),
(5872, 1, 809, 'As time &lt;i&gt;grows late&lt;/i&gt;, and dead body will become &lt;b&gt;stiff&lt;/b&gt; like a &lt;i&gt;stone&lt;/i&gt;.  This is called rigour mortis.', '', '', 14, '2010-09-19 09:01:31', '2010-10-03 03:30:00', 14, 14),
(5873, 1, 809, 'Like the abbreviations in Roman script to indicate &quot;and&quot;, this short two-stroke kanji is used for this similar meaning of &lt;b&gt;or again&lt;/b&gt;.', '', '', 14, '2010-09-19 08:59:11', '2010-10-03 03:30:00', 14, 14),
(5874, 1, 809, 'Two &lt;i&gt;crotches&lt;/i&gt; gives us a &lt;b&gt;pair&lt;/b&gt; of &lt;i&gt;crotches&lt;/i&gt;.', '', '', 14, '2010-09-21 17:21:06', '2010-10-05 03:30:00', 14, 14),
(5875, 1, 809, 'If you were a &lt;b&gt;mulberry&lt;/b&gt; bush, then your view of the dance &quot;Here we go around the Mulburry bush&quot; would be &lt;i&gt;crotches everywhere&lt;/i&gt;, whizzing by you.', '', '', 14, '2010-09-21 17:20:26', '2010-10-05 03:30:00', 14, 14),
(5876, 1, 809, 'This kanji is the counter for ships, or &lt;b&gt;vessels&lt;/b&gt;.  It is comprised of the elements &lt;i&gt;turkey&lt;/i&gt; and &lt;i&gt;crotch&lt;/i&gt;, because if you see lots of Japanese navals &lt;b&gt;vessels&lt;/b&gt; approaching you, that &lt;i&gt;turkey&lt;/i&gt; you ate for dinner, will be resting in your &lt;i&gt;crotch&lt;/i&gt; pretty damn soon.', '', '', 14, '2010-09-21 17:17:46', '2010-10-05 03:30:00', 14, 14),
(5877, 1, 809, 'There are three diplomatic strategies to &lt;b&gt;safeguard&lt;/b&gt; a country&#039;s position in the world.  You can being with using &lt;i&gt;words&lt;/i&gt;, and then try bribing with &lt;i&gt;flowers&lt;/i&gt;.  If those two don&#039;t work, send in the naval &lt;i&gt;vessels&lt;/i&gt;!', '', '', 14, '2010-09-21 17:22:58', '2010-10-05 03:30:00', 14, 14),
(5878, 1, 809, 'A &lt;i&gt;vessel&lt;/i&gt; full of illegal &lt;i&gt;flowers&lt;/i&gt; is &lt;b&gt;seized&lt;b&gt; by a pack of angry, &gt;i&gt;wild dogs&lt;/i&gt;, controlled by the police.', '', '', 14, '2010-09-21 17:19:52', '2010-10-05 03:30:00', 14, 14),
(5879, 1, 809, 'A &lt;b&gt;guy&lt;/b&gt; is a &lt;i&gt;woman&lt;/i&gt; with a &lt;i&gt;crotch&lt;/i&gt;, according to the japanese.  And we know what they&#039;re into...', '', '', 14, '2010-09-21 17:17:01', '2010-10-05 03:30:00', 14, 14),
(5880, 1, 809, 'A &lt;i&gt;guy&lt;/i&gt; with a &lt;i&gt;heart&lt;/i&gt;, a picture of passion.  Passion of course, being expressed as &lt;b&gt;anger&lt;/b&gt;, &#039;cause he&#039;s a &lt;i&gt;guy&lt;/i&gt;, not some wuss.', '', '', 14, '2010-09-21 17:22:01', '2010-10-05 03:30:00', 14, 14),
(5881, 1, 809, 'You would have to be a pretty good &lt;b&gt;friend&lt;/b&gt; for me to have your &lt;i&gt;crotch by my side&lt;/i&gt;.', '', '', 14, '2010-09-21 17:20:58', '2010-10-05 03:30:00', 14, 14),
(5882, 1, 809, 'Use to &lt;i&gt;figners&lt;/i&gt; to silently unlock the door, so that you can &lt;b&gt;slip out&lt;/b&gt; to meet your &lt;i&gt;friend&lt;/i&gt; down the pub.', '', '', 14, '2010-09-21 17:18:55', '2010-10-05 03:30:00', 14, 14),
(5883, 1, 809, 'A handy &lt;i&gt;missle&lt;/i&gt; would be one which you could &lt;b&gt;throw&lt;/b&gt; straight from the &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-21 17:22:42', '2010-10-05 03:30:00', 14, 14),
(5884, 1, 809, 'A &lt;i&gt;missile&lt;/i&gt; launched from the &lt;i&gt;water&lt;/i&gt; has the intention only to &lt;b&gt;drown&lt;b&gt; people.', '', '', 14, '2010-09-21 17:19:28', '2010-10-05 03:30:00', 14, 14),
(5885, 1, 809, 'The foreign office is an &lt;b&gt;establishment&lt;/b&gt; that foregoes flowers, and just sticks to &lt;i&gt;words&lt;/i&gt; and &lt;i&gt;missiles&lt;/i&gt; for the &lt;b&gt;establishment&lt;/b&gt; of policy.', '', '', 14, '2010-09-21 17:18:31', '2010-10-05 03:30:00', 14, 14),
(5886, 1, 809, 'The kanji for &lt;b&gt;beat&lt;/b&gt; shows a particularly harsh form of &lt;b&gt;beating&lt;/b&gt;.  We see a &lt;i&gt;hand&lt;/i&gt;, picking up a &lt;i&gt;car&lt;/i&gt; and some &lt;i&gt;missiles&lt;/i&gt;, and pummeling the victim with the dangerous pieces of metal to him a sound &lt;b&gt;beating&lt;/b&gt;.', '', '', 14, '2010-09-21 17:23:55', '2010-10-05 03:30:00', 14, 14),
(5887, 1, 809, 'Thanks to &lt;i&gt;missiles&lt;/i&gt;, the &lt;i&gt;samurai&lt;/i&gt; have become &lt;i&gt;superfluous&lt;/i&gt;, and are now merely a &lt;b&gt;husk&lt;/b&gt; of what they once were.', '', '', 14, '2010-09-21 17:21:19', '2010-10-05 03:30:00', 14, 14),
(5888, 1, 809, 'If a &lt;b&gt;branch&lt;/b&gt; hits your &lt;i&gt;crotch&lt;/i&gt;, then the doctor will likely take a &lt;i&gt;needle&lt;/i&gt; and give you stitches.  Ouch!', '', '', 14, '2010-09-21 17:24:10', '2010-10-05 03:30:00', 14, 14),
(5889, 1, 809, 'A &lt;b&gt;skill&lt;/b&gt; takes time and practice to learn, but once you have mastered a &lt;b&gt;skill&lt;/b&gt;, it becomes like a &lt;i&gt;branch&lt;/i&gt; of your &lt;i&gt;fingers&lt;/i&gt;', '', '', 14, '2010-09-24 20:13:43', '2010-10-08 03:30:00', 17, 16),
(5890, 1, 809, 'Unlike &lt;i&gt;branch&lt;/i&gt;, a &lt;b&gt;bough&lt;/b&gt; can only be found on a &lt;i&gt;tree&lt;/i&gt;.', '', '', 14, '2010-09-21 17:23:36', '2010-10-05 03:30:00', 14, 14),
(5891, 1, 809, 'On trees, &lt;i&gt;branches&lt;/i&gt; are attached to &lt;b&gt;limbs&lt;/b&gt;.  The word &lt;b&gt;limb&lt;/b&gt; can also refer to our own &lt;b&gt;limbs&lt;/b&gt;, made of &lt;i&gt;flesh&lt;/i&gt;.', '', '', 14, '2010-09-21 17:23:08', '2010-10-05 03:30:00', 14, 14),
(5892, 1, 809, 'The &lt;b&gt;stalk&lt;/b&gt; of this &lt;i&gt;flower&lt;/i&gt; has been replaced by a &lt;i&gt;spool&lt;/i&gt; of green fibres.', '', '', 14, '2010-09-21 17:18:03', '2010-10-05 03:30:00', 14, 14),
(5893, 1, 809, 'If you are ever &lt;b&gt;suspicious&lt;/b&gt; of someone or something, then, in the right &lt;i&gt;state of mind&lt;/i&gt;, you might hire a photographer to take a &lt;i&gt;spool&lt;/i&gt; of pictures to make sure the person your are &lt;b&gt;suspicious&lt;/b&gt; about isn&#039;t actually up to no good.', '', '', 14, '2010-09-21 17:23:25', '2010-10-05 03:30:00', 14, 14),
(5894, 1, 809, 'When driving in your &lt;i&gt;car&lt;/i&gt;, if you tap the breaks too &lt;b&gt;lightly&lt;/b&gt;, you might find yourself &lt;i&gt;spooled&lt;/i&gt; around a tree, needing unwrapped like little strings of thread.', '', '', 14, '2010-09-21 17:18:44', '2010-10-05 03:30:00', 14, 14),
(5895, 1, 809, 'In a family tree, your &lt;b&gt;uncle&lt;/b&gt; is &lt;i&gt;above&lt;/i&gt; and a &lt;i&gt;little&lt;/i&gt; to the left of your &lt;i&gt;crotch&lt;/i&gt;.', '', '', 14, '2010-09-21 17:21:29', '2010-10-05 03:30:00', 14, 14),
(5896, 1, 809, 'A good &lt;b&gt;coach&lt;/b&gt; is like an &lt;i&gt;uncle&lt;/i&gt; that keeps and &lt;i&gt;eye&lt;/i&gt; on how well you are doing on the pitch.', '', '', 14, '2010-09-21 17:22:25', '2010-10-05 03:30:00', 14, 14),
(5897, 1, 809, 'The kanji for &lt;b&gt;lonliness&lt;/b&gt; shows your divorced &lt;i&gt;uncle&lt;/i&gt;, living alone in a big &lt;i&gt;house&lt;/i&gt;.', '', '', 14, '2010-09-21 17:21:47', '2010-10-05 03:30:00', 14, 14),
(5898, 1, 809, 'When we match &lt;i&gt;water&lt;/i&gt; against your &lt;i&gt;uncle&lt;/i&gt; in a competition to see which is the most &lt;b&gt;graceful&lt;/b&gt;, it is no surprise which one wins.', '', '', 14, '2010-09-21 17:17:24', '2010-10-05 03:30:00', 14, 14),
(5899, 1, 809, 'Unlike the real Pope, the &lt;b&gt;anti-&lt;/b&gt;pope was accused of exposing his &lt;i&gt;crotch&lt;/i&gt; under &lt; i&gt;cliff&lt;/i&gt;, for reasons best known to himself.', '', '', 14, '2010-09-21 17:19:08', '2010-10-05 03:30:00', 14, 14),
(5900, 1, 809, 'For people who are &lt;i&gt;anti-ground&lt;/i&gt;, the best thing to do is to build &lt;b&gt;slope&lt;/b&gt; reaching up into the air.', '', '', 14, '2010-09-21 17:22:13', '2010-10-05 03:30:00', 14, 14),
(5901, 1, 809, 'A &lt;b&gt;plank&lt;/b&gt;, planted in the ground, acts as a sort of &lt;i&gt;anit-tree&lt;/i&gt;.', '', '', 14, '2010-09-21 17:20:36', '2010-10-05 03:30:00', 14, 14),
(5902, 1, 809, 'To &lt;b&gt;return&lt;/b&gt; is to follow the &lt;i&gt;road&lt;/i&gt; in the &lt;i&gt;anti&lt;/i&gt; direction.', '', '', 14, '2010-09-24 20:03:07', '2010-10-08 03:30:00', 14, 14),
(5903, 1, 809, 'There are two types of &lt;b&gt;marketing&lt;/b&gt;, positive and negative.  Negative is saying nasty things about other companies.  This is often illegal, so &lt;i&gt;anti&lt;/i&gt;-&lt;b&gt;marketing&lt;/b&gt; often costs lots of &lt;i&gt;money&lt;/i&gt;.', '', '', 25, '2010-09-17 05:21:13', '2010-10-12 03:30:00', 25, 25),
(5904, 1, 809, 'This character is a pictograph of a bird&#039;s &lt;b&gt;claw&lt;/b&gt;, and from there comes to mean animal &lt;b&gt;claws&lt;/b&gt; in general (including human fingers).', '', '', 14, '2010-09-24 20:09:43', '2010-10-08 03:30:00', 14, 14),
(5905, 1, 809, 'This kanji, meaning &lt;b&gt;gentle&lt;/b&gt;, shows the opposite of what a &lt;b&gt;gentle&lt;/b&gt; &lt;i&gt;woman&lt;/i&gt; would be like: a &lt;i&gt;vulture woman&lt;/i&gt;.', '', '', 14, '2010-09-24 20:13:20', '2010-10-08 03:30:00', 14, 14),
(5906, 1, 809, 'A &lt;i&gt;fledgling&lt;/i&gt; calf, &lt;i&gt;hooks&lt;/i&gt; on to its mother&#039;s udders for a lovely drink of &lt;b&gt;milk&lt;/b&gt;.', '', '', 14, '2010-09-24 20:15:39', '2010-10-08 03:30:00', 14, 14),
(5907, 1, 809, '&lt;i&gt;Fledglings&lt;/i&gt; tend not to swim in the &lt;i&gt;water&lt;/i&gt;, they just go around &lt;b&gt;floating&lt;/b&gt;.', '', '', 14, '2010-09-24 20:08:21', '2010-10-08 03:30:00', 14, 14),
(5908, 1, 809, 'A &lt;b&gt;leader&lt;/b&gt; has the wisdom of a &lt;i&gt;turtle&lt;/i&gt; (able to see the future), the claws of a &lt;i&gt;vulture&lt;/i&gt; (with which to grab opportunity), and sticks to his followers like &lt;i&gt;glue&lt;/i&gt;.', '', '', 14, '2010-09-24 20:02:28', '2010-10-08 03:30:00', 14, 14),
(5909, 1, 809, 'a &lt;i&gt;leader&lt;/i&gt; should &lt;b&gt;exhort&lt;/b&gt; his viewpoint with the enthusiasm of a &lt;i&gt;St Bernard dog&lt;/i&gt;.', '', '', 14, '2010-09-25 11:04:14', '2010-10-09 03:30:00', 16, 15),
(5910, 1, 809, 'This kanji, meaning &lt;b&gt;pick&lt;/b&gt;, is used for &lt;b&gt;picking&lt;/b&gt; fruits off of &lt;i&gt;trees&lt;/i&gt;.  In it, we see two things that &lt;b&gt;pick&lt;/b&gt; the fruit off of the &lt;i&gt;trees&lt;/i&gt;: &lt;i&gt;fingers&lt;/i&gt; and &lt;i&gt;vulture&#039;s&lt;/i&gt; claws.', '', '', 14, '2010-09-24 20:17:59', '2010-10-08 03:30:00', 14, 14),
(5911, 1, 809, 'A vegetarian &lt;i&gt;vulture&lt;/i&gt; swoops from a &lt;i&gt;flower&lt;/i&gt; to a &lt;i&gt;tree&lt;/i&gt;, in search of a lovely &lt;b&gt;vegetable&lt;/b&gt; for his dinner.', '', '', 14, '2010-09-24 20:04:47', '2010-10-08 03:30:00', 14, 14),
(5912, 1, 809, 'A rather smelly old man has a &lt;i&gt;birdhouse&lt;/i&gt; in his &lt;i&gt;crotch&lt;/i&gt;.  Such a thing is really hard, even for a bird, to &lt;b&gt;accept&lt;/b&gt;.', '', '', 14, '2010-09-24 20:21:38', '2010-10-08 03:30:00', 14, 14),
(5913, 1, 809, '&lt;b&gt;Imparting&lt;/b&gt; wisdom involved giving with the &lt;i&gt;fingers&lt;/i&gt; and the recipient &lt;i&gt;accepting&lt;/i&gt; as well.', '', '', 14, '2010-09-25 11:03:44', '2010-10-09 03:30:00', 16, 15),
(5914, 1, 809, 'When your in &lt;b&gt;love&lt;/b&gt;, your head is in such a dizz that it&#039;s up in a &lt;i&gt;birdhouse&lt;/i&gt; in the sky, and your &lt;i&gt;heart&lt;/i&gt; beats faster than your &lt;i&gt;walking legs&lt;/i&gt; can carry it.', '', '', 14, '2010-09-25 11:04:34', '2010-10-09 03:30:00', 16, 15),
(5915, 1, 809, 'When you &lt;b&gt;pay&lt;/b&gt; for something, you must bend your arm at your &lt;i&gt;elbow&lt;/i&gt; and hand the money over with your &lt;i&gt;fingers&lt;/i&gt;.', '', '', 14, '2010-09-24 20:16:12', '2010-10-08 03:30:00', 14, 14),
(5916, 1, 809, 'A &lt;b&gt;wide&lt;/b&gt; &lt;i&gt;cave&lt;/i&gt; would leave plenty of room for your &lt;i&gt;elbow&lt;/i&gt;.', '', '', 14, '2010-09-24 20:15:13', '2010-10-08 03:30:00', 14, 14),
(5917, 1, 809, 'To &lt;b&gt;broaden&lt;/b&gt; something is to make it &lt;i&gt;wider&lt;/i&gt;.  To &lt;b&gt;broaden&lt;/b&gt; a small hole, just use your fingers.', '', '', 14, '2010-09-24 20:06:06', '2010-10-08 03:30:00', 14, 14),
(5918, 1, 809, 'Unlike &lt;i&gt;metals&lt;/i&gt;, &lt;b&gt;minerals&lt;/b&gt; are found spread over much &lt;i&gt;wider&lt;/i&gt; areas.', '', '', 14, '2010-09-24 20:19:35', '2010-10-08 03:30:00', 14, 14),
(5919, 1, 809, 'To turn off the &lt;b&gt;valve&lt;/b&gt;, put &lt;i&gt;two hands&lt;/i&gt; on the wheel, stick out your &lt;i&gt;elbow&lt;/i&gt; and turn.', '', '', 14, '2010-09-24 20:20:18', '2010-10-08 03:30:00', 14, 14),
(5920, 1, 809, 'Just like the kanji for female, the kanji for &lt;b&gt;male&lt;/b&gt; incorporates the element for &lt;i&gt;turkey&lt;/i&gt;, to indicate that these two kanji are related.  The other two element in &lt;b&gt;male&lt;/b&gt; show &lt;b&gt;male&lt;/b&gt; comradery, standing to shoulder to shoulder, with another &lt;b&gt;male&#039;s&lt;/b&gt; &lt;i&gt;elbow by one&#039;s side&lt;/i&gt;.', '', '', 14, '2010-09-24 20:12:10', '2010-10-08 03:30:00', 14, 14),
(5921, 1, 809, 'To be put up on a &lt;b&gt;pedestal&lt;/b&gt;, you&#039;ll need to give the crowd a taste of your &lt;i&gt;elbows&lt;/i&gt;, before opening your &lt;i&gt;mouth&lt;/i&gt; to take advantage of your new position.', '', '', 14, '2010-09-24 20:01:45', '2010-10-08 03:30:00', 14, 14),
(5922, 1, 809, 'If you put someone up on a &lt;i&gt;pedestal&lt;/i&gt;, but don&#039;t love them in your &lt;i&gt;heart&lt;/i&gt;, then they will feel &lt;b&gt;neglect&lt;/b&gt;.', '', '', 14, '2010-09-24 20:07:57', '2010-10-08 03:30:00', 14, 14),
(5923, 1, 809, 'The &lt;b&gt;reign&lt;/b&gt; of Miss Wet T-shirt 2010 is standing high up on a &lt;i&gt;pedestal&lt;/i&gt; being soaked in &lt;i&gt;water&lt;/i&gt; to show off her most famous assets.', '', '', 14, '2010-09-24 20:16:57', '2010-10-08 03:30:00', 14, 14),
(5924, 1, 809, 'A bunch of &lt;i&gt;women&lt;/i&gt; next to a &lt;i&gt;pedestal&lt;/i&gt; will &lt;b&gt;commence&lt;/b&gt; tearing it down, as soon as one of them climbs up onto it.', '', '', 14, '2010-09-24 20:10:26', '2010-10-08 03:30:00', 14, 14),
(5925, 1, 809, 'The &lt;b&gt;womb&lt;/b&gt; is the &lt;i&gt;part of the body&lt;/i&gt; which acts almost like a &lt;i&gt;pedestal&lt;/i&gt; for the baby.', '', '', 14, '2010-09-24 20:06:34', '2010-10-08 03:30:00', 14, 14),
(5926, 1, 809, 'This rather complex kanji for &lt;b&gt;window&lt;/b&gt; shows a &lt;i&gt;house&lt;/i&gt; with a man (&lt;i&gt;human legs, elbow&lt;/i&gt;) stuck in a &lt;b&gt;window&lt;/b&gt;, with his &lt;i&gt;heart&lt;/i&gt; in such a panic that it&#039;s jumped up into his throat.', '', '', 14, '2010-09-24 20:11:33', '2010-10-08 03:30:00', 14, 14),
(5927, 1, 809, 'After the attackers were &lt;b&gt;gone&lt;/b&gt;, all they left was an &lt;i&gt;elbow&lt;/i&gt; of a villager in the farm&#039;s own &lt;i&gt;soil&lt;/i&gt;.', '', '', 11, '2010-09-24 20:03:35', '2010-10-05 03:30:00', 20, 19),
(5928, 1, 809, 'After the attackers were &lt;i&gt;gone&lt;/i&gt;, the &lt;b&gt;method&lt;/b&gt; of their executions was clearer: they had used an awesome &lt;i&gt;water&lt;/i&gt; weapon to cut people&#039;s limbs off.', '', '', 14, '2010-09-24 20:05:11', '2010-10-08 03:30:00', 14, 14),
(5929, 1, 809, 'The full kanji for &lt;b&gt;meeting&lt;/b&gt; shows a full &lt;i&gt;meeting&lt;/i&gt; with &lt;i&gt;one elbow&lt;/i&gt; after another, jostling for space.', '', '', 14, '2010-09-24 20:18:43', '2010-10-08 03:30:00', 14, 14),
(5930, 1, 809, 'The &lt;b&gt;climax&lt;/b&gt; of a hiking trip is a giant &lt;i&gt;wall&lt;/i&gt; of &lt;i&gt;soil&lt;/i&gt;.  Kind of an anti-&lt;b&gt;climax&lt;/b&gt; if you ask me.', '', '', 13, '2010-09-13 20:27:48', '2010-09-26 03:30:00', 13, 13),
(5931, 1, 809, 'The &lt;i&gt;climax&lt;/i&gt; of the tour of a one-roomed &lt;i&gt;house&lt;/i&gt;, is, of course, the &lt;b&gt;room&lt;/b&gt;.', '', '', 14, '2010-09-25 11:03:58', '2010-10-09 03:30:00', 14, 14),
(5932, 1, 809, 'At the &lt;i&gt;climax&lt;/i&gt; of your &lt;b&gt;arrival&lt;/b&gt; in Japan, is adance using a &lt;i&gt;saber&lt;/i&gt;, where you might be cut in two!', '', '', 13, '2010-09-13 20:27:40', '2010-09-26 03:30:00', 13, 13),
(5933, 1, 809, 'The &lt;i&gt;climax&lt;/i&gt; of the &lt;i&gt;taskmaster&#039;s&lt;/i&gt; job is to get his charges to do something, but it takes him so long, that we use the archaic word &quot;&lt;b&gt;doth&lt;/b&gt;&quot; instead.', '', '', 13, '2010-09-13 20:26:38', '2010-09-26 03:30:00', 13, 13),
(5934, 1, 809, 'The kanji for &lt;b&gt;mutually&lt;/b&gt; shows &lt;i&gt;two walls&lt;/i&gt; comming together and joining up in &lt;b&gt;mutual&lt;/b&gt; harmony.', '', '', 13, '2010-09-13 20:27:14', '2010-09-26 03:30:00', 13, 13),
(5935, 1, 809, 'In ancient japan, they would &lt;b&gt;abandon&lt;/b&gt; children by tying the &lt;i&gt;infant&lt;/i&gt; with a &lt;i&gt;buckle&lt;/i&gt; to a &lt;i&gt;tree&lt;/i&gt;, and simply walking away.', '', '', 10, '2010-09-18 10:09:20', '2010-09-28 03:30:00', 23, 21),
(5936, 1, 809, 'When &lt;b&gt;bringing up&lt;/b&gt; an &lt;i&gt;infant&lt;/i&gt;, we want both his mind and all &lt;i&gt;parts of his body&lt;/i&gt; to be strong.', '', '', 14, '2010-09-25 11:05:28', '2010-10-09 03:30:00', 14, 14),
(5937, 1, 809, 'A hard &lt;i&gt;taskmaster&lt;/i&gt; of a parent would, when &lt;i&gt;bringing up&lt;/i&gt; a child, ensure that if he stole something, his &lt;i&gt;fingers&lt;/i&gt; would be &lt;b&gt;removed&lt;/b&gt;.', '', '', 13, '2010-09-16 05:20:48', '2010-09-29 03:30:00', 16, 15),
(5938, 1, 809, 'An &lt;i&gt;infant&lt;/i&gt;, wrapped in cloth, must be &lt;b&gt;alloted&lt;/b&gt; a pair of &lt;i&gt;human legs&lt;/i&gt; as he grows up.', '', '', 14, '2010-09-25 11:03:31', '2010-10-09 03:30:00', 14, 14),
(5939, 1, 809, 'To make a &lt;b&gt;gun&lt;/b&gt;, a large amount of &lt;i&gt;metal&lt;/i&gt; must first be &lt;i&gt;alloted&lt;/i&gt; to the task.', '', '', 13, '2010-09-13 20:26:49', '2010-09-26 03:30:00', 13, 13),
(5940, 1, 809, '&lt;b&gt;Sulfur&lt;/b&gt; is a type of &lt;i&gt;rock&lt;/i&gt;, which will &lt;i&gt;flood&lt;/i&gt; your nose with the smell of rotting eggs.  This is particularly bad if you are an &lt;i&gt;infant&lt;/i&gt;.', '', '', 14, '2010-09-25 11:05:04', '2010-10-09 03:30:00', 14, 14),
(5941, 1, 809, '&lt;b&gt;Current&lt;/b&gt; is the flow of &lt;i&gt;water&lt;/i&gt;.  We can measure the flow by throwing an &lt;i&gt;infant&lt;/i&gt; into a &lt;i&gt;flood&lt;/i&gt;, and measuring how long it take for the infant to travel a set distance, like a twisted game of Pooh Sticks.', '', '', 13, '2010-09-13 20:27:29', '2010-09-26 03:30:00', 13, 13),
(5942, 1, 809, 'In japan, you need a &lt;b&gt;license&lt;/b&gt; to use your &lt;i&gt;elbows&lt;/i&gt; and your &lt;i&gt;human legs&lt;/i&gt; as weapons.', '', '', 13, '2010-09-13 20:27:05', '2010-09-26 03:30:00', 13, 13),
(5943, 1, 809, 'A prostitute, out on the street, trys to &lt;b&gt;tempt&lt;/b&gt; you with her full &lt;i&gt;mouth&lt;/i&gt;, her thin &lt;i&gt;walking legs&lt;/i&gt;, and her &lt;i&gt;license&lt;/i&gt; to prostitute herself.', '', '', 14, '2010-09-25 11:04:47', '2010-10-09 03:30:00', 14, 14),
(5944, 1, 810, 'The kanji for &lt;b&gt;exit&lt;/b&gt; shows the &lt;b&gt;exit&lt;/b&gt; from a valley, between two &lt;i&gt;mountains&lt;/i&gt;.', '', '', 13, '2010-09-13 20:28:26', '2010-09-26 03:30:00', 13, 13),
(5945, 1, 810, 'These three peaks and a base show a &lt;b&gt;mountain&lt;/b&gt; range.', '', '', 13, '2010-09-13 20:30:30', '2010-09-26 03:30:00', 13, 13),
(5946, 1, 810, 'A &lt;b&gt;bungling&lt;/b&gt; police detective gets his &lt;i&gt;fingers&lt;/i&gt; cought in the &lt;i&gt;exit&lt;/i&gt;.', '', '', 13, '2010-09-13 20:29:28', '2010-09-26 03:30:00', 13, 13),
(5947, 1, 810, 'A &lt;b&gt;boulder&lt;/b&gt; is a &lt;i&gt;mountain&lt;/i&gt;-like &lt;i&gt;stone&lt;/i&gt;.', '', '', 13, '2010-09-13 20:30:13', '2010-09-26 03:30:00', 13, 13),
(5948, 1, 810, '&lt;b&gt;Charcoal&lt;/b&gt; is like a little &lt;i&gt;mountain&lt;/i&gt; of &lt;i&gt;ashes&lt;/i&gt; at the end of a barbecue.', '', '', 13, '2010-09-13 20:30:43', '2010-09-26 03:30:00', 13, 13),
(5949, 1, 810, 'On a winding &lt;i&gt;mountain&lt;/i&gt; road, we come to a fork.  We follow the right &lt;i&gt;branch&lt;/i&gt;, but accidentally &lt;b&gt;branch off&lt;/b&gt; the path and into the wilderness.', '', '', 8, '2010-09-18 10:13:51', '2010-09-26 03:30:00', 19, 18),
(5950, 1, 810, 'When we come across the &lt;b&gt;mountain pass&lt;/b&gt;, we are in between two &lt;i&gt;mountains&lt;/i&gt;, one &lt;i&gt;above&lt;/i&gt;, and one &lt;i&gt;below&lt;/i&gt;.', '', '', 13, '2010-09-13 20:29:52', '2010-09-26 03:30:00', 13, 13),
(5951, 1, 810, 'Imagine a lovely rhubarb &lt;b&gt;crumble&lt;/b&gt;, with a grey stone top like a &lt;i&gt;mountain&lt;/i&gt; and two big pices of rhubarb, shaped like &lt;i&gt;two moons&lt;/i&gt;.', '', '', 13, '2010-09-13 20:28:38', '2010-09-26 03:30:00', 13, 13),
(5952, 1, 810, 'Knowledge of a free &lt;i&gt;house&lt;/i&gt; in the &lt;i&gt;mountains&lt;/i&gt; is something one &lt;i&gt;invariably&lt;/i&gt; wants keep in &lt;b&gt;secrecy&lt;/b&gt;, otherwise you&#039;ll have loads of people inviting themselves along to your romantic hide-away.', '', '', 13, '2010-09-13 20:29:19', '2010-09-26 03:30:00', 13, 13),
(5953, 1, 810, 'A &lt;i&gt;house&lt;/i&gt; filled with &lt;b&gt;honey&lt;/b&gt; will &lt;i&gt;invariably&lt;/i&gt; attract &lt;i&gt;insects&lt;/i&gt;.', '', '', 13, '2010-09-13 20:29:41', '2010-09-26 03:30:00', 13, 13),
(5954, 1, 810, '&lt;i&gt;Winds&lt;/i&gt; blowing through a &lt;i&gt;mountain&lt;/i&gt; passage can often lead to giant &lt;b&gt;storms&lt;/b&gt;.', '', '', 10, '2010-09-25 11:11:53', '2010-10-05 03:30:00', 20, 19),
(5955, 1, 810, 'A &lt;b&gt;promontory&lt;/b&gt;, unlike a &lt;i&gt;cape&lt;/i&gt;, is found on a &lt;i&gt;mountain&lt;/i&gt;, not on the &lt;s&gt;&lt;i&gt;ground&lt;/i&gt;&lt;/s&gt;.', '', '', 13, '2010-09-13 20:28:59', '2010-09-26 03:30:00', 13, 13),
(5956, 1, 810, 'This character is meant to be a picture of someone walking leftward, putting one leg forward in order to &lt;b&gt;enter&lt;/b&gt; someplace.  Since the &quot;in&quot; side of a charcter is the left, it should be easy to remember the writing of this character.', '', '', 13, '2010-09-13 20:30:21', '2010-09-26 03:30:00', 13, 13),
(5957, 1, 810, 'What do you do when you &lt;i&gt;enter&lt;/i&gt; a place, and it is too &lt;b&gt;crowded&lt;/b&gt;?  Hit the &lt;i&gt;road&lt;/i&gt; again.', '', '', 13, '2010-09-13 20:28:47', '2010-09-26 03:30:00', 13, 13),
(5958, 1, 810, 'A &lt;i&gt;dagger enters&lt;/i&gt; a cake, splitting into several &lt;b&gt;parts&lt;/b&gt;.', '', '', 13, '2010-09-13 20:30:01', '2010-09-26 03:30:00', 13, 13),
(5959, 1, 810, 'If you are in extreme &lt;b&gt;poverty&lt;/b&gt;, then you will get poor relief, by having &lt;i&gt;part&lt;/i&gt; of someone else&#039;s &lt;i&gt;money&lt;/i&gt; being transferred to you.', '', '', 13, '2010-09-14 05:49:54', '2010-09-27 03:30:00', 13, 13),
(5960, 1, 810, 'When India, Israel, and Ireland were &lt;b&gt;partitioned&lt;/b&gt;, for many people it was like &lt;i&gt;part&lt;/i&gt; of their &lt;i&gt;head&lt;/i&gt; was lopped off, because the states they once believe in had changed form.', '', '', 13, '2010-09-14 05:49:19', '2010-09-27 03:30:00', 13, 13),
(5961, 1, 810, 'A &lt;b&gt;public&lt;/b&gt; spectacle invites us to &lt;i&gt;enter&lt;/i&gt;, and then use our &lt;i&gt;elbows&lt;/i&gt; to make our way to the front for a closer look.', '', '', 13, '2010-09-14 05:38:29', '2010-09-27 03:30:00', 13, 13),
(5962, 1, 810, 'In ancient Japan, &lt;i&gt;trees&lt;/i&gt; were used as a &lt;i&gt;public&lt;/i&gt; toilet.  Most often, the &lt;i&gt;tree&lt;/i&gt; used was a &lt;b&gt;pine tree&lt;/b&gt;, because of the fresh smell.', '', '', 13, '2010-09-14 05:34:50', '2010-09-27 03:30:00', 13, 13),
(5963, 1, 810, 'Here we see the kanji for a &lt;b&gt;venerable old man&lt;/b&gt;.  He is a &lt;i&gt;public&lt;7i&gt; figure, greatly respected.  So much so, that he has been given the golden &lt;i&gt;wings&lt;/i&gt; of wisdom as a gift.', '', '', 13, '2010-09-14 05:47:59', '2010-09-27 03:30:00', 13, 13),
(5964, 1, 810, 'In order to &lt;b&gt;sue&lt;/b&gt; a company, you need to announce it to the courts by saying the &lt;i&gt;words&lt;/i&gt; in &lt;i&gt;public&lt;/i&gt;.', '', '', 13, '2010-09-14 05:34:15', '2010-09-27 03:30:00', 13, 13),
(5965, 1, 810, 'If you stand this kanji on its head, the image of a &lt;b&gt;valley&lt;/b&gt; stands out more clearly: the &lt;i&gt;mouth&lt;/i&gt; of the river whose water flows down at the intersection of the two mountains, with the two final strokes adding the element of perspective.', '', '', 13, '2010-09-14 05:37:00', '2010-09-27 03:30:00', 13, 13),
(5966, 1, 810, 'On Iceland, they &lt;b&gt;bathe&lt;/b&gt; in the &lt;i&gt;water&lt;/i&gt; of natural hot-tubs in the &lt;i&gt;valleys&lt;/i&gt;.', '', '', 13, '2010-09-14 05:34:03', '2010-09-27 03:30:00', 13, 13),
(5967, 1, 810, 'This character shows a &lt;i&gt;house&lt;/i&gt; so large that it can &lt;b&gt;contain&lt;/b&gt; an entire &lt;i&gt;valley&lt;/i&gt;.', '', '', 13, '2010-09-14 05:37:16', '2010-09-27 03:30:00', 13, 13),
(5968, 1, 810, 'If you do not &lt;i&gt;contain&lt;/i&gt; ice properly, then it will &lt;b&gt;melt&lt;/b&gt; and turn into &lt;i&gt;water&lt;/i&gt;.', '', '', 13, '2010-09-14 05:50:06', '2010-09-27 03:30:00', 13, 13),
(5969, 1, 810, 'Living in the &lt;i&gt;valley&lt;/i&gt; is so boring, that one &lt;i&gt;yawn&lt;/i&gt; is enough to create a &lt;b&gt;longing&lt;/b&gt; for a more exciting life.', '', '', 13, '2010-09-14 05:49:00', '2010-09-27 03:30:00', 13, 13),
(5970, 1, 810, 'This character shows the typical &lt;i&gt;cloak&lt;/i&gt; of &lt;i&gt;valley&lt;/i&gt; folk, which, unlike the tailor-made, high-fashion overcoats of city folk, is loose-fitting and free-form.  Hence the keyword&#039;s meaning of &lt;b&gt;abundant&lt;/b&gt;.', '', '', 13, '2010-09-14 05:49:36', '2010-09-27 03:30:00', 13, 13),
(5971, 1, 810, 'The &lt;i&gt;metal&lt;/i&gt; &lt;b&gt;lead&lt;/b&gt;, will form a small &lt;i&gt;gully&lt;/i&gt; when left to harden.', '', '', 13, '2010-09-14 05:48:48', '2010-09-27 03:30:00', 13, 13),
(5972, 1, 810, 'The &lt;i&gt;water&lt;/i&gt; from a river &lt;b&gt;runs alongside&lt;/b&gt; a &lt;i&gt;gully&lt;/i&gt;, before reaching the ocean.', '', '', 13, '2010-09-14 05:40:07', '2010-09-27 03:30:00', 13, 13),
(5973, 1, 811, 'The &lt;b&gt;prize&lt;/b&gt; of an &lt;i&gt;outhouse&lt;/i&gt; is just the thing for the winner of the &lt;i&gt;shellfish&lt;/i&gt; eating competition!', '', '', 13, '2010-09-15 05:32:50', '2010-09-28 03:30:00', 13, 13),
(5974, 1, 811, 'Political &lt;b&gt;parties&lt;/b&gt; are full of people putting their foot (or &lt;i&gt;walking legs&lt;/i&gt;) in their mouth.  &lt;i&gt;Outhouses&lt;/i&gt;, just like political &lt;b&gt;parties&lt;/b&gt; are full of shit.  These two ideas are married here in this kanji.', '', '', 13, '2010-09-15 05:32:38', '2010-09-28 03:30:00', 13, 13),
(5975, 1, 811, 'An &lt;i&gt;outhouse&lt;/i&gt; spread over a large area of &lt;i&gt;land&lt;/i&gt; is probably the toilet for a &lt;b&gt;public hall&lt;/b&gt;.', '', '', 13, '2010-09-15 05:32:01', '2010-09-28 03:30:00', 13, 13),
(5976, 1, 811, 'It is quite &lt;b&gt;usual&lt;/b&gt; in japan to visit the &lt;i&gt;outhouse&lt;/i&gt; with a &lt;i&gt;towel&lt;/i&gt; wrapped round your waist, especially if you&#039;ve just come out of an onsen.', '', '', 13, '2010-09-15 05:34:36', '2010-09-28 03:30:00', 13, 13),
(5977, 1, 811, 'If, when going to the &lt;i&gt;outhouse&lt;/i&gt;, you need to lift up your &lt;i&gt;garments&lt;/i&gt;, then you&#039;re probably wearing a &lt;b&gt;skirt&lt;/b&gt;.', '', '', 13, '2010-09-15 05:33:43', '2010-09-28 03:30:00', 13, 13),
(5978, 1, 811, 'The worst part of a spastic colon is having to sit in the &lt;i&gt;outhouse&lt;/i&gt;, &lt;b&gt;manipulating&lt;/b&gt; it with your &lt;i&gt;hand&lt;/i&gt;.', '', '', 13, '2010-09-15 05:35:34', '2010-09-28 03:30:00', 13, 13),
(5979, 1, 811, 'The simplest way to remember this characters is to see it as built up from that for &lt;i&gt;branch&lt;/i&gt;.  The first stroke can then stand for something &quot;hanging&quot; down from the &lt;i&gt;branch&lt;/i&gt;, namely its bark or &lt;b&gt;pelt&lt;/b&gt;.', '', '', 13, '2010-09-15 05:34:13', '2010-09-28 03:30:00', 13, 13),
(5980, 1, 811, '&lt;b&gt;Waves&lt;/b&gt; are &lt;i&gt;water&#039;s pelt&lt;/i&gt;.', '', '', 13, '2010-09-15 05:36:25', '2010-09-28 03:30:00', 13, 13),
(5981, 1, 811, 'ASitting by the beach, enjoying the &lt;i&gt;waves&lt;/i&gt;.  What sort of &lt;i&gt;woman&lt;/i&gt; has the time these days to do such a thing?  Why, an &lt;b&gt;old woman&lt;/b&gt; of course.', '', '', 13, '2010-09-15 05:34:00', '2010-09-28 03:30:00', 13, 13),
(5982, 1, 811, 'Running your &lt;i&gt;fingers&lt;/i&gt; along a &lt;i&gt;pelt&lt;/i&gt; will &lt;b&gt;expose&lt;/b&gt; the animal&#039;s scarrs.', '', '', 13, '2010-09-15 05:35:06', '2010-09-28 03:30:00', 13, 13),
(5983, 1, 811, 'If you take a &lt;i&gt;rock&lt;/i&gt; to a &lt;i&gt;pelt&lt;/i&gt;, you will be in danger of &lt;b&gt;rending&lt;/b&gt; it into pieces.', '', '', 13, '2010-09-15 05:34:47', '2010-09-28 03:30:00', 13, 13),
(5984, 1, 811, 'Making a &lt;i&gt;cloak&lt;/i&gt; out the &lt;i&gt;pelt&lt;/i&gt; f a furry animal with &lt;b&gt;incur&lt;/b&gt; the wrath of animal rights activists.', '', '', 13, '2010-09-15 05:33:28', '2010-09-28 03:30:00', 13, 13),
(5985, 1, 811, 'Every year, the &lt;i&gt;bones&lt;/i&gt; of a King are paraded around on a &lt;i&gt;float&lt;/i&gt; with the rest of his &lt;b&gt;remainders&lt;/b&gt;.', '', '', 13, '2010-09-15 05:32:19', '2010-09-28 03:30:00', 13, 13),
(5986, 1, 811, 'Unlike Christian martyrs, who ascend to heaven after three days, those who achieve &lt;b&gt;martyrdom&lt;/b&gt; in Japan see the &lt;i&gt;bones&lt;/i&gt; burnt after a &lt;i&gt;decameron&lt;/i&gt;, to let their souls escape.', '', '', 13, '2010-09-15 05:36:42', '2010-09-28 03:30:00', 13, 13),
(5987, 1, 811, 'There are many ingredients in good dyes, some ordinary, and some strange.  &lt;i&gt;Bone&lt;/i&gt; is a &lt;b&gt;particularly&lt;/b&gt; strange ingredient in &lt;i&gt;vermillion&lt;/i&gt;.', '', '', 13, '2010-09-16 05:26:54', '2010-09-29 03:30:00', 13, 13),
(5988, 1, 811, 'Thanks to technologies such as &lt;i&gt;augmented&lt;/i&gt; reality, Doctors will soon be able to do X-Rays and see patient&#039;s &lt;i&gt;bones straightaway&lt;/i&gt;, live in front of them.', '', '', 13, '2010-09-16 05:24:57', '2010-09-29 03:30:00', 13, 13),
(5989, 1, 811, 'A &lt;b&gt;file&lt;/b&gt; of people all lined up, kept in &lt;b&gt;file&lt;/b&gt; by the threat of &lt;i&gt;sabres&lt;/i&gt; on one side of the line, and being turned to &lt;i&gt;bones&lt;/i&gt; on the other.', '', '', 13, '2010-09-16 05:28:00', '2010-09-29 03:30:00', 13, 13),
(5990, 1, 811, 'A &lt;i&gt;file&lt;/i&gt; of people, waiting outside of a department store, will &lt;b&gt;split&lt;/b&gt; as soon as the doors open, they see the &lt;i&gt;garment&lt;/i&gt; they&#039;re looking for.', '', '', 13, '2010-09-16 05:25:36', '2010-09-29 03:30:00', 13, 13),
(5991, 1, 811, 'Only the most &lt;b&gt;ardent&lt;/b&gt; queuers will stand in &lt;i&gt;file&lt;/i&gt; over an &lt;i&gt;oven fire&lt;/i&gt; to get what they want.', '', '', 13, '2010-09-16 05:26:36', '2010-09-29 03:30:00', 13, 13),
(5992, 1, 811, 'In Buddhist tradition, after &lt;b&gt;death&lt;/b&gt;, the &lt;i&gt;bones&lt;/i&gt; are cremated, and then raked through with a &lt;i&gt;spoon&lt;/i&gt; on the look-out for relics.', '', '', 13, '2010-09-16 05:27:50', '2010-09-29 03:30:00', 13, 13),
(5993, 1, 811, '&lt;i&gt;Flowers&lt;/i&gt; on a coffin at the &lt;b&gt;internment&lt;/b&lt; of a relative who has suffered &lt;i&gt;death&lt;/i&gt;.  His &lt;i&gt;two hands&lt;/i&gt; are tied together in prayer.', '', '', 13, '2010-09-16 05:26:17', '2010-09-29 03:30:00', 13, 13),
(5994, 1, 811, 'When in a debaucherous &lt;i&gt;birdhouse&lt;/i&gt;, you can &lt;i&gt;eye&lt;/i&gt; up the one you want, lower your &lt;i&gt;sunglasses&lt;/i&gt; and &lt;b&gt;wink&lt;/b&gt;, to have her handed to you on a plate.', '', '', 10, '2010-09-19 09:04:47', '2010-09-29 03:30:00', 23, 21),
(5995, 1, 811, 'The pictograph for the &lt;b&gt;ear&lt;/b&gt; looks much like that for &lt;i&gt;eye&lt;/i&gt;, but note how the stroke order gives it a different look.', '', '', 13, '2010-09-16 05:25:21', '2010-09-29 03:30:00', 13, 13),
(5996, 1, 811, 'When you &lt;b&gt;take&lt;/b&gt; something on the sly, like a chocolate biscuit, you must listen hard with your &lt;i&gt;ear&lt;/i&gt;, because if you get found out, you&#039;ll get punched in the &lt;i&gt;crotch&lt;/i&gt;.', '', '', 13, '2010-09-16 05:24:36', '2010-09-29 03:30:00', 13, 13),
(5997, 1, 811, 'If you just want the &lt;b&gt;gist&lt;/b&gt; of something, then you really want to just &lt;i&gt;take&lt;/i&gt; the meaning and &lt;i&gt;run&lt;/i&gt; with it.', '', '', 13, '2010-09-16 05:27:16', '2010-09-29 03:30:00', 13, 13),
(5998, 1, 811, 'Just as JFK did his &lt;b&gt;utmost&lt;/b&gt; to conquer the moon, when I&#039;m president, I&#039;ll do my &lt;b&gt;utmost&lt;/b&gt; to &lt;i&gt;take&lt;/i&gt; the &lt;i&gt;sun&lt;/i&gt;.', '', '', 13, '2010-09-16 05:25:51', '2010-09-29 03:30:00', 13, 13),
(5999, 1, 811, 'When you take a &lt;b&gt;snapshot&lt;/b&gt;, you should try your &lt;i&gt;utmost&lt;/i&gt; not to get your &lt;i&gt;finger&lt;/i&gt; over the lense!', '', '', 12, '2010-09-19 09:06:50', '2010-10-01 03:30:00', 18, 17),
(6000, 1, 811, 'The kanji for &lt;b&gt;shame&lt;/b&gt; has &lt;i&gt;ear&lt;/i&gt; to the left, and &lt;i&gt;heart&lt;/i&gt; to the right.', '', '', 13, '2010-09-16 05:27:34', '2010-09-29 03:30:00', 13, 13),
(6001, 1, 811, 'Someone who is &lt;b&gt;posted&lt;/b&gt; at the &lt;i&gt;kazoo&lt;/i&gt; factory must have either a very good &lt;i&gt;ear&lt;/i&gt;, or a very bad one.', '', '', 13, '2010-09-17 05:25:25', '2010-09-30 03:30:00', 13, 13),
(6002, 1, 811, 'In ancient Japan, the &lt;i&gt;king&lt;/i&gt; was seen as &lt;b&gt;holy&lt;/b&gt;.  Everything piece of fruit that went into his &lt;i&gt;mouth&lt;/i&gt; was first made &lt;b&gt;holy&lt;/b&gt;, and every word that entered his &lt;i&gt;ear&lt;/i&gt;, the same.', '', '', 13, '2010-09-17 05:23:40', '2010-09-30 03:30:00', 13, 13),
(6003, 1, 811, 'Only the most &lt;b&gt;daring&lt;/b&gt; &lt;i&gt;taskmaster&lt;/i&gt; would drive a &lt;i&gt;spike&lt;/i&gt; through his own &lt;i&gt;ear&lt;/i&gt;.', '', '', 13, '2010-09-17 05:22:44', '2010-09-30 03:30:00', 13, 13),
(6004, 1, 811, 'The kanji for &lt;b&gt;listen&lt;/b&gt; naturally includes the kanji for &lt;i&gt;ear&lt;/i&gt;, but it also includes a &lt;i&gt;needle&lt;/i&gt; with which to pin your ears back, an &lt;i&gt;eye&lt;/i&gt; to show that &lt;b&gt;listening&lt;/b&gt; involves paying attention to the person speaking.  The final element is &lt;i&gt;heart&lt;/i&gt;, reminding us that we should &lt;b&gt;listen&lt;/b&gt; with our &lt;i&gt;hearts&lt;/i&gt; too.', '', '', 13, '2010-09-17 05:22:24', '2010-09-30 03:30:00', 13, 13),
(6005, 1, 811, 'It takes a certain &lt;i&gt;state of mind&lt;/i&gt; to take a &lt;i&gt;needle&lt;/i&gt; and your best &lt;i&gt;eye&lt;/i&gt; in order to sew a &lt;b&gt;pocket&lt;/b&gt; onto your favourite &lt;i&gt;garment&lt;/i&gt;.', '', '', 13, '2010-09-17 05:23:00', '2010-09-30 03:30:00', 13, 13),
(6006, 1, 811, 'If your &lt;i&gt;state of mind&lt;/i&gt; is the same as a &lt;i&gt;mandala&lt;/i&gt;, then you&#039;re open for great &lt;b&gt;ridicule&lt;/b&gt;.', '', '', 13, '2010-09-17 05:25:11', '2010-09-30 03:30:00', 13, 13),
(6007, 1, 811, 'If you fall into the &lt;i&gt;water&lt;/i&gt;, you might &lt;b&gt;loose&lt;/b&gt; your &lt;i&gt;mandala&lt;/i&gt;!', '', '', 13, '2010-09-23 05:46:16', '2010-10-06 03:30:00', 17, 16),
(6008, 1, 811, 'Impulse &lt;b&gt;buying&lt;/b&gt; is when your &lt;i&gt;eyes&lt;/i&gt; fall on something you want, and your &lt;i&gt;money&lt;/i&gt; comes out right away to &lt;b&gt;buy&lt;/b&gt; the very object.', '', '', 13, '2010-09-17 05:23:59', '2010-09-30 03:30:00', 13, 13),
(6009, 1, 811, 'Product &lt;b&gt;placement&lt;/b&gt; attracts the &lt;i&gt;eye straightaway&lt;/i&gt;.', '', '', 10, '2010-09-20 05:21:21', '2010-09-30 03:30:00', 19, 18),
(6010, 1, 811, 'The rather harsh &lt;b&gt;penalty&lt;/b&gt; for speaking bad &lt;i&gt;words&lt;/i&gt; was a &lt;i&gt;saber&lt;/i&gt; through the &lt;i&gt;eye&lt;/i&gt;.', '', '', 13, '2010-09-17 05:24:31', '2010-09-30 03:30:00', 13, 13),
(6011, 1, 811, 'The kanji for &lt;b&gt;rather&lt;/b&gt; is a little sentence: &quot;I would &lt;b&gt;rather&lt;/b&gt; keep my &lt;i&gt;heart&lt;/i&gt; in the &lt;i&gt;house&lt;/i&gt; than drive a &lt;i&gt;spike&lt;/i&gt; through my &lt;i&gt;eye&lt;/i&gt;.  I think I would &lt;b&gt;rather&lt;/b&gt; that too!', '', '', 9, '2010-09-20 05:21:02', '2010-09-29 03:30:00', 19, 18),
(6012, 1, 811, 'If you keep your &lt;i&gt;eye&lt;/i&gt; on a &lt;i&gt;bound up insect&lt;/i&gt;, floundring in &lt;i&gt;water&lt;/i&gt;, then you&#039;ll see that its consonants and calls for help all become &lt;b&gt;voiced&lt;/b&gt;.', '', '', 13, '2010-09-23 05:46:44', '2010-10-06 03:30:00', 17, 16),
(6013, 1, 811, 'Like most &lt;b&gt;rings&lt;/b&gt;, the kanji for &lt;b&gt;ring&lt;/b&gt; has &lt;i&gt;jewel&lt;/i&gt; on it.  This &lt;i&gt;jewel&lt;/i&gt; is so impressive that on the sight of it, your &lt;i&gt;eyes&lt;/i&gt; will hit the &lt;i&gt;ceiling&lt;/i&gt;, and your &lt;i&gt;mouth&lt;/i&gt; will drop down to your &lt;i&gt;scarf&lt;/i&gt;!', '', '', 13, '2010-09-17 05:22:02', '2010-09-30 03:30:00', 13, 13),
(6014, 1, 811, 'When breaking up with the fianc&eacute;, the &lt;i&gt;ring&lt;/i&gt; was &lt;b&gt;sent back&lt;/b&gt; on the &lt;i&gt;road&lt;/i&gt; to marriage, but strangely, without the &lt;s&gt;jewel&lt;/s&gt;.', '', '', 13, '2010-09-17 05:24:14', '2010-09-30 03:30:00', 13, 13),
(6015, 1, 811, 'The kanji for &lt;b&gt;husband&lt;/b&gt; of &quot;head of the family&quot; is based on the kanji for &lt;i&gt;large&lt;/i&gt;, and an extra line near the top for the &quot;head&quot;.', '', '', 13, '2010-09-18 10:14:44', '2010-10-01 03:30:00', 13, 13),
(6016, 1, 811, 'When raising a child, to have the &lt;i&gt;fingers&lt;/i&gt; of &lt;i&gt;husband&lt;/i&gt; on tap gives great &lt;b&gt;aid&lt;/b&gt;.', '', '', 13, '2010-09-18 10:17:36', '2010-10-01 03:30:00', 13, 13),
(6017, 1, 811, 'The kanji for a &lt;b&gt;mountain stream&lt;/b&gt; shows the &lt;i&gt;water&lt;/i&gt; of the stream, an a mountain &lt;i&gt;vulture&lt;/i&gt;, perched on top of your &lt;i&gt;husband&lt;/i&gt;, tring to follow the &lt;b&gt;mountain stream&lt;/b&gt; to the top!', '', '', 13, '2010-09-18 10:17:13', '2010-10-01 03:30:00', 13, 13),
(6018, 1, 811, 'No matter what you may think, the &lt;b&gt;standard&lt;/b&gt; &lt;i&gt;huband&lt;/i&gt; cannot &lt;i&gt;see&lt;/i&gt; that your bum looks big in that, giving instead a &lt;b&gt;standard&lt;/b&gt; reply: you look fine.', '', '', 13, '2010-09-18 10:15:48', '2010-10-01 03:30:00', 13, 13),
(6019, 1, 811, 'The kanji for &lt;b&gt;exchange&lt;/b&gt; shows the concept for &quot;wife swap&quot;, or, as it was known then, &quot;&lt;i&gt;husband&lt;/i&gt; swap&quot;, which shows &lt;i&gt;two husbands&lt;/i&gt; &lt;b&gt;exchanging&lt;/b&gt; with eachother for a &lt;i&gt;day&lt;/i&gt;.', '', '', 13, '2010-09-18 10:15:20', '2010-10-01 03:30:00', 13, 13),
(6020, 1, 811, 'It would be particularly difficult to find &lt;i&gt;two husband&lt;/i&gt; who woudl &lt;b&gt;approve&lt;/b&gt; of the way a woman spends &lt;i&gt;money&lt;/i&gt;.', '', '', 13, '2010-09-18 10:16:58', '2010-10-01 03:30:00', 13, 13),
(6021, 1, 811, 'To &lt;b&gt;submerge&lt;/b&gt; oneself, simply &lt;i&gt;exchange&lt;/i&gt; land and air with &lt;i&gt;water&lt;/i&gt;.', '', '', 13, '2010-09-18 10:16:01', '2010-10-01 03:30:00', 13, 13),
(6022, 1, 811, 'The kanji for &lt;b&gt;losing&lt;/b&gt; something shows a &lt;i&gt;husband&lt;/i&gt; with something falling from his side, as he is walking along; something which he &lt;b&gt;loses&lt;/b&gt;.', '', '', 13, '2010-09-18 10:16:40', '2010-10-01 03:30:00', 13, 13),
(6023, 1, 811, 'To make little &lt;b&gt;iron&lt;/b&gt; balls, simply take the molten &lt;i&gt;metal&lt;/i&gt; and &lt;i&gt;drop&lt;/i&gt; it from a great height.', '', '', 13, '2010-09-18 10:15:33', '2010-10-01 03:30:00', 13, 13),
(6024, 1, 811, '&lt;i&gt;Drop&lt;/i&gt; this &lt;i&gt;road&lt;/i&gt; for anotoher to take an &lt;b&gt;alternate&lt;/b&gt; route.', '', '', 13, '2010-09-18 10:16:32', '2010-10-01 03:30:00', 13, 13),
(6025, 1, 811, 'This is a pictograph of the &quot;pop-eye&quot; of a &lt;b&gt;retainer&lt;/b&gt;, standing in awe of his Emperor.', '', '', 13, '2010-09-18 10:17:25', '2010-10-01 03:30:00', 13, 13),
(6026, 1, 811, 'A &lt;b&gt;princess&lt;/b&gt; is a &lt;i&gt;woman&lt;/i&gt; so beautiful that she causes eyes to &lt;i&gt;pop-out&lt;/i&gt;.', '', '', 13, '2010-09-18 10:16:10', '2010-10-01 03:30:00', 13, 13),
(6027, 1, 811, 'An ancient japanese &lt;i&gt;parade&lt;/i&gt; woudl need a place to store all the &lt;i&gt;flowers&lt;/i&gt; used on the floats, and of course a set of &lt;i&gt;slaves&lt;/i&gt; to look after it all.  This place was a &lt;b&gt;storehouse&lt;/b&gt;.', '', '', 13, '2010-09-18 10:17:52', '2010-10-01 03:30:00', 13, 13),
(6028, 1, 811, 'The &lt;b&gt;entrails&lt;/b&gt; are the &lt;i&gt;part of the body&lt;/i&gt; we use as a &lt;i&gt;storehouse&lt;/i&gt;.', '', '', 13, '2010-09-18 10:16:22', '2010-10-01 03:30:00', 13, 13),
(6029, 1, 785, '', 'Du ser ikke frisk ut, Mary.', '', 0, '2010-07-02 21:33:01', '2010-07-02 21:33:01', 0, 0),
(6030, 1, 785, '', '&Oslash;h, jeg har mageknip.', '', 0, '2010-07-02 21:34:19', '2010-07-02 21:34:19', 0, 0),
(6031, 1, 785, '', 'Hva er galt?', '', 0, '2010-07-02 21:34:58', '2010-07-02 21:34:58', 0, 0),
(6032, 1, 785, '', 'Ig&aring;r spiste jeg middag med en venn.  Jeg tror kanskje jeg spiste for mye.', '', 0, '2010-07-02 21:36:53', '2010-07-02 21:36:53', 0, 0),
(6033, 1, 785, '', 'G&aring;r det bra?', '', 0, '2010-07-02 21:37:29', '2010-07-02 21:37:29', 0, 0),
(6034, 1, 785, '&hellip;&hellip;', 'Ja, det g&aring;r greit.  &Oslash;h, det smerter.', '', 0, '2010-07-02 21:39:07', '2010-07-02 21:39:07', 0, 0),
(6035, 1, 785, '', 'Du m&aring;  p&aring; sykehuset.', '', 0, '2010-07-02 21:42:22', '2010-07-02 21:42:22', 0, 0),
(6036, 1, 786, '', 'Lege, jeg har vondt i halsen, og jeg hadde mageknip i g&aring;r.', '', 0, '2010-07-02 21:43:45', '2010-07-02 21:43:45', 0, 0);
