(6096, 1, 811, 'Only the &lt;b&gt;strictest&lt;/b&gt; &lt;i&gt;slave&lt;/i&gt; owner would punish his &lt;i&gt;slaves&lt;/i&gt; by burying them up to their &lt;i&gt;crotch&lt;/i&gt; in &lt;i&gt;soil&lt;/i&gt;.', '', '', 13, '2010-09-19 09:06:22', '2010-10-02 03:30:00', 13, 13),
(6097, 1, 811, 'Here we see a &lt;i&gt;slave&lt;/i&gt; &lt;b&gt;looking ahead to&lt;/b&gt; his day off, where he can &lt;i&gt;recline&lt;/i&gt; and enjoy some consumer &lt;i&gt;goods&lt;/i&gt;.', '', '', 13, '2010-09-19 09:05:44', '2010-10-02 03:30:00', 13, 13),
(6098, 1, 811, 'When &lt;i&gt;slaves&lt;/i&gt; are laid out for a master&#039;s &lt;b&gt;perusal&lt;/b&gt;, they line up, &lt;i&gt;reclining&lt;/i&gt; on the &lt;i&gt;floor&lt;/i&gt;, for the master to &lt;i&gt;see&lt;/i&gt; which one is best.', '', '', 13, '2010-09-19 09:03:35', '2010-10-02 03:30:00', 13, 13),
