(6102, 1, 811, 'The &lt;i&gt;power&lt;/i&gt; in the &lt;i&gt;ricefields&lt;/i&gt; come apparently from &lt;b&gt;men&lt;/b&gt;, but I&#039;ve seen women, and even children in those paddies, too.', '', '', 13, '2010-09-19 09:07:38', '2010-10-02 03:30:00', 13, 13),
(6103, 1, 811, 'A &lt;i&gt;schoolhouse&lt;/i&gt; full of children!  Imagine the amount of &lt;i&gt;power&lt;/i&gt; their mothers have in order to endure all that &lt;b&gt;labour&lt;/b&gt;.', '', '', 13, '2010-09-19 09:05:54', '2010-10-02 03:30:00', 13, 13),
(6104, 1, 811, 'It is one of the stranger &lt;i&gt;powers&lt;/i&gt; of the &lt;i&gt;graveyard&lt;/i&gt; that it manages to &lt;b&gt;recruit&lt;/b&gt; all sorts of people into becoming zombies, werewolves, and vampires.', '', '', 13, '2010-09-19 09:03:13', '2010-10-02 03:30:00', 13, 13),
(6105, 1, 811, 'Someone who has &lt;i&gt;few muscles&lt;/i&gt; may develop a bit of an &lt;b&gt;inferiority&lt;/b&gt; complex at the body building competition.', '', '', 13, '2010-09-19 09:05:31', '2010-10-02 03:30:00', 13, 13),
(6106, 1, 811, 'Each &lt;b&gt;achievement&lt;/b&gt; shows great &lt;i&gt;power&lt;/i&gt; in your chosen &lt;i&gt;craft&lt;/i&gt;.', '', '', 13, '2010-09-19 09:06:34', '2010-10-02 03:30:00', 13, 13),
